create FUNCTION [dbo].[udf_GetRequestWorkflowStatus] (
   @p_RequestType    NVARCHAR(50), --Always should match to EntityCode in Entity Table
   @p_ReferenceID    NVARCHAR(12),--Primary Key field value in respective Requests table
   @p_portcode       NVARCHAR(2) = NULL) --Few requests (EG: UserRegistration) PortCode is mandatory
   RETURNS NVARCHAR(2)
  WITH EXEC AS CALLER, ENCRYPTION
AS
   BEGIN
      DECLARE @result   NVARCHAR(2)
      DECLARE @m_entityid   INT

      set @result = 'NF'

      BEGIN
         SELECT @m_entityid = E.EntityID
         FROM Entity E
         WHERE E.EntityCode = @p_RequestType;

         IF (@p_RequestType='IMDGAN') --ArrivalNotification EntityCode from Entity Table
            BEGIN
               SELECT @result = case when (R.AnyDangerousGoodsonBoard <> 'A' ) then 'NA' else 'NF' END
               FROM ArrivalNotification R
               WHERE R.VCN = @p_ReferenceID            
               
               if (@result = 'NF')
                 begin
                   SELECT @result = CASE WHEN WT.NextStep = 9999 THEN 'Y' ELSE 'N' END 
                     FROM ArrivalNotification R
                          INNER JOIN WorkflowInstance WI ON R.VCN = WI.ReferenceID 
                          INNER JOIN WorkflowTask WT ON WT.EntityID = WI.EntityID AND WT.WorkflowTaskCode = WI.WorkflowTaskCode
                    WHERE     WI.ReferenceID = @p_ReferenceID AND WI.PortCode = WT.PortCode
                          AND WI.EntityID = @m_entityid
                 END
            END

         IF (@p_RequestType='ISPSAN') --ArrivalNotification EntityCode from Entity Table
            BEGIN
               SELECT @result = case when (R.AppliedForISPS <> 'A' ) then 'NA' else 'NF' END
               FROM ArrivalNotification R
               WHERE R.VCN = @p_ReferenceID            
               
               if (@result = 'NF')
                 begin
                   SELECT @result = CASE WHEN WT.NextStep = 9999 THEN 'Y' ELSE 'N' END 
                     FROM ArrivalNotification R
                          INNER JOIN WorkflowInstance WI ON R.VCN = WI.ReferenceID 
                          INNER JOIN WorkflowTask WT ON WT.EntityID = WI.EntityID AND WT.WorkflowTaskCode = WI.WorkflowTaskCode
                    WHERE     WI.ReferenceID = @p_ReferenceID AND WI.PortCode = WT.PortCode
                          AND WI.EntityID = @m_entityid
                 END
            END

         IF (@p_RequestType = 'ARVLNOT' OR @p_RequestType = 'PHAN') --ArrivalNotification EntityCode from Entity Table
            BEGIN
               SELECT @result = CASE WHEN WT.NextStep = 9999 THEN 'Y' ELSE 'N' END
                 FROM ArrivalNotification R
                      INNER JOIN WorkflowInstance WI ON R.VCN = WI.ReferenceID 
                      INNER JOIN WorkflowTask WT ON WT.EntityID = WI.EntityID AND WT.WorkflowTaskCode = WI.WorkflowTaskCode
                WHERE     WI.ReferenceID = @p_ReferenceID AND WI.PortCode = WT.PortCode
                      AND WI.EntityID = @m_entityid
            END
            
         IF (@p_RequestType = 'SERVREQ') --Service Request EntityCode from Entity Table
            BEGIN
               SELECT @result = CASE WHEN (WT.NextStep = 9999) THEN 'Y' ELSE 'N' END
                 FROM ServiceRequest R
                      INNER JOIN WorkflowInstance WI ON R.ServiceRequestID  = WI.ReferenceID 
                      INNER JOIN WorkflowTask WT ON WT.EntityID = WI.EntityID AND WT.WorkflowTaskCode = WI.WorkflowTaskCode
                WHERE     WI.ReferenceID = @p_ReferenceID AND WI.PortCode = WT.PortCode
                      AND WI.EntityID = @m_entityid
            END

         IF (@p_RequestType = 'USERREG') --User Registration EntityCode from Entity Table
            BEGIN
               SELECT @result = CASE WHEN (WT.NextStep = 9999 OR U.AnonymousUserYn='N') THEN 'Y' ELSE 'N' END
                 FROM Users U
                      LEFT JOIN UserPort UP on UP.UserID = U.UserID AND UP.PortCode = @p_portcode
                      LEFT JOIN WorkflowInstance WI ON UP.WorkflowInstanceId = WI.WorkflowInstanceId
                      LEFT JOIN WorkflowTask WT ON WT.EntityID = WI.EntityID AND WT.WorkflowTaskCode = WI.WorkflowTaskCode AND WT.PortCode = UP.PortCode
                WHERE     WI.ReferenceID = @p_ReferenceID AND WI.PortCode = WT.PortCode
                      AND WI.EntityID = @m_entityid
            END
            
         IF (@p_RequestType = 'DEPNOTI') 
            BEGIN
               SELECT @result = CASE WHEN (WT.NextStep = 9999) THEN 'Y' ELSE 'N' END
                 FROM DepartureNotice D
                      INNER JOIN WorkflowInstance WI ON WI.WorkflowInstanceId = D.WorkflowInstanceId
                      INNER JOIN WorkflowTask WT ON WT.EntityID = WI.EntityID AND WT.WorkflowTaskCode = WI.WorkflowTaskCode
                WHERE     WI.ReferenceID = @p_ReferenceID AND WI.PortCode = WT.PortCode
                      AND WI.EntityID = @m_entityid
            END

         IF (@p_RequestType = 'VACHREQ') --VesselAgentChange Request EntityCode from Entity Table
            BEGIN
               SELECT @result = CASE WHEN (WT.NextStep = 9999) THEN 'Y' ELSE 'N' END
                 FROM VesselAgentChange R
                      INNER JOIN WorkflowInstance WI ON R.VesselAgentChangeID  = CAST(WI.ReferenceID AS int)
                      INNER JOIN WorkflowTask WT ON WT.EntityID = WI.EntityID AND WT.WorkflowTaskCode = WI.WorkflowTaskCode
                WHERE     WI.ReferenceID = @p_ReferenceID AND WI.PortCode = WT.PortCode
                      AND WI.EntityID = @m_entityid
            END

--         IF (@p_RequestType = 'VESLREG') 
--            BEGIN
--               SELECT @result = CASE WHEN (WT.NextStep = 9999) THEN 'Y' ELSE 'N' END
--                 FROM Vessel R
--                      INNER JOIN WorkflowInstance WI ON R.IMONo  = WI.ReferenceID
--                      INNER JOIN WorkflowTask WT ON WT.EntityID = WI.EntityID AND WT.WorkflowTaskCode = WI.WorkflowTaskCode
--                WHERE     WI.ReferenceID = @p_ReferenceID AND WI.PortCode = WT.PortCode
--                      AND WI.EntityID = @m_entityid
--            END

         IF (@p_RequestType = 'DOCKPLAN') 
            BEGIN
               SELECT @result = CASE WHEN (WT.NextStep = 9999) THEN 'Y' ELSE 'N' END
                 FROM DockingPlan R
                      INNER JOIN WorkflowInstance WI ON R.DockingPlanID  = CAST(WI.ReferenceID AS int)
                      INNER JOIN WorkflowTask WT ON WT.EntityID = WI.EntityID AND WT.WorkflowTaskCode = WI.WorkflowTaskCode
                WHERE     WI.ReferenceID = @p_ReferenceID AND WI.PortCode = WT.PortCode
                      AND WI.EntityID = @m_entityid
            END
         IF (@p_RequestType = 'CRAFTRECONFIG') 
            BEGIN
               SELECT @result = CASE WHEN (WT.NextStep = 9999) THEN 'Y' ELSE 'N' END
                 FROM CraftReminderConfig CRC
                      INNER JOIN WorkflowInstance WI ON CRC.CraftReminderConfigID  = CAST(WI.ReferenceID AS int)
                      INNER JOIN WorkflowTask WT ON WT.EntityID = WI.EntityID AND WT.WorkflowTaskCode = WI.WorkflowTaskCode
                WHERE     WI.ReferenceID = @p_ReferenceID AND WI.PortCode = WT.PortCode
                      AND WI.EntityID = @m_entityid
            END
            
      END


      RETURN @result
   END
GO

CREATE FUNCTION [dbo].[udf_GetLatestWorkflowProcessId] (@p_WorkflowInstanceId INT)
   RETURNS int
   WITH
   EXEC AS CALLER
AS
   BEGIN
      declare @result int
      set @result = 0

      SELECT @result = MAX(WP.WorkflowProcessId)
      from WorkflowProcess WP
       WHERE WP.WorkflowInstanceId = @p_WorkflowInstanceId

      RETURN @result
   END
GO

