CREATE FUNCTION udf_get_columnnames(@p_table_name sysname)
RETURNS TABLE
WITH ENCRYPTION
AS
-- Usage : select * from dbo.udf_get_columnnames('udf_GetArrivalNotification')
RETURN SELECT c.name AS COLUMN_NAME,
       dt.[name] AS DATA_TYPE,
       CASE
          WHEN LD.LookupName is null
          THEN
             'N'
          ELSE
             'Y'
       END
          HASLOOKUP,LD.LookupName as QUERY
  FROM sys.all_columns AS c
       JOIN sys.types AS dt ON c.user_type_id = dt.user_type_id
       left join ReportQueryLookup LD on LD.LookupColumnname = c.[name]
 WHERE [object_id] = OBJECT_ID (@p_table_name)
GO
