SET QUOTED_IDENTIFIER ON
GO
CREATE FUNCTION [dbo].[udf_ContactNumberMask] ( @InputString varchar(4000) ) 
RETURNS VARCHAR(4000)
AS
BEGIN
DECLARE @Index          INT
DECLARE @Char           CHAR(1)
DECLARE @OutputString   VARCHAR(255)

SET @Index = 1

WHILE @Index <= LEN(@InputString)
BEGIN
    SET @Char = SUBSTRING(@InputString, @Index, 1)
    
    IF @Index = 1 OR @Index = 2 OR @Index = 4
       IF @Char = '0'    
          SET @OutputString = CONCAT(@OutputString, '')
       ELSE
          SET @OutputString = CONCAT(@OutputString, @Char)
    ELSE
       SET @OutputString = CONCAT(@OutputString, @Char)
       
    SET @Index = @Index + 1
END

RETURN @OutputString

END
GO
/****** Object:  UserDefinedFunction [dbo].[udf_FormatDateTime]    Script Date: 4/13/2015 6:53:17 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE FUNCTION [dbo].[udf_FormatDateTime] (@dt        DATETIME,
                                            @format    VARCHAR (16))
   RETURNS VARCHAR (64)
AS
   BEGIN
      DECLARE @dtVC   VARCHAR (64)
      SELECT @dtVC =
                CASE @format
                   --- Usage: select udf_FormatDateTime(field_name,'DATETIME') from table_name
                   WHEN 'LONGDATE'
                   THEN
                        DATENAME (dw, @dt)
                      + ','
                      + SPACE (1)
                      + DATENAME (m, @dt)
                      + SPACE (1)
                      + CAST (DAY (@dt) AS VARCHAR (2))
                      + ','
                      + SPACE (1)
                      + CAST (YEAR (@dt) AS CHAR (4))
                   WHEN 'LONGDATEANDTIME'
                   THEN
                        DATENAME (dw, @dt)
                      + ','
                      + SPACE (1)
                      + DATENAME (m, @dt)
                      + SPACE (1)
                      + CAST (DAY (@dt) AS VARCHAR (2))
                      + ','
                      + SPACE (1)
                      + CAST (YEAR (@dt) AS CHAR (4))
                      + SPACE (1)
                      + RIGHT (
                           CONVERT (
                              CHAR (20),
                                @dt
                              - CONVERT (DATETIME,
                                         CONVERT (CHAR (8), @dt, 112)),
                              22),
                           11)
                   WHEN 'SHORTDATE'
                   THEN
                      LEFT (CONVERT (CHAR (19), @dt, 0), 11)
                   WHEN 'SHORTDATEANDTIME'
                   THEN
                      REPLACE (
                         REPLACE (CONVERT (CHAR (19), @dt, 0), 'AM', ' AM'),
                         'PM',
                         ' PM')
                   WHEN 'UNIXTIMESTAMP'
                   THEN
                      CAST (
                         DATEDIFF (SECOND, '19700101', @dt) AS VARCHAR (64))
                   WHEN 'YYYYMMDD'
                   THEN
                      CONVERT (CHAR (8), @dt, 112)
                   WHEN 'YYYY-MM-DD'
                   THEN
                      CONVERT (CHAR (10), @dt, 23)
                   WHEN 'YYMMDD'
                   THEN
                      CONVERT (VARCHAR (8), @dt, 12)
                   WHEN 'YY-MM-DD'
                   THEN
                      STUFF (STUFF (CONVERT (VARCHAR (8), @dt, 12),
                                    5,
                                    0,
                                    '-'),
                             3,
                             0,
                             '-')
                   WHEN 'MMDDYY'
                   THEN
                      REPLACE (CONVERT (CHAR (8), @dt, 10), '-', SPACE (0))
                   WHEN 'MM-DD-YY'
                   THEN
                      CONVERT (CHAR (8), @dt, 10)
                   WHEN 'MM/DD/YY'
                   THEN
                      CONVERT (CHAR (8), @dt, 1)
                   WHEN 'MM/DD/YYYY'
                   THEN
                      CONVERT (CHAR (10), @dt, 101)
                   WHEN 'DDMMYY'
                   THEN
                      REPLACE (CONVERT (CHAR (8), @dt, 3), '/', SPACE (0))
                   WHEN 'DD-MM-YY'
                   THEN
                      REPLACE (CONVERT (CHAR (8), @dt, 3), '/', '-')
                   WHEN 'DD/MM/YY'
                   THEN
                      CONVERT (CHAR (8), @dt, 3)
                   WHEN 'DD/MM/YYYY'
                   THEN
                      CONVERT (CHAR (10), @dt, 103)
                   WHEN 'HH:MM:SS 24'
                   THEN
                      CONVERT (CHAR (8), @dt, 8)
                   WHEN 'HH:MM 24'
                   THEN
                      LEFT (CONVERT (VARCHAR (8), @dt, 8), 5)
                   WHEN 'HH:MM:SS 12'
                   THEN
                      LTRIM (RIGHT (CONVERT (VARCHAR (20), @dt, 22), 11))
                   WHEN 'HH:MM 12'
                   THEN
                      LTRIM (
                           SUBSTRING (CONVERT (VARCHAR (20), @dt, 22), 10, 5)
                         + RIGHT (CONVERT (VARCHAR (20), @dt, 22), 3))
                   WHEN 'DATETIME'
                   THEN
                        cast (datepart (dd, @dt) AS CHAR (2))
                      + '-'
                      + cast (left (DATENAME (MONTH, @dt), 3) AS CHAR (3))
                      + '-'
                      + cast (year (@dt) AS CHAR (4))
                      + ' '
                      + LTRIM (RIGHT (CONVERT (VARCHAR (20), @dt, 22), 11))
                   ELSE
                      'Invalid format specified'
                END
      RETURN @dtVC
   END
GO
/****** Object:  UserDefinedFunction [dbo].[udf_get_weekdate]    Script Date: 4/13/2015 6:53:17 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE FUNCTION [dbo].[udf_get_weekdate](@p_weekno int, @p_firstdayofyear varchar(8), @p_dayname nvarchar (20))
--RETURNS nvarchar(20)
RETURNS date 
AS
begin
  declare @result date
                    
                     select @result = (select fd  from (
                    select fd-1 as fd, datename(dw, fd-1) dayname from (select dateadd(dd,(@p_weekno-1)*7,dateadd(dd,2-datepart(dw,@p_firstdayofyear),@p_firstdayofyear)) fd) x 
                    union all
                    select fd, datename(dw, fd) dayname from (select dateadd(dd,(@p_weekno-1)*7,dateadd(dd,2-datepart(dw,@p_firstdayofyear),@p_firstdayofyear)) fd) x 
                    union all
                    select fd+1, datename(dw, fd+1) dayname from (select dateadd(dd,(@p_weekno-1)*7,dateadd(dd,2-datepart(dw,@p_firstdayofyear),@p_firstdayofyear)) fd) x 
                    union all
                    select fd+2, datename(dw, fd+2) dayname from (select dateadd(dd,(@p_weekno-1)*7,dateadd(dd,2-datepart(dw,@p_firstdayofyear),@p_firstdayofyear)) fd) x 
                    union all
                    select fd+3, datename(dw, fd+3) dayname from (select dateadd(dd,(@p_weekno-1)*7,dateadd(dd,2-datepart(dw,@p_firstdayofyear),@p_firstdayofyear)) fd) x 
                    union all
                    select fd+4, datename(dw, fd+4) dayname from (select dateadd(dd,(@p_weekno-1)*7,dateadd(dd,2-datepart(dw,@p_firstdayofyear),@p_firstdayofyear)) fd) x 
                    union all
                    select fd+5, datename(dw, fd+5) dayname from (select dateadd(dd,(@p_weekno-1)*7,dateadd(dd,2-datepart(dw,@p_firstdayofyear),@p_firstdayofyear)) fd) x) a
                    where dayname = @p_dayname)
return @result
end
GO
