/****** Object:  UserDefinedFunction [dbo].[udf_GetDashboardBerthOccupancy_Values]    Script Date: 4/13/2015 6:53:17 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE FUNCTION [dbo].[udf_GetDashboardBerthOccupancy_Values] (
 @DashBoardConfig VARCHAR (5),
 @PortCode VARCHAR (2),
 @FromDate DATE,
 @ToDate DATE)
 RETURNS INT
AS
 BEGIN
 DECLARE @Values INT,
 @day INT,
 @BERTHACTIVE INT,
 @ALLBERTH INT
 SET @Values = '0'
 SELECT @day = (select datediff(day, @FromDate, @ToDate) as days)
 SELECT @BERTHACTIVE = COUNT(*) FROM BERTH WHERE RecordStatus='A'
 SELECT @ALLBERTH = COUNT(*) FROM BERTH 
BEGIN 
SELECT @Values =  (sum(datediff(minute, vcm.ATB, vcm.ATUB))*@BERTHACTIVE)/(@day*24*60*@ALLBERTH)   from VesselCallMovement vcm 
inner join ServiceRequest sr on vcm.ServiceRequestID = sr.ServiceRequestID 
inner join ArrivalNotification an on vcm.VCN = an.VCN 
inner join port pt on an.PortCode = pt.PortCode 
inner join Vessel vsl on an.VesselID = vsl.VesselID 
inner join SubCategory sc on vsl.VesselType = sc.SubCatCode 
inner join SubCategory sc1 on vcm.MovementType = sc1.SubCatCode 
inner join Quay qa on qa.PortCode = pt.PortCode 
inner join berth bt on bt.PortCode = qa.PortCode AND bt.QuayCode = qa.QuayCode 
inner join SubCategory sc2 on bt.BerthType = sc2.SubCatCode 
WHERE (PT.PortCode = @PortCode OR @PortCode IS NULL) AND 
--CAST (vcm.CreatedDate  AS DATE) BETWEEN @FromDate AND @ToDate 
vcm.atb >= @FromDate and vcm.atub <= @ToDate
END
RETURN @Values  
END
GO
/****** Object:  UserDefinedFunction [dbo].[udf_GetDashboardBerthUtilization]    Script Date: 4/13/2015 6:53:17 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE FUNCTION [dbo].[udf_GetDashboardBerthUtilization] (
@DashBoardConfig VARCHAR (5),
@PortCode VARCHAR (2),
@FromDate DATE,
@ToDate DATE)
RETURNS INT
AS
BEGIN
DECLARE @Values INT
SET @Values = '0'
BEGIN 
SELECT @Values = sum(datediff(minute, cmf.LastMoveDateTime, cmf.FirstMoveDateTime))/(sum(datediff(minute, vc.ATB, vc.ATUB)))*100
from CargoManifest cmf 
inner join ArrivalNotification an on cmf.VCN = an.VCN
inner join port pt on an.PortCode = pt.PortCode 
inner join Vessel vsl on an.VesselID = vsl.VesselID 
inner join SubCategory sc on vsl.VesselType = sc.SubCatCode 
inner join VesselCall vc on vc.VCN = an.VCN 
WHERE (PT.PortCode = @PortCode OR @PortCode IS NULL) AND 
cmf.FirstMoveDateTime >= @FromDate and cmf.LastMoveDateTime <= @ToDate
END
RETURN @Values 
END
GO
/****** Object:  UserDefinedFunction [dbo].[udf_GetDashboardCommodities_Values]    Script Date: 4/13/2015 6:53:17 PM ******/
