GO
SET QUOTED_IDENTIFIER ON
GO
CREATE FUNCTION [dbo].[udf_GetDashboardCommodities_Values] (
   @DashBoardConfig    VARCHAR (5),
   @PortCode           VARCHAR (2),
   @FromDate           DATE,
   @ToDate             DATE)
   RETURNS  VARCHAR(20)
AS
   BEGIN
      DECLARE @Values    VARCHAR(20)
      SET @Values = '0'

      BEGIN
            SELECT @Values =  SUM(ac.Quantity) 
                             FROM ArrivalCommodity ac
                               INNER JOIN SubCategory sc on ac.CargoType = sc.SubCatCode 
                                 INNER JOIN port pt on  pt.PortCode = ac.PortCode 
                                    WHERE (PT.PortCode = @PortCode OR @PortCode IS NULL) AND
                                       CAST (ac.CreatedDate  AS DATE) BETWEEN @FromDate AND @ToDate 
                   
         END

      RETURN @Values
   END

GO
/****** Object:  UserDefinedFunction [dbo].[udf_GetDashboardDetails]    Script Date: 4/13/2015 6:53:17 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE FUNCTION [dbo].[udf_GetDashboardDetails] (@userid INT,
@fromdate DATETIME,
@todate DATETIME,
@portcode VARCHAR (2))
RETURNS @result TABLE
(
[BerthOccupancy] INT NULL,
[BerthUtilization] INT NULL,
[CommodityHandle]  VARCHAR(20) NULL,
[DelayStatistics] INT NULL,
[ISPSClearance] INT NULL,
[ISPSClearance_NC] INT NULL,
[ISPSClearance_Ex] INT NULL,
[ResourceUtilization] INT NULL,
[SafetyStatistics] INT NULL,
[SafetyStatistics_DF] INT NULL,
[SafetyStatistics_ADC] INT NULL,
[VesselMovements] INT NULL
)
WITH
EXEC AS CALLER
AS
BEGIN
-- Usage : Select * from dbo.udf_GetDashboardDetails('DB',2)
DECLARE @DashBoardConfig NVARCHAR (MAX)
SELECT @DashBoardConfig = UPRE.DashBoardConfig
FROM UserPreferences UPRE
WHERE UPRE.UserID = @userid

IF (@DashBoardConfig is null)
         BEGIN
            SET @DashBoardConfig =
                   (SELECT STUFF (
                              (SELECT ',' + E.EntityCode
                                 FROM RolePrivilege b
                                      INNER JOIN Entity E
                                         ON E.EntityID = b.EntityID
                                WHERE     b.RoleID = RP.RoleID
                                      AND b.SubCatCode = 'VIEW'
                                      AND E.Moduleid IN (39)
                               FOR XML PATH ( '' )),
                              1,
                              1,
                              '')
                              DashBoardConfig
                      FROM (SELECT X.RoleID
                              FROM RolePrivilege X inner join UserRole UR on X.RoleID = UR.RoleID
                             WHERE X.SubCatCode = 'VIEW' and UR.UserID = @userid
                            GROUP BY X.RoleID) RP)
         END
INSERT INTO @result (BerthOccupancy,
                           BerthUtilization,
                           CommodityHandle,
                           DelayStatistics,
                           ISPSClearance,
                           ISPSClearance_NC,
                           ISPSClearance_Ex,
                           ResourceUtilization,
                           SafetyStatistics,
                           SafetyStatistics_DF,
                           SafetyStatistics_ADC,
                           VesselMovements)
         SELECT CASE
                   WHEN CHARINDEX ('DCBO', @DashBoardConfig) > 0 THEN 
                   dbo.udf_GetDashboardBerthOccupancy_Values ('DCBO',
                                                              @PortCode,
                                                              @FromDate,
                                                              @ToDate)
                   ELSE NULL
                END
                   AS BerthOccupancy,
                CASE
                   WHEN CHARINDEX ('DCBU', @DashBoardConfig) > 0 THEN 
                   dbo.udf_GetDashboardBerthUtilization ('DCBU',
                                                              @PortCode,
                                                              @FromDate,
                                                              @ToDate)
                   ELSE NULL
                END
                   AS BerthUtilization,
                CASE
                   WHEN CHARINDEX ('DCCH', @DashBoardConfig) > 0 THEN 
dbo.udf_GetDashboardCommodities_Values ('DCCH',
                                                              @PortCode,
                                                              @FromDate,
                                                              @ToDate)
                   ELSE NULL
                END
                   AS CommodityHandle,
                CASE
                   WHEN CHARINDEX ('DCDS', @DashBoardConfig) > 0 THEN 10
                   ELSE NULL
                END
                   AS DelayStatistics,
                CASE
                   WHEN CHARINDEX ('DCIC', @DashBoardConfig) > 0
                   THEN
                      [dbo].[udf_GetDashboardDetails_Values] ('DCIC',
                                                              @PortCode,
                                                              @FromDate,
                                                              @ToDate)
                   ELSE
                      NULL
                END
                   AS ISPSClearance,
                CASE
                   WHEN CHARINDEX ('DCIC', @DashBoardConfig) > 0
                   THEN
                      [dbo].[udf_GetDashboardDetails_Values] ('DCINC',
                                                              @PortCode,
                                                              @FromDate,
                                                              @ToDate)
                   ELSE
                      NULL
                END
                   AS ISPSClearance_NC,
                CASE
                   WHEN CHARINDEX ('DCIC', @DashBoardConfig) > 0
                   THEN
                      [dbo].[udf_GetDashboardDetails_Values] ('DCIE',
                                                              @PortCode,
                                                              @FromDate,
                                                              @ToDate)
                   ELSE
                      NULL
                END
                   AS ISPSClearance_Ex,
                CASE
                   WHEN CHARINDEX ('DCRU', @DashBoardConfig) > 0 THEN 80
                   ELSE NULL
                END
                   AS ResourceUtilization,
                CASE
                   WHEN CHARINDEX ('DCSS', @DashBoardConfig) > 0 THEN 500
                   ELSE NULL
                END
                   AS SafetyStatistics,
                CASE
                   WHEN CHARINDEX ('DCSS', @DashBoardConfig) > 0 THEN 152
                   ELSE NULL
                END
                   AS SafetyStatistics_DF,
                CASE
                   WHEN CHARINDEX ('DCSS', @DashBoardConfig) > 0 THEN 89
                   ELSE NULL
                END
                   AS SafetyStatistics_ADC,
                CASE
                   WHEN CHARINDEX ('DCVM', @DashBoardConfig) > 0 THEN 
                   dbo.udf_GetDashbrdVesselMovments_Values ('DCVM',
                                                              @PortCode,
                                                              @FromDate,
                                                              @ToDate)
                   ELSE NULL
                END
                   AS VesselMovements
RETURN
   END

GO
/****** Object:  UserDefinedFunction [dbo].[udf_GetDashboardDetails_Values]    Script Date: 4/13/2015 6:53:17 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE FUNCTION [dbo].[udf_GetDashboardDetails_Values] (
   @DashBoardConfig    VARCHAR (5),
   @PortCode           VARCHAR (2),
   @FromDate           DATE,
   @ToDate             DATE)
   RETURNS INT
AS
   BEGIN
      DECLARE @Values   INT
      SET @Values = '0'

      BEGIN
      
            SELECT @Values = COUNT (AN.VCN)
              FROM ArrivalNotification AS AN
                   INNER JOIN
                   (SELECT *
FROM
(SELECT t.ReferenceID, 
        ROW_NUMBER() OVER(PARTITION BY t.ReferenceID ORDER BY t.ReferenceID) num
 FROM WorkflowInstance t inner join ArrivalNotification ar on t.ReferenceID=ar.VCN where ar.PortCode=@PortCode and ar.IsISPSANFinal<>'NF'and ar.Isdraft !='Y') inn
WHERE inn.num=1)
AS WI
                      ON AN.VCN = WI.ReferenceID 
                   INNER JOIN Entity AS E ON  E.EntityID = (select EntityID from entity where EntityCode = 'ISPSAN')
             WHERE  AN.PortCode = @PortCode
                   AND cast (AN.ModifiedDate AS DATE) BETWEEN @FromDate
                                                          AND @ToDate
                   AND AN.IsISPSANFinal =
                          CASE
                             WHEN @DashBoardConfig = 'DCIC'
                             THEN
                                'Y'
                             ELSE
                                CASE
                                   WHEN @DashBoardConfig = 'DCINC'
                                   THEN
                                      'N'
                                   ELSE
                                      CASE
                                         WHEN @DashBoardConfig = 'DCIE'
                                         THEN
                                            'NA'
                                         ELSE
                                            ''
                                      END
                                END
                          END
--                   AND E.EntityCode = 'ISPSAN'
         END

      RETURN @Values
   END

GO
/****** Object:  UserDefinedFunction [dbo].[udf_GetDashbrdVesselMovments_Values]    Script Date: 4/13/2015 6:53:17 PM ******/
