GO
CREATE FUNCTION [dbo].[udf_GetDashbrdVesselMovments_Values] (
   @DashBoardConfig    VARCHAR (5),
   @PortCode           VARCHAR (2),
   @FromDate           DATE,
   @ToDate             DATE)
   RETURNS INT
AS
   BEGIN
      DECLARE @Values   INT
      SET @Values = '0'

      BEGIN
            SELECT @Values =  COUNT(S.MovementType) 
                             FROM ServiceRequest S 
                                 INNER JOIN SubCategory SC ON S.MovementType = SC.SubCatCode 
                                 INNER JOIN VesselCallMovement VCM ON VCM.ServiceRequestID = S.ServiceRequestID 
                                 INNER JOIN ArrivalNotification an on VCM.VCN = an.VCN
                                 INNER JOIN port pt on an.PortCode = pt.PortCode
                                            WHERE (pt.PortCode = @PortCode OR @PortCode IS NULL) AND
                                              cast (VCM.ETUB AS DATE) BETWEEN @FromDate AND @ToDate and vcm.MovementStatus='CONF'
                   
         END

      RETURN @Values
   END
GO
/****** Object:  UserDefinedFunction [dbo].[udf_GetEmployeeNameByUserId]    Script Date: 4/13/2015 6:53:17 PM ******/
