CREATE FUNCTION [dbo].[udf_GetEmployeeNameByUserId] (@userid INT)
   RETURNS NVARCHAR (100)
   WITH
   EXEC AS CALLER
AS
   BEGIN
      DECLARE @result   NVARCHAR (100)
      --BEGIN TRY
      SELECT @result =
                CASE U.UserType
                   WHEN 'AGNT'
                   THEN
                        coalesce (U.FirstName, AC.FirstName)
                      + ' '
                      + coalesce (U.LastName, AC.SurName)
                   WHEN 'TO'
                   THEN
                      rtrim (
                           coalesce (U.FirstName, [TO].RegisteredName)
                         + ' '
                         + coalesce (U.LastName, ''))
                   WHEN 'EMP'
                   THEN
                        coalesce (U.FirstName, E.FirstName)
                      + ' '
                      + coalesce (U.LastName, E.LastName)
                   ELSE
                      ''
                END
        FROM Users U
             LEFT JOIN Agent A
                ON U.UserTypeID = A.AgentID AND U.UserType = 'AGNT'
             LEFT JOIN AuthorizedContactPerson AC
                ON A.AuthorizedContactPersonID = AC.AuthorizedContactPersonID
             LEFT JOIN TerminalOperator [TO]
                ON U.UserTypeID = [TO].TerminalOperatorID AND U.UserType = 'TO'
             LEFT JOIN Employee E
                ON U.UserTypeID = E.EmployeeID AND U.UserType = 'EMP'
       WHERE U.UserID = @userid

      --END TRY
      --BEGIN CATCH
      IF (@result IS NULL OR @result = '')
         BEGIN
            SET @result = 'Unknown'
         END

      --END CATCH
      RETURN @result
   END
GO
