CREATE FUNCTION [dbo].[udf_GetServiceRequestStatus] (@p_ServiceRequestID INT)
   RETURNS NCHAR (1)
   WITH
   EXEC AS CALLER
AS
   BEGIN
      declare @result NCHAR(1)
      SELECT @result = CASE WHEN WT.NextStep = 9999 THEN 'Y' ELSE 'N' END
        FROM ServiceRequest SR
             INNER JOIN WorkflowInstance WI
                ON SR.WorkflowInstanceID = WI.WorkflowInstanceId
             INNER JOIN WorkflowTask WT
                ON     WT.EntityID = WI.EntityID
                   AND WT.WorkflowTaskCode = WI.WorkflowTaskCode
       WHERE SR.ServiceRequestID = @p_ServiceRequestID

      RETURN @result
   END
GO
