CREATE FUNCTION [dbo].[udf_GetUserPreferencesDetails]
(@userid int, @param1 int)
RETURNS @result table
(
[Userid] int NULL, 
[RoleID] int NULL, 
[EntityCode] nvarchar(50) COLLATE SQL_Latin1_General_CP1_CI_AS NULL, 
[Entityname] nvarchar(100) COLLATE SQL_Latin1_General_CP1_CI_AS NULL
)
WITH EXEC AS CALLER
AS
BEGIN
DECLARE @DashBoardConfig   NVARCHAR (MAX)
      SELECT @DashBoardConfig = UPRE.DashBoardConfig
      FROM UserPreferences UPRE
      WHERE UPRE.UserID = @userid

IF(@param1 = 1)
  BEGIN

   INSERT INTO @result(Userid, RoleID, EntityCode,Entityname)
      SELECT @userid as Userid, RoleID, EntityCode,Entityname
                FROM (SELECT X.RoleID,E.EntityCode,E.Entityname
                        FROM RolePrivilege X inner join UserRole UR on X.RoleID = UR.RoleID
                        inner join Entity E ON E.EntityID = X.EntityID
                       WHERE X.SubCatCode = 'VIEW' AND E.Moduleid IN (39) and UR.UserID = @userid
                      --GROUP BY X.RoleID,E.EntityCode,E.Entityname
                     ) RP
                    

  END
         
ELSE
  IF (@DashBoardConfig is null)
    BEGIN
     INSERT INTO @result(Userid, RoleID, EntityCode,Entityname)
        SELECT @userid as Userid, RoleID, EntityCode,Entityname
                  FROM (SELECT X.RoleID,E.EntityCode,E.Entityname
                          FROM RolePrivilege X inner join UserRole UR on X.RoleID = UR.RoleID
                          inner join Entity E
                                     ON E.EntityID = X.EntityID
                         WHERE X.SubCatCode = 'VIEW' and UR.UserID = @userid AND E.Moduleid IN (39)
                        GROUP BY X.RoleID,E.EntityCode,E.Entityname) RP
                      
    END
  ELSE
    BEGIN
    INSERT INTO @result(Userid, RoleID, EntityCode,Entityname)
     SELECT @userid UserId, X.RoleID, EntityCode, Entityname FROM RolePrivilege X INNER JOIN UserRole UR ON X.RoleID = UR.RoleID INNER JOIN (SELECT EM.EntityID, value AS EntityCode, EM.Entityname FROM dbo.udf_SplitString (@DashBoardConfig, ',') ec INNER JOIN Entity EM ON EM.EntityCode = ec.value) E ON E.EntityID = X.EntityID where X.SubCatCode = 'VIEW' and UR.UserID = @userid
    END

RETURN
END
GO
