CREATE FUNCTION [dbo].[udf_GetWorkflowPreviousRemarks] (
   @p_@WorkflowInstanceId    INT)
   RETURNS NVARCHAR (MAX)
   WITH
   EXEC AS CALLER
AS
   BEGIN
      DECLARE @result   NVARCHAR (MAX)

      SELECT @result =
                STUFF (
                   (SELECT   char (10)
                           + char (10)
                           + (  dbo.udf_GetEmployeeNameByUserId (
                                   WP.CreatedBy)
                              + ' - '
                              + CONVERT (CHAR (10), WP.CreatedDate, 111)
                              + ' '
                              + substring (
                                   CONVERT (CHAR (10), WP.CreatedDate, 114),
                                   1,
                                   5)
                              + char (10)
                              + replicate (
                                   '-',
                                     len (
                                        dbo.udf_GetEmployeeNameByUserId (
                                           WP.CreatedBy))
                                   + len (
                                          CONVERT (CHAR (10),
                                                   WP.CreatedDate,
                                                   111)
                                        + ' '
                                        + substring (
                                             CONVERT (CHAR (10),
                                                      WP.CreatedDate,
                                                      114),
                                             1,
                                             5))
                                   + 4)
                              + char (10)
                              + WP.Remarks)
                      FROM WorkflowProcess WP
                     WHERE WP.WorkflowInstanceId = WI.WorkflowInstanceId
                    ORDER BY WP.WorkflowProcessId
                    FOR XML PATH ( '' )),
                   1,
                   1,
                   '')
        FROM WorkflowInstance WI
       WHERE WI.WorkflowInstanceId = @p_@WorkflowInstanceId

      IF (@result IS NULL OR @result = '')
         BEGIN
            SET @result = ''
         END

      RETURN @result
   END
GO
/****** Object:  UserDefinedFunction [dbo].[udf_GetWorkflowStatusforGrid]    Script Date: 4/13/2015 6:53:17 PM ******/
