CREATE FUNCTION [dbo].[udf_GetWorkflowStatusforGrid] (@p_SubCatCode nvarchar(10))
   RETURNS nvarchar(500)
   WITH
   EXEC AS CALLER
AS
   BEGIN
      DECLARE @result  nvarchar(500)
      SELECT @result =
            CASE SC.SubCatCode
                WHEN 'NEW' THEN 'New'
                WHEN 'EXPI' THEN 'Expired'
                WHEN 'WFVE' THEN 'Verified'
                WHEN 'UPDT' THEN 'Updated'
                WHEN 'VRES' THEN 'Resubmission Requested'
                WHEN 'FRES' THEN 'Resubmitted'
                WHEN 'VUPD' THEN 'Resubmission Updated'
                WHEN 'WFRE' THEN 'Rejected'
                WHEN 'REJ' THEN 'Rejected'
                WHEN 'WFAP' THEN 'Applied'
                WHEN 'WFSA' THEN 'Approved'
                WHEN 'APPR' THEN 'Approved'
                WHEN 'VAP' THEN 'Approved'
                WHEN 'WFCA' THEN 'Cancelled'
                WHEN 'CLOS' THEN 'Closed'
                WHEN 'WFCO' THEN 'Confirmed'
                WHEN 'WFAK' THEN 'Acknowledged'
                WHEN 'ACK' THEN 'Acknowledged'
                ELSE SC.SubCatName
             END
      FROM SubCategory SC
      WHERE SupCatCode = 'WFST' AND SC.SubCatCode=@p_SubCatCode
      set @result = coalesce(@result,'Invalid Code')
      RETURN @result
   END

GO
/****** Object:  UserDefinedFunction [dbo].[udf_SplitString]    Script Date: 4/13/2015 6:53:17 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
Create FUNCTION [dbo].[udf_SplitString] 
( 
    @string NVARCHAR(MAX), 
    @delimiter CHAR(1) 
) 
RETURNS @output TABLE(value NVARCHAR(MAX) 
) 
BEGIN 
    DECLARE @start INT, @end INT 
    SELECT @start = 1, @end = CHARINDEX(@delimiter, @string) 
    WHILE @start < LEN(@string) + 1 BEGIN 
        IF @end = 0  
            SET @end = LEN(@string) + 1
       
        INSERT INTO @output (value)  
        VALUES(SUBSTRING(@string, @start, @end - @start)) 
        SET @start = @end + 1 
        SET @end = CHARINDEX(@delimiter, @string, @start)
        
    END 
    RETURN 
END
GO
