/****** Object:  UserDefinedFunction [dbo].[udf_GetArrivalNotification]    Script Date: 4/13/2015 6:53:17 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE FUNCTION [dbo].[udf_GetArrivalNotification] ()
/*
=============================================
Author		: Ramakrishna P
Create date	: 12-Sep-14
Description	: To Get All Arrival Notification Details
Parameters 	: NA
Note            : ######## with out condition and *, is not Advisable to use this UDF ###########

Usage : 
select VCN,ETA,ETD,IMONo,PortCode,VesselName,VesselType,VesselNationality,PreferredBerthName,AlternateBerthName from dbo.udf_GetArrivalNotification () where VCN= 'VCNDB2014003'
=============================================
*/
RETURNS TABLE 
AS
RETURN SELECT ROW_NUMBER () OVER (ORDER BY AN.VCN) AS SNO,
       AN.VCN,
       AN.PortCode,
       PM.PortName,
       coalesce(VC.RecentAgentID,AN.AgentID) AgentID,
       (SELECT coalesce (UM.FirstName, AC.FirstName) + '' + coalesce (UM.LastName, AC.SurName)
          FROM Agent IA INNER JOIN AgentPort AP ON IA.AgentID = AP.AgentID AND AP.PortCode = AN.PortCode
               INNER JOIN AuthorizedContactPerson AC ON IA.AuthorizedContactPersonID = AC.AuthorizedContactPersonID
         WHERE IA.AgentID = AN.AgentID) AS AgentName,
       UM.UserId,
       UM.UserName,
       VM.IMONo,
       AN.VesselID,
       VM.VesselName,
       VT.VesselType,
       VN.VesselNationality,
       AN.VoyageIn,
       AN.VoyageOut,
       coalesce(VC.ETA,AN.ETA) ETA,
       coalesce(VC.ETD,AN.ETD) ETD,
       VC.AnchorDown,
       VC.AnchorUp,
       VC.ATA,
       VC.ATB,
       VC.ATD,
       VC.ATUB,
       VC.BreakWaterIn,
       VC.BreakWaterOut,
       VC.PortLimitIn,
       VC.PortLimitOut,
       AN.ArrDraft,
       AN.DepDraft,
       dbo.udf_GetArrivalReasonForVisit(AN.VCN) as ReasonForVisit,
       AN.IsTerminalOperator,
       AN.TerminalOperatorID,
       coalesce ([TO].RegisteredName, 'NA') AS TerminalOperatorName,
       AN.NominationDate,
       AN.AppliedForISPS,
       AN.AppliedDate,
       AN.Clearance,
       AN.ISPSReferenceNo,
       AN.PilotExemption,
       AN.ExemptionPilotID,
       PB.PortCode AS PreferredPortCode,
       PB.QuayCode AS PreferredQuayCode,
       PB.BerthCode AS PreferredBerthCode,
       PB.BerthName AS PreferredBerthName,
       coalesce (AB.PortCode,'') AS AlternatePortCode,
       coalesce (AB.QuayCode,'') AS AlternateQuayCode,
       coalesce (AB.BerthCode,'') AS AlternateBerthCode,
       coalesce (AB.BerthName,'') AS AlternateBerthName,
       VC.VesselCallID,
       VC.FromPositionPortCode,
       VC.FromPositionQuayCode,
       VC.FromPositionBerthCode,
       VC.FromPositionBollardCode,
       VC.ToPositionPortCode,
       VC.ToPositionQuayCode,
       VC.ToPositionBerthCode,
       VC.ToPositionBollardCode,
       VCM.VesselCallMovementID,
       VCM.ServiceRequestID,
       VCM.SlotStatus,
       VCM.SlotDate,
       VCM.Slot,
       VCM.MovementStatus,
       VCM.MovementType,
       VCM.MovementDateTime,
       AN.PreferredSideDock,
       AN.PreferredSideAlternateBirth,
       AN.ReasonAlternateBirth,
       AN.Tidal,
       AN.BallastWater,
       AN.WasteDeclaration,
       AN.DaylightRestriction,
       AN.DaylightSpecifyReason,
       AN.ExceedPortLimitations,
       AN.ExceedSpecifyReason,
       AN.AnyAdditionalInfo,
       AN.PlanDateTimeOfBerth,
       AN.PlanDateTimeToVacateBerth,
       AN.PlanDateTimeToStartCargo,
       AN.PlanDateTimeToCompleteCargo,
       AN.AnyDangerousGoodsonBoard,
       AN.DangerousGoodsClass,
       AN.UNNo,
       AN.LoadDischargeDate,
       AN.IMDGNetQty,
       AN.CellNo,
       AN.CargoDescription,
       AN.PlannedDurationDate,
       AN.PlannedDurationToDate,
       AN.ReasonForLayup,
       AN.BunkersRequired,
       AN.BunkersMethod,
       AN.BunkerService,
       AN.DistanceFromStern,
       AN.TonsMT,
       AN.AnyImpInfo,
       AN.DryDockBerthPortCode,
       AN.DryDockBerthQuayCode,
       AN.DryDockBerthCode,
       AN.CancelRemarks,
       AN.Isdraft,
       AN.GeneratedVCN,
       AN.SpecifyReason,
       AN.NextPortOfCall,
       AN.LastPortOfCall,
       AN.DischargeDate,
       AN.WorkflowInstanceId,
       AN.IsANFinal,
       DATEDIFF(hh, AN.CreatedDate , coalesce(VC.ETA,AN.ETA)) As ANETADiffHours,
       (SELECT coalesce (dbo.udf_GetWorkflowStatusforGrid (ANWI.WorkflowTaskCode),'NF') FROM WorkflowInstance ANWI
         WHERE ANWI.WorkflowInstanceId = AN.WorkflowInstanceId) AS ANWorkflowStatus,
       AN.IsIMDGANFinal,
       COALESCE ((SELECT dbo.udf_GetWorkflowStatusforGrid (IMDGWI.WorkflowTaskCode)
             FROM WorkflowInstance IMDGWI WHERE IMDGWI.ReferenceID = AN.VCN
                  AND IMDGWI.EntityID = (SELECT IMDGE.EntityID
                                           FROM Entity IMDGE
                                          WHERE IMDGE.EntityCode = 'IMDGAN')),'NA') AS IMDGWorkflowStatus,
       AN.IsISPSANFinal,
       coalesce ((SELECT dbo.udf_GetWorkflowStatusforGrid (ISPSWI.WorkflowTaskCode)
             FROM WorkflowInstance ISPSWI WHERE ISPSWI.ReferenceID = AN.VCN
                  AND ISPSWI.EntityID = (SELECT ISPSE.EntityID
                                           FROM Entity ISPSE
                                          WHERE ISPSE.EntityCode = 'ISPSAN')),'NA') AS ISPSWorkflowStatus,
       AN.IsPHANFinal,
       coalesce ((SELECT dbo.udf_GetWorkflowStatusforGrid (PHWI.WorkflowTaskCode)
             FROM WorkflowInstance PHWI WHERE PHWI.ReferenceID = AN.VCN
                  AND PHWI.EntityID = (SELECT PHE.EntityID
                                         FROM Entity PHE
                                        WHERE PHE.EntityCode = 'PHAN')),'NF') AS PHWorkflowStatus,
       coalesce ([dbo].[ToJSON] ( (SELECT *
                                     FROM ArrivalIMDGTanker A
                                    WHERE A.VCN = AN.VCN
                                   FOR XML PATH , ROOT)),'NA') As ArriavalIMDGTanker,
       coalesce ([dbo].[ToJSON] ( (SELECT *
                                     FROM ArrivalCommodity A
                                    WHERE A.VCN = AN.VCN
                                   FOR XML PATH , ROOT)),'NA') As ArrivalCommodity,
       coalesce ([dbo].[ToJSON] ( (SELECT *
                                     FROM ArrivalDocument A
                                    WHERE A.VCN = AN.VCN
                                   FOR XML PATH , ROOT)),'NA') As ArrivalDocument,
       coalesce ([dbo].[ToJSON] ( (SELECT *
                                     FROM Agent A
                                    WHERE A.AgentID = AN.AgentId
                                   FOR XML PATH , ROOT)),'NA') As Agent,
       coalesce ([dbo].[ToJSON] ( (SELECT *
                                     FROM TerminalOperator A
                                    WHERE A.TerminalOperatorID = AN.TerminalOperatorID
                                   FOR XML PATH , ROOT)),'NA') As TerminalOperator,
       AN.RecordStatus,
       AN.CreatedBy,
       AN.CreatedDate,
       AN.ModifiedBy,
       AN.ModifiedDate
  FROM ArrivalNotification AN
       INNER JOIN Vessel VM ON VM.VesselID = AN.VesselID
       INNER JOIN (SELECT VT.SubCatCode, VT.SubCatName AS VesselType FROM SubCategory VT INNER JOIN Vessel V ON VT.SubCatCode = V.VesselType GROUP BY VT.SubCatCode, VT.SubCatName) VT ON VT.SubCatCode = VM.VesselType
       INNER JOIN (SELECT VN.SubCatCode, VN.SubCatName AS VesselNationality FROM SubCategory VN INNER JOIN Vessel V ON VN.SubCatCode = V.VesselNationality GROUP BY VN.SubCatCode, VN.SubCatName) VN ON VN.SubCatCode = VM.VesselNationality
       INNER JOIN Port PM ON AN.PortCode = PM.PortCode
       INNER JOIN Berth PB ON AN.PreferredPortCode = pb.PortCode AND AN.PreferredQuayCode = pb.QuayCode AND AN.PreferredBerthCode = pb.BerthCode
       INNER JOIN Users UM ON UM.UserTypeID = AN.AgentID AND UM.UserType = 'AGNT'
       INNER JOIN UserPort UP ON UP.UserID = UM.UserID AND UP.PortCode = AN.PortCode AND (UP.IsFinal = 'Y' OR UM.AnonymousUserYn = 'N')
       INNER JOIN WorkflowInstance AWI ON AWI.WorkflowInstanceId = AN.WorkflowInstanceId
       INNER JOIN Entity ANET ON ANET.EntityID = AWI.EntityID
       LEFT JOIN VesselCall VC ON VC.VCN = AN.VCN
       LEFT JOIN VesselCallMovement VCM ON VCM.VCN = AN.VCN
       LEFT JOIN Berth AB ON AN.AlternatePortCode = AB.PortCode AND AN.AlternateQuayCode = AB.QuayCode AND AN.AlternateBerthCode = AB.BerthCode
       LEFT JOIN Agent A ON A.AgentId = coalesce(VC.RecentAgentID,AN.AgentID)
       LEFT JOIN TerminalOperator [TO] ON [TO].TerminalOperatorID = AN.TerminalOperatorID
