CREATE FUNCTION [dbo].[udf_GetWeekDays] (@StartDate date, @EndDate date)
RETURNS TABLE 
AS
RETURN
    WITH dates as (
    SELECT DATEPART(WEEK, @startdate) WEEKNO, @startdate as WEEKDate
    UNION ALL
    SELECT DATEPART(WEEK, DATEADD(d,1,[WEEKDate])) WEEKNO,DATEADD(d,1,[WEEKDate]) as WEEKDate
    FROM dates 
    WHERE WEEKDate < @enddate
)
SELECT WEEKNO,WEEKDate FROM dates
