CREATE FUNCTION [dbo].[udf_pendingtask] (@portcode NVARCHAR (2), @userid INT)
   RETURNS TABLE
AS
   --TODO:To be insert into temp table all query data then hardcoded value ('NEW') to be change
   RETURN SELECT e.Entityname AS RequestName,
                 e.PendingTaskColumns AS EntityColumns,
                 e.EntityCode,
                 e.PageUrl,
                 WI.WorkflowInstanceId,
                 WI.ReferenceID,
                 WP.ReferenceData,
                 replace (wft.WorkflowTaskCode, 'UPDT', 'NEW')
                    AS WorkflowTaskCode,
                 wft.NextStep,
                 dbo.udf_GetWorkflowStatusforGrid (
                    replace (sc.SubCatCode, 'UPDT', 'NEW'))
                    AS SubCatName,
                 ([dbo].[udf_GetWorkflowPreviousRemarks] (
                     WI.WorkflowInstanceId))
                    AS PreviousRemarks,
                 '' AS Remarks,
                 STUFF (
                    (SELECT ',' + b.WorkflowTaskCode
                       FROM workflowtask b
                      WHERE     b.EntityID = e.EntityID
                            AND b.Step = wft.NextStep
                            AND b.PortCode = @portcode
                     FOR XML PATH ( '' )),
                    1,
                    1,
                    '')
                    AS TaskCode,
                 STUFF (
                    (SELECT ',' + sc.SubCatName
                       FROM workflowtask b
                            JOIN SubCategory sc
                               ON b.WorkflowTaskCode = sc.SubCatCode
                      WHERE     b.EntityID = e.EntityID
                            AND b.Step = wft.NextStep
                            AND b.PortCode = @portcode
                     FOR XML PATH ( '' )),
                    1,
                    1,
                    '')
                    AS TaskName,
                 STUFF (
                    (SELECT   ','
                            + dbo.udf_GetWorkflowStatusforGrid (
                                 sc.SubCatCode)
                       FROM workflowtask b
                            JOIN SubCategory sc
                               ON b.WorkflowTaskCode = sc.SubCatCode
                      WHERE     b.EntityID = e.EntityID
                            AND b.Step = wft.NextStep
                            AND b.PortCode = @portcode
                     FOR XML PATH ( '' )),
                    1,
                    1,
                    '')
                    AS TaskDescription,
                 STUFF (
                    (SELECT ',' + b.APIUrl
                       FROM workflowtask b
                      WHERE     b.EntityID = e.EntityID
                            AND b.Step = wft.NextStep
                            AND b.PortCode = @portcode
                     FOR XML PATH ( '' )),
                    1,
                    1,
                    '')
                    AS APIUrl,
                   'Pending '
                 + e.EntityName
                 + 's for '
                 + CASE
                      WHEN WI.WorkflowTaskCode = 'VUPD'
                      THEN
                         'Resubmission ' + WS.StepDescription
                      ELSE
                         WS.StepDescription
                   END
                    AS EntityName,
					             STUFF (
                    (SELECT ',' + b.HasRemarks
                       FROM workflowtask b                          
                      WHERE     b.EntityID = e.EntityID
                            AND b.Step = wft.NextStep
                            AND b.PortCode = @portcode
                     FOR XML PATH ( '' )),
                    1,
                    1,
                    '')
                    AS HasRemarks
                
            FROM WorkflowInstance WI
                 JOIN WorkflowProcess WP
                    ON     WI.WorkflowInstanceId = WP.WorkflowInstanceId
                       AND WP.WorkflowProcessId = WI.WorkflowProcessId
                 JOIN Entity e ON WI.EntityID = e.EntityID
                 JOIN WorkflowTask wft
                    ON     WI.WorkflowTaskCode = wft.WorkflowTaskCode
                       AND wft.EntityID = wi.EntityID
                       AND wft.PortCode = @portcode
                 JOIN SubCategory sc ON wft.WorkflowTaskCode = sc.SubCatCode
                 JOIN WorkflowStep WS ON WS.StepId = wft.NextStep
           WHERE     wft.NextStep NOT IN (9999)
                 AND wft.NextStep IN (SELECT Step
                                        FROM WorkflowTaskRole wfr
                                       WHERE     RoleID IN (SELECT roleid
                                                              FROM UserRole
                                                             WHERE UserID =
                                                                      @userid)
                                             AND wfr.EntityID = e.EntityID
                                             AND wfr.PortCode = @portcode)
                 AND (   (WI.UserTypeId IN (0, 1) AND WI.UserType = 'EMP')
                      OR (    WI.UserType = (SELECT UserType
                                               FROM Users
                                              WHERE UserID = @userid)
                          AND WI.UserTypeId = (SELECT UserTypeID
                                                 FROM Users
                                                WHERE UserID = @userid)))
                 AND WI.PortCode = @portcode
GO

