/****** Object:  StoredProcedure [dbo].[usp_ArrivalNotification_DuplicateValidation]    Script Date: 4/13/2015 6:50:05 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROCEDURE [dbo].[usp_ArrivalNotification_DuplicateValidation]
@ArVCN  nvarchar(12),
@StartDate datetime,
@EndDate datetime,
@VesselID int,
@PortCode nvarchar(2)
AS BEGIN
DECLARE @Cnt1 int 
DECLARE @Cnt2 int
DECLARE @Cnt3 int

SET @Cnt1 = (select count(1) from ArrivalNotification an
  inner join VesselCall vc ON vc.VCN = an.VCN
  where an.VesselID = @VesselID 
  and an.PortCode = @PortCode 
  and vc.ATUB is null
  and vc.ATA is not null and an.VCN != @ArVCN
  and   an.RecordStatus = 'A'
  )
SET @Cnt2 = (select count(1) from ArrivalNotification an
  where   an.PortCode = @PortCode  and an.VesselID = @VesselID 
  and an.Isdraft ='N' 
  and an.IsANFinal != 'Y'
  and   an.RecordStatus = 'A'
  and an.VCN != @ArVCN
    and an.ETD >= CONVERT(datetime, @StartDate, 120)
  )
  
SET @Cnt3 = (select count(1) from ArrivalNotification an
  inner join VesselCall vc ON vc.VCN = an.VCN
  where an.VesselID = @VesselID 
  and an.PortCode = @PortCode 
    and vc.ATA is null 
    and an.IsANFinal = 'Y'
    and an.VCN != @ArVCN
  and   an.RecordStatus = 'A'
  )
  
  
IF @Cnt1 > 0 
                select top(1) concat('1@', an.VCN) from ArrivalNotification an
                inner join VesselCall vc ON vc.VCN = an.VCN
                where 
                an.VesselID = @VesselID and 
                an.PortCode = @PortCode and
                vc.ATUB is null and 
                vc.ATA is not null and 
                
                an.RecordStatus = 'A'
                and an.VCN != @ArVCN
                order by an.VCN desc
      
else if @Cnt2 > 0
                select   top(1) concat('2@', an.VCN) from ArrivalNotification an
                where 
                an.VCN != @ArVCN and
                an.VesselID = @VesselID and 
                an.PortCode = @PortCode and 
                an.Isdraft ='N' and 
                an.IsANFinal != 'Y' and 
                an.RecordStatus = 'A' and 
                an.ETD >= CONVERT(datetime, @StartDate, 120)
                order by an.VCN desc
else if @Cnt3 > 0
                select top(1) concat('2@', an.VCN) from ArrivalNotification an
                inner join VesselCall vc ON vc.VCN = an.VCN
                where an.VesselID = @VesselID and
                an.VCN != @ArVCN 
                and an.PortCode = @PortCode 
                and vc.ATA is null 
                and an.IsANFinal = 'Y'
                and   an.RecordStatus = 'A'
                 order by an.VCN desc
else  
    select '0@0'
END
GO
/****** Object:  StoredProcedure [dbo].[usp_ArrivalNotificationTimeRule]    Script Date: 4/13/2015 6:50:05 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROCEDURE [dbo].[usp_ArrivalNotificationTimeRule]
	@StartDate datetime,
  @PortCode  nvarchar(2)
AS BEGIN

DECLARE @GraceTime NVARCHAR(30) 
DECLARE @RistrictTime NVARCHAR(100) 
  

	
  SET @GraceTime = (select ConfigValue from PortGeneralConfig where PortCode = @PortCode and RecordStatus = 'A' and ConfigName ='ARRIVALGRACETIME');
  
  SET @RistrictTime = (select ConfigValue from PortGeneralConfig where PortCode = @PortCode and RecordStatus = 'A' and ConfigName = 'ARRIVALRISTRICTTIME');
   

select case 
       when (datediff(mi, getdate(), @StartDate) / 60.0) <= @RistrictTime then '1@'+@RistrictTime
       when (datediff(mi, getdate(), @StartDate) / 60.0) > @RistrictTime and (datediff(mi, getdate(), @StartDate) / 60.0) <= @GraceTime then '2@'+@GraceTime
       else '3@0'
       end ;
END
GO
/****** Object:  StoredProcedure [dbo].[USP_AURA_NOTCONFIRMED_AUTO_EMAIL]    Script Date: 4/13/2015 6:50:05 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROCEDURE [dbo].[USP_AURA_NOTCONFIRMED_AUTO_EMAIL]
AS
   BEGIN
      INSERT INTO [Notification] (NotificationTemplateCode,
                                  [DateTime],
                                  Reference,
                                  UserTypeId,
                                  UserType,
                                  PortCode,
                                  RecordStatus,
                                  CreatedBy,
                                  CreatedDate,
				  ModifiedBy,
				  ModifiedDate)
         SELECT 'RAAK'
		,getdate()
		,RA.ResourceAllocationID
		,0
		,'EMP'
		,COALESCE (AN.PortCode,'DB')
		,'A'
		,RA.CreatedBy
		,getdate()
		,RA.CreatedBy
		,getdate()
        FROM ResourceAllocation RA
             LEFT JOIN ServiceRequest SR ON SR.ServiceRequestID = RA.ServiceReferenceID AND RA.ServiceReferenceType = 'VTSR'
             LEFT JOIN SuppServiceRequest SSR ON SSR.SuppServiceRequestID = RA.ServiceReferenceID AND RA.ServiceReferenceType = 'SUPP'
	     LEFT JOIN ArrivalNotification AN on (AN.VCN = SR.VCN OR AN.VCN = SSR.VCN)
             LEFT JOIN Users RM ON RM.UserID = RA.ResourceID
             LEFT JOIN UserPort UP ON UP.UserID = RM.UserID
       WHERE     RA.TaskStatus = 'CFRI'
             AND RA.ResourceID IS NOT NULL
	     AND DATEDIFF (mi, RA.ModifiedDate, getdate ()) <= 5
             AND RA.ResourceAllocationID NOT IN (SELECT CAST(Reference AS int)
                                     FROM [Notification]
                                    WHERE NotificationTemplateCode = 'RAAK')
