/****** Object:  StoredProcedure [dbo].[usp_AutomatedResourceAllocationList]    Script Date: 4/13/2015 6:50:05 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROCEDURE [dbo].[usp_AutomatedResourceAllocationList]
	@PortCode VARCHAR(5) ,
	@SlotDate DATE	
AS
BEGIN
	-- SET NOCOUNT ON added to prevent extra result sets from
	-- interfering with SELECT statements.
	SET NOCOUNT ON;
    -- Insert statements for procedure here
	SELECT ra.AllocationDate, an.VCN, ra.ServiceReferenceID,
	    sub3.SubCatName MovementType, ISNULL(ra.ResourceID,0) ResourceID, ra.ResourceAllocationID, 
		ra.ServiceReferenceType,
		--sub2.SubCatName ServiceTypeName, 
		st.ServiceTypeName AS ServiceTypeName,
		 ra.ResourceType,  ra.TaskStatus, ra.RecordStatus, ra.CreatedBy, ra.CreatedDate,

		ra.ModifiedBy, ra.ModifiedDate, ra.AllocSlot, v.VesselName, u.FirstName, u.LastName, 
		u.FirstName + ' ' +u.LastName [Name],u.FirstName + ' ' +u.LastName TugResourceName,  ISNULL(st.IsCraft,0) IsCraft, 
		ISNULL(ra.CraftID,0) CraftID,
		c.CraftName , ra.OperationType ServiceTypeCode , ra.StartTime , ra.EndTime , ra.AcknowledgeDate
		,an.AnyDangerousGoodsonBoard  
	FROM ResourceAllocation ra 
		INNER JOIN ServiceType  st on st.ServiceTypeCode = ra.OperationType
		INNER JOIN ServiceRequest sr on sr.ServiceRequestID = ra.ServiceReferenceID
		INNER JOIN ArrivalNotification an on an.VCN= sr.VCN
		INNER JOIN Vessel v on v.VesselID = an.VesselID
		LEFT JOIN  Users u on u.UserID = ra.ResourceID and u.UserType = 'EMP' 
		LEFT JOIN  Craft c on c.CraftID = ra.CraftID
		INNER JOIN SubCategory sub1 on sub1.SubCatCode = ra.TaskStatus
		--INNER JOIN SubCategory sub2 on sub2.SubCatCode = ra.OperationType
		INNER JOIN SubCategory sub3 on sub3.SubCatCode= sr.MovementType
	Where ra.ServiceReferenceType = 'VTSR'  and ra.RecordStatus='A' and an.PortCode=@PortCode 
	and CONVERT (DATE, ra.AllocationDate) BETWEEN  CONVERT (DATE, @SlotDate) AND DATEADD(day,1,CONVERT (DATE, @SlotDate)) order by ra.ServiceReferenceID
END

