CREATE PROCEDURE [dbo].[USP_CRAFT_REMINDER_AUTO_EMAIL_DAILY]
AS
	BEGIN
    DECLARE @Index                  INT    
    DECLARE @reference              NVARCHAR (12)
    DECLARE @eventscheduletrackid   INT
    DECLARE @eventscheduletaskid    INT  
    DECLARE @errmsg         NVARCHAR (MAX)
    DECLARE @p_CreatedBy            INT  
      --For Workflow Related
      DECLARE @p_EntityId             INT
      DECLARE @p_WorkflowTaskCode     NVARCHAR (4)
      DECLARE @p_CraftReminderConfigID   INT
      DECLARE @p_WorkflowInstanceId   INT
      DECLARE @p_WorkflowProcessId    INT
      DECLARE @Tokens                 NVARCHAR (MAX)
      DECLARE @p_ReferenceDataOUT     NVARCHAR (MAX)
      DECLARE @p_ReferenceData        NVARCHAR (MAX)
      DECLARE @p_Date                 DATETIME
      DECLARE @SQLString              NVARCHAR (500);
      DECLARE @ParmDefinition         NVARCHAR (500);
      DECLARE @p_RoleId               INT
      SET NOCOUNT ON
      ---
	  DECLARE @EventScheduleTrack TABLE
      (
         EventScheduleTrackID   INT IDENTITY (1, 1),
         EventScheduleTaskID    INT,
         NotificationId         INT,
         Reference              NVARCHAR (12),
         WorkflowInstanceId     INT,
         WorkflowProcessId      INT
      )
      DECLARE @CraftReminderConfig TABLE
      (
         PendingCraftReminderID   INT IDENTITY (1, 1),
         CraftReminderConfigID          INT,
         CraftID                     INT,
		 DateOfValidity		DATETIME,
		 AlertPeriod NVARCHAR(4),
		 AlertOccurance INT,
		 ExpectedDate  DATETIME     
      )
      DECLARE @RecordCnt   INT  
      SET @Index = 1

	  SET @eventscheduletaskid = 0
      SELECT @eventscheduletaskid = EST.EventScheduleTaskID
      FROM EventScheduleTask EST
      WHERE upper (EST.EventScheduleTaskName) = 'USP_CRAFT_REMINDER_AUTO_EMAIL_DAILY'	 

      --To Fetch Craft Reminder Configuration Entity Id and Tokens
      SELECT @p_Date = getdate (),
             @p_EntityId = E.EntityID,
             @Tokens = replace(replace (E.Tokens, 'PortCode', 'P.PortCode'),'DateOfValidity','[dbo].[udf_FormatDateTime](DateOfValidity,''YYYY-MM-DD'') + '' '' + [dbo].[udf_FormatDateTime](DateOfValidity,''HH:MM 24'') as DateOfValidity')
      FROM Entity E
      WHERE EntityCode = 'CRAFTRECONFIG'
      --

      --To Fetch Admin Userid
      SELECT @p_CreatedBy = UserID
      FROM Users
      WHERE UserID = (SELECT MIN (UserID)
                        FROM UserRole
                       WHERE RoleID = (SELECT RoleID
                                         FROM [Role]
                                        WHERE RoleCode = 'ADMN'))

     
      INSERT INTO @CraftReminderConfig 
         SELECT CC.CraftReminderConfigID
       ,CC.CraftID
       ,CC.DateOfValidity
       ,CC.AlertPeriod
       ,CC.AlertOccurance
       ,cast((DATEADD(day,CC.AlertOccurance*-1,CC.DateOfValidity)) as date) as [ExpectedDayDate]
  FROM (SELECT CC1.CraftReminderConfigID,CC1.CraftID,CC1.DateOfValidity,CC1.AlertPeriod1 as AlertPeriod,CC1.AlertOccurance1 as AlertOccurance
        FROM CraftReminderConfig CC1
        WHERE CC1.AlertPeriod1 = 'CADS' AND (IsFinal = 'N' OR IsFinal = 'NF')
        UNION
        SELECT CC2.CraftReminderConfigID,CC2.CraftID,CC2.DateOfValidity,CC2.AlertPeriod2 as AlertPeriod,CC2.AlertOccurance2 as AlertOccurance
        FROM CraftReminderConfig CC2
        WHERE CC2.AlertPeriod2 = 'CADS' AND (IsFinal = 'N' OR IsFinal = 'NF')
        UNION
        SELECT CC3.CraftReminderConfigID,CC3.CraftID,CC3.DateOfValidity,CC3.AlertPeriod3 as AlertPeriod,CC3.AlertOccurance3 as AlertOccurance
        FROM CraftReminderConfig CC3
        WHERE CC3.AlertPeriod3 = 'CADS' AND (IsFinal = 'N' OR IsFinal = 'NF')) CC
 WHERE  CC.AlertOccurance > 0 and CC.AlertOccurance < 367 -- NOTE : Note more than an Year
       AND case when cast((DATEADD(day,(CC.AlertOccurance*-1),CC.DateOfValidity)) as date) = cast(getdate() as date) then 1 else 0 end  = 1
       AND CraftReminderConfigID NOT IN (SELECT CONVERT (INT,Reference)
                                          FROM EventScheduleTrack 
                                           WHERE EventScheduleTaskID = @eventscheduletaskid);

      SELECT @RecordCnt = COUNT (CraftReminderConfigID)   FROM @CraftReminderConfig     
      
	--  Print @RecordCnt;

      WHILE (@Index <= @RecordCnt)
      BEGIN
         BEGIN TRY
            BEGIN TRANSACTION

			Declare @portcode nvarchar(2)
			Declare @craftid int

            SELECT @reference = CraftReminderConfigID, @craftid = CraftID
            FROM @CraftReminderConfig
            WHERE PendingCraftReminderID = @Index

			SELECT @portcode = PortCode FROM Craft WHERE CraftID = @craftid
            
            --To Fetch Intial WorkflowStatus code for Craft Reminder Configuration from WorkflowTask
            SELECT @p_WorkflowTaskCode = ConfigValue
              FROM PortGeneralConfig
             WHERE     PortCode = @portcode
                   AND ConfigName = 'WorkFlowInitialStatus'

            INSERT INTO [Notification] (NotificationTemplateCode,
                                        [DateTime],
                                        Reference,
                                        EmailStatus,
                                        SMSStatus,
                                        SystemNotificationStatus,
                                        UserTypeId,
                                        UserType,
                                        PortCode,
                                        RecordStatus,
                                        CreatedBy,
                                        CreatedDate,
                                        ModifiedBy,
                                        ModifiedDate)
            VALUES (N'CRCD',
                    getdate (),
                    @reference,
                    'O',
                    'O',
                    'O',
                    0,
                    'EMP',
                    @portcode,
                    N'A',
                    @p_CreatedBy,
                    getdate (),
                    @p_CreatedBy,
                    getdate ()
                    )

            --Fetching Tokens data
            SET @SQLString =
                     N'SELECT @p_ReferenceDataOUT =[dbo].[ToJSON] ((SELECT '
                   + @Tokens
                   + ' FROM CraftReminderConfig CRC INNER JOIN Craft C ON CRC.CraftID = C.CraftID INNER JOIN Port P ON P.PortCode = C.PortCode LEFT JOIN Entity E ON E.EntityCode = ''CRAFTRECONFIG'' WHERE CRC.CraftReminderConfigID = @id FOR XML PATH , ROOT))';
            --set @ParmDefinition = N'@id int, @p_ReferenceDataOUT nvarchar(MAX) OUTPUT'
            SET @ParmDefinition =
                   N'@id int, @p_ReferenceDataOUT nvarchar(MAX) OUTPUT'

            SET @p_CraftReminderConfigID = CAST (@reference AS INT)

            EXECUTE sp_executesql @SQLString,
                                  @ParmDefinition,
                                  @id   = @p_CraftReminderConfigID,
                                  @p_ReferenceDataOUT = @p_ReferenceData OUTPUT;

            --Raising WorkflowInstance
            EXECUTE dbo.usp_WorkflowInstance_dml @p_WorkflowInstanceId OUTPUT,
                                                 @p_EntityID,
                                                 @PortCode,
                                                 @reference,
                                                 @p_WorkflowTaskCode,
                                                 0,
                                                 'EMP',
                                                 'A',
                                                 @p_CreatedBy,
                                                 @p_Date,
                                                 @p_CreatedBy,
                                                 @p_Date

            --Inserting data into Workflowprocess table
            SELECT EntityID,
                   RoleID,
                   Step,
                   PortCode
              INTO #TempRole
              FROM WorkflowTaskRole
             WHERE     EntityID = @p_EntityId AND PortCode = @portcode
                   AND Step =(SELECT min (Step)
                              FROM WorkflowTask
                              WHERE PortCode = @portcode AND EntityID = @p_EntityId)

            WHILE (SELECT Count (1) FROM #TempRole) > 0
            BEGIN
               SELECT TOP 1
                      @p_RoleId = Roleid
               FROM #TempRole
               EXECUTE dbo.usp_WorkflowProcess_dml @p_WorkflowProcessId OUTPUT,
                                                   @p_WorkflowInstanceId,
                                                   @p_RoleId,
                                                   @p_WorkflowTaskCode,
                                                   @p_WorkflowTaskCode,
                                                   @p_ReferenceData,
                                                   'New Weekly Craft Reminder Task',
                                                   'A',
                                                   @p_CreatedBy,
                                                   @p_Date,
                                                   @p_CreatedBy,
                                                   @p_Date

               DELETE #TempRole WHERE Roleid = @p_RoleId
            END
            DROP TABLE #TempRole
            ---
			SELECT @eventscheduletrackid = SCOPE_IDENTITY ();

            --    print @eventscheduletrackid

            INSERT INTO @EventScheduleTrack (EventScheduleTaskID,
                                             NotificationId,
                                             Reference,
                                             WorkflowInstanceId)
            VALUES (@eventscheduletaskid,
                    @eventscheduletrackid,
                    @reference,
                    Null)

            --Final Insertion Tables
            INSERT INTO EventScheduleTrack (EventScheduleTaskID,
                                            NotificationId,
                                            Reference,
                                            WorkflowInstanceId)
            VALUES (@eventscheduletaskid,
                    @eventscheduletrackid,
                    @reference,
                    Null)

            SELECT @Index = @Index + 1
            COMMIT TRANSACTION
         END TRY
         BEGIN CATCH
            IF @@TRANCOUNT > 0
               ROLLBACK TRANSACTION

		BEGIN
               SELECT @errmsg = ' ErrorMessage = ' + ERROR_MESSAGE () + char (13) + char (10)

               INSERT INTO [Log] (Date,
                                  Thread,
                                  Level,
                                  Logger,
                                  Message,
                                  Exception)
               VALUES (getdate (),
                       9999,
                       N'ERROR',
                       N'Failed to execute USP_CRAFT_REMINDER_AUTO_EMAIL_DAILY',
                       @errmsg,
                       N'')
		END

         END CATCH
      END
	  END

GO
