case when divingrequestvo.LocationType='Q' then 'Quay Location' else 'Other Location' end as LocationType,
--case when divingrequestvo.LocationType='Q' then qee.QuayName else loc.LocationName end as QuayLocation,
--divingrequestvo.OccupationReason  OccupationReason ,
sb.SubCatName OccupationReason,
divingrequestvo.DRN DRN,
divingrequestvo.DivingRequestID DivingRequestID,
divingrequestvo.FromPortCode FromPortCode,
divingrequestvo.FromQuayCode FromQuayCode, 
qee.QuayName FromQuayName , 
divingrequestvo.FromBerthCode FromBerthCode, 
ber.BerthName FromBerthName,
divingrequestvo.FromBollardCode FromBollardCode ,
--bol.BollardName FromBollardName ,
(select distinct BollardName from bollard  where 
BollardCode = divingrequestvo.FromBollardCode 
and berthcode  = divingrequestvo.Fromberthcode 
and  portcode  = divingrequestvo.FromPortCode
and quaycode  = divingrequestvo.FromQuayCode) FromBollardName,
divingrequestvo.ToPortCode ToPortCode,
ToQuayCode = divingrequestvo.ToQuayCode,
qee.QuayName ToQuayName,
divingrequestvo.ToBerthCode ToBerthCode,
ber.BerthName ToBerthName ,
divingrequestvo.ToBollardCode ToBollardCode ,
--bol.BollardName ToBollardName ,
(select distinct BollardName from bollard  where 
BollardCode = divingrequestvo.ToBollardCode
and berthcode  = divingrequestvo.ToBerthCode 
and  portcode  = divingrequestvo.ToPortCode
and quaycode  = divingrequestvo.ToQuayCode) ToBollardName,
--replace(convert(NVARCHAR, divingrequestvo.RequiredByDate, 111), ' ', '/')RequiredByDate,
CONVERT(CHAR(11), divingrequestvo.RequiredByDate, 120)  as  RequiredByDate,
-- + LTRIM(RIGHT(CONVERT(CHAR(20),divingrequestvo.RequiredByDate, 22), 11)) 
--CONVERT(VARCHAR(24),divingrequestvo.RequiredByDate ,101) as  RequiredByDate,
divingrequestvo.Remarks Remarks ,
divingrequestvo.RecordStatus RecordStatus,
divingrequestvo.CreatedBy CreatedBy ,
divingrequestvo.CreatedDate CreatedDate,
divingrequestvo.ModifiedBy ModifiedBy ,
divingrequestvo.ModifiedDate ModifiedDate ,
-- Diving Request Occupation
CONVERT(CHAR(20), divingrequestvo.OcupationFromDate, 120) as  OcupationFromDate , 
-- + LTRIM(RIGHT(CONVERT(CHAR(20),divingrequestvo.OcupationFromDate, 22), 11)) as  OcupationFromDate,
CONVERT(CHAR(20), divingrequestvo.OcupationToDate, 120) as OcupationToDate, 
-- + LTRIM(RIGHT(CONVERT(CHAR(20),divingrequestvo.OcupationToDate, 22), 11)) as OcupationToDate,
divingrequestvo.HoursOfOccupation1 HoursOfOccupation1,
--emp.FirstName + ' ' + emp.LastName as Raisedby,
CONCAT(usr.FirstName, ' ', usr.LastName) Raisedby,
doa.WorkflowInstanceID as WorkflowInstanceID
from divingrequest divingrequestvo 
join SubCategory sb on sb.SubCatCode = divingrequestvo.OccupationReason
join port p on p.PortCode=divingrequestvo.FromPortCode 
left join quay qee on qee.quaycode=divingrequestvo.ToQuayCode and qee.PortCode = @portcode
left join berth ber on divingrequestvo.FromBerthCode=ber.berthcode and ber.QuayCode = qee.QuayCode and ber.PortCode = @portcode
left join bollard bol on divingrequestvo.FromBollardCode=bol.BollardCode and bol.BerthCode = ber.BerthCode and bol.QuayCode = ber.BerthCode and bol.PortCode = @portcode
left join location loc on loc.LocationID=divingrequestvo.OtherLocation 
left join users usr on usr.userid = divingrequestvo.createdby 
--left join Employee emp on emp.EmployeeID = usr.UserTypeID
left join DivingOccupationApproval doa on divingrequestvo.DivingRequestID = doa.DivingRequestID
order by ModifiedDate desc
END;

