CREATE PROCEDURE [dbo].[usp_FinalTaskExecution]
@ResourseAloID   int,
@Valpkid        int,
@OperationType   nvarchar(4),
@Usrid          int
WITH 
EXECUTE AS CALLER
AS
begin
DECLARE @DynamicQuery AS NVARCHAR(MAX)
  DECLARE @MovementType NVARCHAR(10) 


   update dbo.ResourceAllocation SET TaskStatus =  'COMP'
   WHERE ResourceAllocationID = @ResourseAloID



    SET @MovementType = (select CASE ServiceReferenceType
                        WHEN 'VTSR' THEN 
                           (select MovementType from dbo.ServiceRequest where ServiceRequestID =  a.ServiceReferenceID)
                        END MovementType
                from ResourceAllocation a
                where ResourceAllocationID = @ResourseAloID);
                
    if(@MovementType = 'ARMV')
    begin
          update VesselCall  SET
               -- ATA  =  t.LastLineIn,  As per the Discussion(RanaDheer) ATA is Not Related to Task WExecution
                ATB  =  t.LastLineIn
                FROM ( 
                      select LastLineIn
                      from ShiftingBerthingTaskExecution a 
                      WHERE a.BerthingTaskExecutionID =  @Valpkid 
                      ) t 
          WHERE VCN =  (select q.vcn from ResourceAllocation P
                        join dbo.ServiceRequest q
                        on q.ServiceRequestID = p.ServiceReferenceID
                        where p.ResourceAllocationID = @ResourseAloID GROUP BY q.vcn) 
    end
    
    if (@OperationType = 'BRTH' and @MovementType != 'SGMV')
    begin
            update VesselCall SET
                           ATB  =  t.LastLineIn,     
                           FromPositionPortCode = t.FromBollardPortCode,
                           FromPositionQuayCode = t.FromBollardQuayCode,
                           FromPositionBerthCode = t.FromBollardBerthCode,
                           FromPositionBollardCode = t.FromBollardCode,
                           ToPositionPortCode = t.ToBollardPortCode,
                           ToPositionQuayCode = t.ToBollardQuayCode,
                           ToPositionBerthCode = t.ToBollardBerthCode,
                           ToPositionBollardCode = t.ToBollardCode
            FROM ( select  a.LastLineIn, a.FromBollardPortCode, a.FromBollardQuayCode, a.FromBollardBerthCode, a.FromBollardCode,
                               a.ToBollardPortCode, a.ToBollardQuayCode, a.ToBollardBerthCode, a.ToBollardCode
                        from ShiftingBerthingTaskExecution a  inner join ResourceAllocation b 
                             on b.ResourceAllocationID = a.ResourceAllocationID
                        WHERE a.BerthingTaskExecutionID =  @Valpkid and b.ResourceAllocationID = @ResourseAloID
                  ) t 
            WHERE VesselCall.VCN = (select q.vcn from ResourceAllocation P
                                    join dbo.ServiceRequest q
                                    on q.ServiceRequestID = p.ServiceReferenceID
                                    where p.ResourceAllocationID = @ResourseAloID GROUP BY q.vcn
                                   ) 
                                   
            update VesselCallMovement SET
                           ATB  = t.LastLineIn, 
                           FromPositionPortCode = t.FromBollardPortCode,
                           FromPositionQuayCode = t.FromBollardQuayCode,
                           FromPositionBerthCode = t.FromBollardBerthCode,
                           FromPositionBollardCode = t.FromBollardCode,
                           ToPositionPortCode = t.ToBollardPortCode,
                         ToPositionQuayCode = t.ToBollardQuayCode,
                           ToPositionBerthCode = t.ToBollardBerthCode,
                           ToPositionBollardCode = t.ToBollardCode,
                           MovementStatus = 'BERT'
                FROM ( 
                        select a.LastLineIn,a.FromBollardPortCode, a.FromBollardQuayCode, a.FromBollardBerthCode, a.FromBollardCode,
                               a.ToBollardPortCode, a.ToBollardQuayCode, a.ToBollardBerthCode, a.ToBollardCode,
                               b.ServiceReferenceID
                        from ShiftingBerthingTaskExecution a  inner join ResourceAllocation b 
                                  on b.ResourceAllocationID = a.ResourceAllocationID
                        WHERE a.BerthingTaskExecutionID =  @Valpkid and b.ResourceAllocationID = @ResourseAloID
                      ) t 
                WHERE VesselCallMovement.ServiceRequestID =  T.ServiceReferenceID  
   
   
   
    end
    
    
    if ( @OperationType = 'BRTH'  AND @MovementType != 'ARMV')
    begin  
                  UPDATE VesselCallMovement SET 
                         ATUB  =  t.FirstLineOut
                        FROM ( 
                             select FirstLineOut
                             from ShiftingBerthingTaskExecution a 
                             WHERE a.BerthingTaskExecutionID =  @Valpkid 
                             ) t 
                  WHERE VCN = (select q.vcn from ResourceAllocation P 
                               join dbo.ServiceRequest q on q.ServiceRequestID = p.ServiceReferenceID
                               where p.ResourceAllocationID = @ResourseAloID )
                               AND MovementStatus = 'BERT'
                               AND RecordStatus = 'A'
                               AND ATB IS NOT NULL 
                               AND ATUB IS NULL
                               AND ServiceRequestID != (select p.ServiceReferenceID from ResourceAllocation P 
                                                        where p.ResourceAllocationID = @ResourseAloID )
                        
            END
            
    if (@MovementType = 'SGMV' and @OperationType = 'BRTH')
    begin
           update VesselCallMovement SET
                     ATUB  = t.FirstLineOut,
                     MovementStatus = 'BERT',
                     FromPositionPortCode = null,
                     FromPositionQuayCode = null,
                     FromPositionBerthCode = null,
                     FromPositionBollardCode = null,
                     ToPositionPortCode = null,
                     ToPositionQuayCode = null,
                     ToPositionBerthCode = null,
                     ToPositionBollardCode = null
                     FROM ( 
                           select FirstLineOut
                           from ShiftingBerthingTaskExecution a 
                           WHERE a.BerthingTaskExecutionID =  @Valpkid 
                          ) t 
            where ServiceRequestID =  ( Select ServiceReferenceID  from ResourceAllocation
                                         where ResourceAllocationID = @ResourseAloID  )
                                                     
            
            update VesselCall  SET
                    ATUB  = t.FirstLineOut--,
                 --   ATD  = t.FirstLineOut   As per the Discussion(RanaDheer) ATA is Not Related to Task WExecution
                    FROM ( 
                           select FirstLineOut
                          from ShiftingBerthingTaskExecution a 
                           WHERE a.BerthingTaskExecutionID =  @Valpkid 
                          ) t 
            WHERE VCN =  (select q.vcn from ResourceAllocation P
                          join dbo.ServiceRequest q on q.ServiceRequestID = p.ServiceReferenceID
                          where p.ResourceAllocationID = @ResourseAloID)
                        

    end        
    
end
GO
/****** Object:  StoredProcedure [dbo].[usp_GetArrivalGridDetails]    Script Date: 4/13/2015 6:50:05 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROCEDURE [dbo].[usp_GetArrivalGridDetails]
   @A_PortCode VARCHAR (4),
   @A_UserType VARCHAR (4),
   @A_UserTypeid int,
   @A_Userid int,
   @A_frmdt VARCHAR (25),
   @A_todt VARCHAR (25),
   @A_vcn  VARCHAR (12), 
   @A_veselid  VARCHAR (25),
   @A_imdg  VARCHAR (3), 
   @A_isps  VARCHAR (3)
    
AS
BEGIN

  if @A_UserType = 'AGNT'
   begin
              select  VCN,  VesselName, VesselType, ReasonforvisitName,
              ETA, ETD, NominationDate
              ,wfStatus, ReasonForVisit,isEditVisible,
                IsANFinal,IsPHANFinal ,IsIMDGANFinal ,IsISPSANFinal, AnyDangerousGoodsonBoard,
                IsSamsaArrested,IsArrivaStatus,IsPHANStatus,IsIMDGANStatus,IsISPSANStatus, RecordStatus
                FROM (
                   select an.VCN VCN,  vc.VesselName, sb.SubCatName VesselType, 
              dbo.udf_GetArrivalReasonForVisit(an.VCN) ReasonforvisitName,
              an.ETA, an.ETD, an.NominationDate
              ,wsb.SubCatName wfStatus, An.ReasonForVisit,
                case when (an.IsANFinal = 'Y' or an.IsPHANFinal = 'Y' or ((an.IsIMDGANFinal != 'NA' and  an.IsIMDGANFinal != 'N') or an.IsIMDGANFinal = 'Y')  or ((an.IsISPSANFinal != 'NA' and  an.IsISPSANFinal != 'N') or an.IsISPSANFinal = 'Y') ) 
              then 'false' else 'true' end as isEditVisible,  An.CreatedDate,
               an.IsANFinal,an.IsPHANFinal ,an.IsIMDGANFinal ,an.IsISPSANFinal, AnyDangerousGoodsonBoard,
                case when (sa.VesselArrested = 'Y' and sa.VesselReleased = 'Y'  ) 
               then 'true' else 'false' end as IsSamsaArrested
               
                ,(select s.SubCatName from WorkflowInstance w
                    inner join entity e on w.EntityID = e.EntityID and e.EntityCode ='ARVLNOT'
                    inner join SubCategory s on s.SubCatCode = w.WorkflowTaskCode
                    where ReferenceID = an.VCN
                ) as IsArrivaStatus
                
                  ,(select s.SubCatName from WorkflowInstance w
                    inner join entity e on w.EntityID = e.EntityID and e.EntityCode ='PHAN'
                    inner join SubCategory s on s.SubCatCode = w.WorkflowTaskCode
                    where ReferenceID = an.VCN
                ) as IsPHANStatus
                
                 ,(select s.SubCatName from WorkflowInstance w
                    inner join entity e on w.EntityID = e.EntityID and e.EntityCode ='IMDGAN'
                    inner join SubCategory s on s.SubCatCode = w.WorkflowTaskCode
                    where ReferenceID = an.VCN
                ) as IsIMDGANStatus
                
                 ,(select s.SubCatName from WorkflowInstance w
                    inner join entity e on w.EntityID = e.EntityID and e.EntityCode ='ISPSAN'
                    inner join SubCategory s on s.SubCatCode = w.WorkflowTaskCode
                    where ReferenceID = an.VCN
                ) as IsISPSANStatus,
                An.RecordStatus
               
              from ArrivalNotification An 
              inner join Vessel vc on An.VesselID = vc.VesselID
              inner join SubCategory sb on sb.SubCatCode = vc.VesselType
              inner join WorkflowInstance WI on WI.WorkflowInstanceId = An.WorkflowInstanceId
              inner join SubCategory wsb on wsb.SubCatCode = WI.WorkflowTaskCode
             -- inner join VesselCall cal on cal.VCN = An.VCN
              left join VesselArrestImmobilizationSAMSA sa on sa.VCN = AN.VCN
            
              where isnull(An.Isdraft, 'N') = 'N' and An.PortCode = @A_PortCode
           --   and  An.RecordStatus = 'A'
           and  dbo.udf_FormatDateTime(an.ETA,'yyyy-mm-dd') between   @A_frmdt and @A_todt 
           and  an.VCN = CASE @A_vcn when 'NA' then an.VCN else @A_vcn end
           and  An.VesselID = CASE @A_veselid when '0' then An.VesselID else @A_veselid end
           and  An.AnyDangerousGoodsonBoard = CASE @A_imdg when 'All' then An.AnyDangerousGoodsonBoard else @A_imdg end
           and  An.AppliedForISPS = CASE @A_isps when 'All' then An.AppliedForISPS else @A_isps end
           and An.CreatedBy = @A_Userid
             -- and An.RecordStatus = 'A'
              
            ) T order by  CreatedDate desc
  end
  else
  begin
             select an.VCN VCN,  vc.VesselName, sb.SubCatName VesselType, 
              dbo.udf_GetArrivalReasonForVisit(an.VCN) ReasonforvisitName,
              an.ETA, an.ETD, an.NominationDate
              ,wsb.SubCatName wfStatus, An.ReasonForVisit,
                case when (an.IsANFinal = 'Y' or an.IsPHANFinal = 'Y' or ((an.IsIMDGANFinal != 'NA' and  an.IsIMDGANFinal != 'N') or an.IsIMDGANFinal = 'Y' )  or ((an.IsISPSANFinal != 'NA' and  an.IsISPSANFinal != 'N') or an.IsISPSANFinal = 'Y') ) 
              then 'false' else 'true' end as isEditVisible,  An.CreatedDate,
               an.IsANFinal,an.IsPHANFinal ,an.IsIMDGANFinal ,an.IsISPSANFinal, AnyDangerousGoodsonBoard,
                case when (sa.VesselArrested = 'Y' and sa.VesselReleased = 'Y'  ) 
               then 'true' else 'false' end as IsSamsaArrested
               
                ,(select s.SubCatName from WorkflowInstance w
                    inner join entity e on w.EntityID = e.EntityID and e.EntityCode ='ARVLNOT'
                    inner join SubCategory s on s.SubCatCode = w.WorkflowTaskCode
                    where ReferenceID = an.VCN
                ) as IsArrivaStatus
                
                  ,(select s.SubCatName from WorkflowInstance w
                    inner join entity e on w.EntityID = e.EntityID and e.EntityCode ='PHAN'
                    inner join SubCategory s on s.SubCatCode = w.WorkflowTaskCode
                    where ReferenceID = an.VCN
                ) as IsPHANStatus
                
                 ,(select s.SubCatName from WorkflowInstance w
                    inner join entity e on w.EntityID = e.EntityID and e.EntityCode ='IMDGAN'
                    inner join SubCategory s on s.SubCatCode = w.WorkflowTaskCode
                    where ReferenceID = an.VCN
                ) as IsIMDGANStatus
                
                 ,(select s.SubCatName from WorkflowInstance w
                    inner join entity e on w.EntityID = e.EntityID and e.EntityCode ='ISPSAN'
                    inner join SubCategory s on s.SubCatCode = w.WorkflowTaskCode
                    where ReferenceID = an.VCN
                ) as IsISPSANStatus,
                An.RecordStatus
               
              from ArrivalNotification An 
              inner join Vessel vc on An.VesselID = vc.VesselID
              inner join SubCategory sb on sb.SubCatCode = vc.VesselType
              inner join WorkflowInstance WI on WI.WorkflowInstanceId = An.WorkflowInstanceId
              inner join SubCategory wsb on wsb.SubCatCode = WI.WorkflowTaskCode
            --  inner join VesselCall cal on cal.VCN = An.VCN
              left join VesselArrestImmobilizationSAMSA sa on sa.VCN = AN.VCN
            
              where isnull(An.Isdraft, 'N') = 'N' and An.PortCode = @A_PortCode
           --   and  An.RecordStatus = 'A'
           and  dbo.udf_FormatDateTime(an.ETA,'yyyy-mm-dd') between   @A_frmdt and @A_todt 
           and  an.VCN = CASE @A_vcn when 'NA' then an.VCN else @A_vcn end
           and  An.VesselID = CASE @A_veselid when '0' then An.VesselID else @A_veselid end
           and  An.AnyDangerousGoodsonBoard = CASE @A_imdg when 'All' then An.AnyDangerousGoodsonBoard else @A_imdg end
           and  An.AppliedForISPS = CASE @A_isps when 'All' then An.AppliedForISPS else @A_isps end
               order by  CreatedDate desc
               
             

  end
          
END

