/****** Object:  StoredProcedure [dbo].[usp_GetArrivalVCNs]    Script Date: 4/13/2015 6:50:05 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
--usp_GetArrivalVCNs 'DB',1
CREATE PROCEDURE [dbo].[usp_GetArrivalVCNs]
@PortCode VARCHAR(10),
@AgentID INT = Null
AS
BEGIN
SET NOCOUNT ON;

IF(@AgentID>0 AND @AgentID IS NOT NULL)
BEGIN
SELECT an.VCN AS VCN, 
(SELECT TOP 1 VesselCallMovementID FROM VesselCallMovement WITH (NOLOCK) WHERE VCN=an.vcn ORDER BY 1 DESC) AS VesselCallMovementID, 
v.VesselName AS VesselName,
(vc.VCN + '_' + v.VesselName) AS VCN_VesselName 
FROM ArrivalNotification an 
INNER JOIN Vessel v WITH (NOLOCK) ON an.VesselID=v.VesselID 
INNER JOIN VesselCall vc WITH (NOLOCK) ON an.VCN=vc.VCN
WHERE an.PortCode=@PortCode AND an.AgentID=@AgentID
ORDER BY an.CreatedDate DESC
END

ELSE
BEGIN
SELECT an.VCN AS VCN, 
(SELECT TOP 1 VesselCallMovementID FROM VesselCallMovement WITH (NOLOCK) WHERE VCN=an.vcn ORDER BY 1 DESC) AS VesselCallMovementID, 
v.VesselName AS VesselName,
(vc.VCN + '_' + v.VesselName) AS VCN_VesselName 
FROM ArrivalNotification an 
INNER JOIN Vessel v WITH (NOLOCK) ON an.VesselID=v.VesselID 
INNER JOIN VesselCall vc WITH (NOLOCK) ON an.VCN=vc.VCN
WHERE an.PortCode=@PortCode
ORDER BY an.CreatedDate DESC
END

END


