/****** Object:  StoredProcedure [dbo].[usp_GetAuditLogs]    Script Date: 4/13/2015 6:50:05 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROCEDURE [dbo].[usp_GetAuditLogs] ( 
   @ColumnName  NVARCHAR (100) = NULL,
   @SearchValue NVARCHAR (200) = NULL)
AS

BEGIN
      --CREATE temp table
      CREATE TABLE #temp_search
      (
         AuditTrailID              INT,
         AuditTrailConfigID        INT,
         EntryORExit               NVARCHAR (200),
         UserID                    INT,
         UserIPAddress             NVARCHAR (200),
         UserName                  NVARCHAR (200),
         ControlerName             NVARCHAR (200),
         ActionName                NVARCHAR (200),
         UserFriendlyDescription   NVARCHAR (200),
         AuditDateTime             VARCHAR (200)
      )

      --Insert into temp table
      INSERT INTO #temp_search (AuditTrailID,AuditTrailConfigID,EntryORExit,UserID,UserIPAddress,UserName,ControlerName,ActionName,UserFriendlyDescription,AuditDateTime)
	  
	  SELECT    A.AuditTrailID AS AuditTrailID,
                A.AuditTrailConfigID AS AuditTrailConfigID,
                A.EntryORExit AS EntryORExit,
                A.UserID AS UserID,
                A.UserIPAddress AS UserIPAddress,
                A.UserName AS UserName,
                E.ControlerName AS ControlerName,
                E.ActionName AS ActionName,
                E.UserFriendlyDescription AS UserFriendlyDescription,                
                CONVERT(VARCHAR(10), A.AuditDateTime, 111)+' '+ SUBSTRING(CONVERT(VARCHAR(16), A.AuditDateTime, 114), 1, 5)  AS AuditDateTime
           FROM dbo.AuditTrail A
                INNER JOIN dbo.AuditTrailConfig E
                ON E.AuditTrailConfigID = A.AuditTrailConfigID
          WHERE E.IsAuditTrailRequired = 'Y'
          ORDER BY AuditDateTime DESC	  

      DECLARE @cmd AS NVARCHAR (MAX)
      --Selecting table data
      IF (((@ColumnName IS NOT NULL) AND (@ColumnName!='') AND LEN (@ColumnName) > 0) AND ((@SearchValue IS NOT NULL) AND (@SearchValue!='') AND LEN (@SearchValue) > 0))
	           BEGIN
            SET @cmd =
                     N'SELECT TOP 200 * FROM #temp_search WHERE '+@ColumnName+' like ''%' +@SearchValue+ '%'' ORDER BY CAST(AuditDateTime AS DATETIME) DESC'
            --PRINT @cmd
            EXEC (@cmd)
         END
      ELSE
         BEGIN
            SET @cmd =
                   N'SELECT TOP 200 * FROM #temp_search ORDER BY CAST(AuditDateTime AS DATETIME) DESC'
			  --PRINT @cmd
              EXEC (@cmd)
         END

      --DROP temp table

      DROP TABLE #temp_search

   END
GO
