/****** Object:  StoredProcedure [dbo].[usp_GetCargoManifestDetails]    Script Date: 4/13/2015 6:50:05 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROCEDURE [dbo].[usp_GetCargoManifestDetails]
@PortCode VARCHAR(10)
AS
BEGIN
SET NOCOUNT ON;

SELECT
DISTINCT
an.VCN AS VCN, 
v.VesselName AS VesselName,
sc.SubCatName AS VesselType,
ag.RegisteredName AS Agent,
v.LengthOverallInM AS LengthOverallInM,
an.ArrDraft AS MaxDraft,
an.ETA AS ETA,
an.ETD AS ETD,
vc.ETB AS ETB,
vc.ETUB AS ETUB,
vc.ATA AS ATA,
vc.ATD AS ATD,
an.AnyDangerousGoodsonBoard AS IMDG,
an.NominationDate AS NominationDate,
br1.BerthName AS PreferredBerth,
br2.BerthName AS AlternateBerth,
(Select dbo.udf_GetArrivalReasonForVisit (an.VCN)) AS ReasonforVisit,
br3.BerthName AS Berth,
cm.CargoManifestID AS CargoManifestID,
cm.FirstMoveDateTime AS FirstMoveDateTime,
cm.LastMoveDateTime AS LastMoveDateTime
FROM ArrivalNotification an WITH (NOLOCK)
INNER JOIN Vessel v WITH (NOLOCK) ON an.VesselID=v.VesselID
INNER JOIN VesselCall vc WITH (NOLOCK) ON an.vcn=vc.vcn
INNER JOIN Agent ag WITH (NOLOCK) ON an.AgentID=ag.AgentID
INNER JOIN Users us WITH (NOLOCK) ON an.AgentID=us.UserTypeID
INNER JOIN SubCategory sc WITH (NOLOCK) ON v.VesselType=sc.SubCatCode
INNER JOIN Berth br1 WITH (NOLOCK) ON an.PreferredBerthCode=br1.BerthCode
INNER JOIN Berth br2 WITH (NOLOCK) ON an.AlternateBerthCode=br2.BerthCode
INNER JOIN ServiceRequest sr WITH (NOLOCK) ON an.VCN=sr.VCN
LEFT JOIN Berth br3 WITH (NOLOCK) ON vc.FromPositionBerthCode=br1.BerthCode AND br1.BerthCode!=NULL
LEFT JOIN ArrivalCommodity ac WITH (NOLOCK) ON an.VCN=ac.VCN
LEFT JOIN CargoManifest cm WITH (NOLOCK) ON ac.VCN=cm.VCN

WHERE an.PortCode=@PortCode
ORDER BY an.VCN DESC

END
GO
/****** Object:  StoredProcedure [dbo].[usp_GetConversationUsers]    Script Date: 4/13/2015 6:50:05 PM ******/
