CREATE PROCEDURE [dbo].[usp_GetConversationUsers]
@userid int
WITH 
EXECUTE AS CALLER
AS
BEGIN    
 select MU.USERID,mu.UserName,CUS.ConversationID,CONCAT(MU.UserName,'-',MU.FirstName+' '+MU.LastName) AS FirstName  from   Users MU, 
   ( select case when C.UserID1 =@userid then 
                   c.UserID2
                   else 
                    C.UserID1 
                   end  UserID,
                   C.ConversationID
                    from Conversation C, Users U1 , Users U2
where  C.UserID1 = u1.UserID
    and C.UserID2 = u2.UserID
    and ( C.UserID1 =@userid or  C.UserID2 =@userid) ) CUS
    where CUS.UserID = MU.UserID
    order by upper(UserName)

END
