CREATE PROCEDURE [dbo].[usp_GetDivingreuestsForScroll]
@portcode varchar(2)
WITH 
EXECUTE AS CALLER
AS
select distinct
case when divingrequestvo.LocationType='Q' then qee.QuayName else loc.LocationName end as QuayLocation,
case when divingrequestvo.LocationType='O' then loc.LocationID else 0 end as OtherLocation,
case when divingrequestvo.LocationType='Q' then 'Quay Location' else 'Other Location' end as LocationType,

divingrequestvo.DivingRequestID DivingRequestID,
convert(varchar(20),divingrequestvo.OcupationFromDate) OcupationFromDate,
convert(varchar(16),divingrequestvo.OcupationToDate,120) OcupationToDate,
case when divingrequestvo.LocationType='Q' then CONCAT(qee.QuayName,' / ',ber.BerthName) else loc.LocationName end as LocationorQuay,
qee.QuayName FromQuayName , 
ber.BerthName FromBerthName,
bol.BollardName FromBollardName ,
qee.QuayName ToQuayName,
ber.BerthName ToBerthName ,
bol.BollardName ToBollardName

from divingrequest divingrequestvo
left join port p on p.PortCode=divingrequestvo.FromPortCode
left join bollard bol on divingrequestvo.FromBollardCode=bol.BollardCode
left join berth ber on divingrequestvo.FromBerthCode=ber.berthcode
left join quay qee on qee.quaycode=divingrequestvo.ToQuayCode
left join location loc on loc.LocationID=divingrequestvo.OtherLocation
where getdate() >= divingrequestvo.ocupationfromdate and getdate() <= divingrequestvo.ocupationtodate and divingrequestvo.FromPortCode = @portcode

GO
/****** Object:  StoredProcedure [dbo].[usp_GetDockingVessel]    Script Date: 4/13/2015 6:50:05 PM ******/
