GO
CREATE PROCEDURE [dbo].[usp_GetDockingVessel]
   @p_SearchText NVARCHAR(200),
   @p_PortCode NVARCHAR(4)
AS
   BEGIN
   
   SELECT TOP 200 v.VesselID, v.VesselName, v.IMONo , s.SubCatName as VesselType , v.LengthOverallInM, v.BeamInM, v.PortOfRegistry
   FROM Vessel v
   LEFT JOIN DockingPlan dp on dp.VesselID = v.VesselID
   JOIN SubCategory s on v.VesselType = s.SubCatCode
   WHERE v.RecordStatus = 'A' and v.IsFinal = 'Y'
   and  v.VesselID NOT IN (SELECT DC.VesselID FROM DockingPlan DC where DC.PortCode = @p_PortCode )
   and UPPER(VesselName) Like '%'+UPPER(@p_SearchText)+'%' or  UPPER(IMONo) Like '%'+UPPER(@p_SearchText)+'%' or UPPER(CallSign) Like '%'+UPPER(@p_SearchText)+'%'   
   ORDER BY VesselName         

   END

GO
