Create PROCEDURE [dbo].[usp_GetDryDockExtensions]
	-- Add the parameters for the stored procedure here

 @PortCode Varchar(4),
 @WorkflowTaskCode Varchar(4)

AS
BEGIN
	-- SET NOCOUNT ON added to prevent extra result sets from
	-- interfering with SELECT statements.
	SET NOCOUNT ON;

   
SELECT  dd.SuppDryDockID, dd.VCN, dd.FromDate, dd.ToDate, dd.BarkeelCode, dd.CargoTons, dd.Ballast, dd.Bunkers, 
	ddex.Remarks, 
	dd.RecordStatus, dd.WorkflowInstanceID, dd.CreatedBy, dd.CreatedDate, 
	dd.ModifiedBy, dd.ModifiedDate, dd.DockPortCode, dd.DockQuayCode, dd.DockBerthCode, dd.ScheduleFromDate,
	dd.ScheduleToDate,  dd.Chamber 
	,vl.VesselName
	,vl.IMONo
	,vl.GrossRegisteredTonnageInMT
	,an.ArrDraft
	,vl.BeamInM
	,vl.LengthOverallInM
	,ddex.ScheduleStatus
	,ddex.ExtensionDateTime
	,ag.AgentID
	,ag.TelephoneNo1
	,ag.TelephoneNo2
	,ag.FaxNo
	,ag.RegisteredName
	,ag.TradingName
	,ddex.SuppDryDockExtensionID
	,ddex.WorkflowInstanceID
	,sc.SubCatName AS ScheduleStatusText

FROM Vessel AS vs
INNER JOIN ArrivalNotification AS an ON vs.VesselID = an.VesselID
INNER JOIN VesselCall AS vc ON an.VCN = vc.VCN
INNER JOIN Vessel vl ON vl.VesselID = an.VesselID
INNER JOIN WorkflowInstance AS wfi ON an.WorkflowInstanceId = wfi.WorkflowInstanceId
INNER JOIN SuppDryDock AS dd ON an.VCN = dd.VCN
INNER JOIN SuppDryDockExtension AS ddex ON dd.SuppDryDockID = ddex.SuppDryDockID
INNER JOIN Agent as ag ON ag.AgentID = an.AgentID
INNER JOIN SubCategory sc ON sc.SubCatCode = ddex.ScheduleStatus
Where an.PortCode = @PortCode AND wfi.WorkflowTaskCode = @WorkflowTaskCode AND dd.ScheduleFromDate IS NOT NULL AND dd.ScheduleToDate IS NOT NULL 

END
GO
