CREATE PROCEDURE [dbo].[usp_GetMobileScheduledTaskView]
@ResourceAllocationID int
WITH 
EXECUTE AS CALLER
AS
begin

DECLARE @Operation NVARCHAR(6) 
DECLARE @mainResourceAllocationID int

    
    SET @Operation = ( SELECT  CASE a.ServiceReferenceType
    WHEN 'SUPP' THEN 
        ( select ServiceType from dbo.SuppServiceRequest where SuppServiceRequestID = a.ServiceReferenceID)  
    ELSE 
        (SELECT MovementType FROM ServiceRequest where ServiceRequestID =  a.ServiceReferenceID)
    END  Momenttyp
        from dbo.ResourceAllocation a  where a.ResourceAllocationID = @ResourceAllocationID);
    
  
   -- SET @Operation =  (select a.OperationType from dbo.ResourceAllocation a  where a.ResourceAllocationID = @ResourceAllocationID);


IF (@Operation = 'ARMV'  or @Operation = 'SHMV' or  @Operation = 'SGMV' )
-- IF (@Operation = 'BRTH')
begin
   --- BRTH  
  /*
       if @Operation = 'ARMV'  
         SET @mainResourceAllocationID = ( select distinct   b.ResourceAllocationID from dbo.ResourceAllocation a
                                inner join  dbo.ResourceAllocation b on a.ServiceReferenceID = b.ServiceReferenceID
                                and b.OperationType = 'BRTH' 
                                where a.ResourceAllocationID = @ResourceAllocationID)
        else if @Operation = 'SHMV'  
         SET @mainResourceAllocationID = ( select  distinct  b.ResourceAllocationID from dbo.ResourceAllocation a
                                inner join  dbo.ResourceAllocation b on a.ServiceReferenceID = b.ServiceReferenceID
                                and b.OperationType = 'SHFT' 
                                where a.ResourceAllocationID = @ResourceAllocationID)  
        else 
               SET @mainResourceAllocationID = ( select distinct   b.ResourceAllocationID from dbo.ResourceAllocation a
                                inner join  dbo.ResourceAllocation b on a.ServiceReferenceID = b.ServiceReferenceID
                                and b.OperationType = 'SAIL' 
                                where a.ResourceAllocationID = @ResourceAllocationID)     

*/
    
    SET @mainResourceAllocationID  = @ResourceAllocationID;
                                 select distinct  s.ResourceAllocationID ,
                                 @Operation MovementType,
                         'VCN@'+c.VCN  VCN, 
                         'Vessel Name@' +a.VesselName VesselName, 
                         'LOA@'+Cast(a.LengthOverallInM as nvarchar(20))+' Meters'  LOA,
                              'Draft@'+Cast(c.ArrDraft  as nvarchar(20))+' Meters' Draft, 
                           'Vessel Type@'+ b.SubCatName  VesselType,
                             'GRT@'+ Cast(a.GrossRegisteredTonnageInMT  as nvarchar(20)) GRT
                             ,CASE c.AnyDangerousGoodsonBoard 
                                      WHEN 'I' THEN 'IMDG@No'
                                  ELSE 'IMDG@Yes'
                                  END IMDG,
                                  
                               CASE c.DaylightRestriction 
                                      WHEN 'I' THEN 'Daylight Restriction@No'
                                  ELSE 'Daylight Restriction@Yes'
                                  END Daylight,
                           
                               CASE c.Tidal 
                                      WHEN 'I' THEN 'Tidal Restriction@No'
                                  ELSE 'Tidal Restriction@Yes'
                                  END Tidal,
                                   'Movement@'+r.ServiceTypeName Movement,
                             'To@'+ T.BerthName +' ( '+ e.BollardName +' ) To ' + U.BerthName +' ( '+ f.BollardName +' )' FromBetrth,
                                'Available Space on Berth@'+ Cast((f.ToMeter - e.FromMeter) as nvarchar(30))+' Meters' SpaceonBerth,
                                 --'Movement Time@' + Cast(P.AllocationDate as nvarchar(30)) MovementTime
                                 'Movement Time@' +  CONVERT(VARCHAR(16), P.AllocationDate, 120) MovementTime
                                   , 'Side Alongside@'+d.SubCatName  Alongside,
                                   p.OperationType OperationType
                           from dbo.ResourceAllocation P
                           join dbo.ServiceRequest q  on q.ServiceRequestID = p.ServiceReferenceID
                           join ServiceType r on r.ServiceTypeCode = P.OperationType
                              
                              join ArrivalNotification c on c.VCN = q.VCN
                              join dbo.vessel a on a.VesselID = c.VesselID
                              join SubCategory b on b.SubCatCode  = a.VesselType
                             left join ShiftingBerthingTaskExecution s on s.ResourceAllocationID = P.ResourceAllocationID
                              left join dbo.Berth T ON T.BerthCode = s.FromBerthCode AND T.QuayCode = s.FromBerthQuayCode and T.PortCode = s.FromBerthPortCode 
                              left join dbo.Berth U ON U.BerthCode = s.ToBerthCode and U.QuayCode = s.ToBerthQuayCode AND U.PortCode = s.ToBerthPortCode
                              left join SubCategory d on d.SubCatCode  = s.BerthingSide
                              left join dbo.Bollard e on e.BollardCode = s.FromBollardCode and  e.BerthCode = s.FromBollardBerthCode  and e.QuayCode = s.FromBollardQuayCode
                                                and e.PortCode = s.FromBollardPortCode
                              left join dbo.Bollard f on f.BollardCode = s.ToBollardCode and  f.BerthCode = s.ToBollardBerthCode  and f.QuayCode = s.ToBollardQuayCode
                                    and f.PortCode = s.ToBollardPortCode
                             where p.ResourceAllocationID = @mainResourceAllocationID
  end
-- For Warping
  else  IF @Operation = 'WRMV'
  BEGIN
    -- WARP 54
        SET @mainResourceAllocationID  = @ResourceAllocationID;
        /*
         SET @mainResourceAllocationID = ( select    b.ResourceAllocationID from dbo.ResourceAllocation a
                                inner join  dbo.ResourceAllocation b on a.ServiceReferenceID = b.ServiceReferenceID
                                and b.OperationType = 'WARP' 
                                where a.ResourceAllocationID = @ResourceAllocationID)
        */
                            select distinct  s.ResourceAllocationID ,
                              @Operation MovementType,
                         'VCN@'+c.VCN  VCN, 
                         'Vessel Name@' +a.VesselName VesselName, 
                         'LOA@'+Cast(a.LengthOverallInM as nvarchar(20))+' Meters'  LOA,
                              'Draft@'+Cast(c.ArrDraft  as nvarchar(20))+' Meters' Draft, 
                           'Vessel Type@'+ b.SubCatName  VesselType,
                             'GRT@'+ Cast(a.GrossRegisteredTonnageInMT  as nvarchar(20)) GRT
                             ,CASE c.AnyDangerousGoodsonBoard 
                                      WHEN 'I' THEN 'IMDG@No'
                                  ELSE 'IMDG@Yes'
                                  END IMDG,
                               CASE c.DaylightRestriction 
                                      WHEN 'I' THEN 'Daylight Restriction@No'
                                  ELSE 'Daylight Restriction@Yes'
                                  END Daylight,
                               CASE c.Tidal 
                                      WHEN 'I' THEN 'Tidal Restriction@No'
                                  ELSE 'Tidal Restriction@Yes'
                                  END Tidal,
                                   'Movement@'+r.ServiceTypeName Movement,
                                   'Warp@Need to Capture from Table ServiceRequestWarping as New Column Warp'  Warp,
                                    --'Movement Time@' + Cast(P.AllocationDate as nvarchar(30)) MovementTime,
                                    'Movement Time@' +  CONVERT(VARCHAR(16), P.AllocationDate, 120)  MovementTime,
                                  p.OperationType OperationType
                          from dbo.ResourceAllocation P
                           join dbo.ServiceRequest q  on q.ServiceRequestID = p.ServiceReferenceID
                           join ServiceType r on r.ServiceTypeCode = P.OperationType
                              join ArrivalNotification c on c.VCN = q.VCN
                              join dbo.vessel a on a.VesselID = c.VesselID
                              join SubCategory b on b.SubCatCode  = a.VesselType
                            left  join ShiftingBerthingTaskExecution s on s.ResourceAllocationID = P.ResourceAllocationID
                             LEFT join dbo.Berth T ON T.BerthCode = s.FromBerthCode AND T.QuayCode = s.FromBerthQuayCode and T.PortCode = s.FromBerthPortCode 
                             LEFT  join dbo.Berth U ON U.BerthCode = s.ToBerthCode and U.QuayCode = s.ToBerthQuayCode AND U.PortCode = s.ToBerthPortCode
                              LEFT join SubCategory d on d.SubCatCode  = s.BerthingSide
                              LEFT join dbo.Bollard e on e.BollardCode = s.FromBollardCode and  e.BerthCode = s.FromBollardBerthCode  and e.QuayCode = s.FromBollardQuayCode
                                                and e.PortCode = s.FromBollardPortCode
                            LEFT join dbo.Bollard f on f.BollardCode = s.ToBollardCode and  f.BerthCode = s.ToBollardBerthCode  and f.QuayCode = s.ToBollardQuayCode
                                    and f.PortCode = s.ToBollardPortCode
                             where p.ResourceAllocationID = @mainResourceAllocationID
   END                          
  -- For Water - WTST  /  FLoting Crane - FCST                          
   IF (@Operation = 'WTST'  or @Operation = 'FCST')
   BEGIN
         select distinct  p.ResourceAllocationID ,
           @Operation MovementType,
                         'VCN@'+c.VCN  VCN, 
                         'Vessel Name@' +a.VesselName VesselName, 
                         'LOA@'+Cast(a.LengthOverallInM as nvarchar(20))+' Meters'  LOA,
                              'Draft@'+Cast(c.ArrDraft  as nvarchar(20))+' Meters' Draft, 
                           'Vessel Type@'+ b.SubCatName  VesselType,
                             'GRT@'+ Cast(a.GrossRegisteredTonnageInMT  as nvarchar(20)) GRT
                             ,CASE c.AnyDangerousGoodsonBoard 
                                      WHEN 'I' THEN 'IMDG@No'
                                  ELSE 'IMDG@Yes'
                                  END IMDG,
                                  
                               CASE c.DaylightRestriction 
                                      WHEN 'I' THEN 'Daylight Restriction@No'
                                  ELSE 'Daylight Restriction@Yes'
                                  END Daylight,
                           
                               CASE c.Tidal 
                                      WHEN 'I' THEN 'Tidal Restriction@No'
                                  ELSE 'Tidal Restriction@Yes'
                                  END Tidal,
                                   'Service Type@'+r.ServiceTypeName Movement,
                                   
                                'Requested Location@'+ T.BerthName FromBetrth,
                             'Quantity Required@'+ Cast(s.Quantity as nvarchar(30)) +' Tons'    Quantityintons,
                                  --'Movement Time@' + Cast(P.AllocationDate as nvarchar(30)) MovementTime,
                                   'Service Time@' +  CONVERT(VARCHAR(16), P.AllocationDate, 120)  MovementTime,
                                   p.OperationType OperationType
                           from dbo.ResourceAllocation P
                         left  join SuppServiceRequest s on SuppServiceRequestID  = P.ServiceReferenceID
                           join ServiceType r on r.ServiceTypeCode = P.OperationType
                              join ArrivalNotification c on c.VCN = s.VCN
                              join dbo.vessel a on a.VesselID = c.VesselID
                              join SubCategory b on b.SubCatCode  = a.VesselType
                      
                              join dbo.Berth T ON T.BerthCode = s.BerthCode AND T.QuayCode = s.QuayCode and T.PortCode = s.PortCode
                               where p.ResourceAllocationID = @ResourceAllocationID
   END
  
      END

