CREATE PROCEDURE [dbo].[usp_GetMobileTasksDetails]
@presourceallocationid int
WITH 
EXECUTE AS CALLER
AS
begin
select ResourceAllocationID,
ServiceReferenceType , ServiceReferenceTypeName ,
VCN, VesselName, MovementType,
ServiceReferenceID ,
OperationType , OperationTypeName ,ResourceID
,ResourceType ,AllocSlot,
StartTime,getdate() AcknowledgeDate,SlotTime,
EndTime, ResourceName 
,TaskStatus , TaskStatusName ,RecordStatus, ModifiedDate,CreatedBy,CreatedDate,ModifiedBy,Remarks,AllocationDate,CraftID,IsConfirm
from (
select a.ResourceAllocationID,a.AllocSlot SlotTime,a.CreatedBy,a.CreatedDate,a.ModifiedBy,
a.ServiceReferenceType , c.SubCatName ServiceReferenceTypeName ,a.Remarks,a.AllocationDate,a.CraftID,a.IsConfirm,a.AllocSlot,
CASE a.ServiceReferenceType
WHEN 'SUPP' THEN 
(select VCN from dbo.SuppServiceRequest where SuppServiceRequestID = a.ServiceReferenceID) 
ELSE 
(select sr.VCN from dbo.ServiceRequest sr
inner join ArrivalNotification An on An.VCN = sr.VCN 
where sr.ServiceRequestID = a.ServiceReferenceID)
END VCN,
CASE a.ServiceReferenceType
WHEN 'SUPP' THEN 
(select V.VesselName from dbo.SuppServiceRequest SSR
inner join ArrivalNotification AN on an.VCN = SSR.VCN
inner join Vessel V on V.VesselID = AN.VesselID
 where SuppServiceRequestID = a.ServiceReferenceID) 
ELSE 
(select V.VesselName from dbo.ServiceRequest sr
inner join ArrivalNotification An on An.VCN = sr.VCN 
inner join Vessel V on v.VesselID = an.VesselID
where sr.ServiceRequestID = a.ServiceReferenceID)
END VesselName,
CASE a.ServiceReferenceType
 WHEN 'SUPP' THEN 
         (select y.SubCatName from dbo.SuppServiceRequest x
          inner join SubCategory y on y.SubCatCode = x.Servicetype 
          where SuppServiceRequestID = a.ServiceReferenceID)  
       ELSE 
         (select y.SubCatName from dbo.ServiceRequest x
          inner join SubCategory y on y.SubCatCode = x.MovementType
          where ServiceRequestID =  a.ServiceReferenceID)
END MovementType,
a.ServiceReferenceID ,
a.OperationType , b.ServiceTypeName OperationTypeName ,
a.ResourceID
,a.ResourceType ,
a.StartTime as StartTime ,
a.EndTime as EndTime,CONCAT(u.FirstName,' ', u.LastName) AS ResourceName 
,a.TaskStatus , e.SubCatName TaskStatusName ,a.RecordStatus, a.ModifiedDate
from dbo.ResourceAllocation a 
inner join dbo.ServiceType b ON b.ServiceTypeCode = a.OperationType
inner join dbo.SubCategory c ON c.SubCatCode = a.ServiceReferenceType 
inner join dbo.SubCategory e ON e.SubCatCode = a.TaskStatus 
Left join dbo.Users u ON a.ResourceID = u.UserID
where a.ResourceAllocationID = @presourceallocationid
) t where t.VCN is not null
end
