CREATE PROCEDURE [dbo].[usp_GetNewMessages]
@userid int
WITH 
EXECUTE AS CALLER
AS
BEGIN    
select u.UserName,CONCAT(u.UserName,'-',u.FirstName+' '+u.LastName) AS FirstName,CUS.ConversationID,CUS.UserID, cr.IsRead,
cr.Reply,cr.ConversationReplyID, cr.CreatedDate from ConversationReply cr,
( select case when C.UserID1 = @userid then 
                   c.UserID2
                   else 
                    C.UserID1 
                   end  UserID,
   C.UserID1,c.UserID2, C.ConversationID
                    from Conversation C
where  C.UserID1 = @userid or  C.UserID2 = @userid ) CUS, Users u
    where cr.UserID = CUS.UserID
    and CUS.ConversationID = cr.ConversationID
    and u.UserID = cr.UserID 
    and cr.IsRead = 'N'
   order by upper(UserName)

END
