GO
CREATE PROCEDURE [dbo].[usp_GetPendingArrivalNotifications]
@AgentID INT,
@PortCode VARCHAR(10),
@ConfigName VARCHAR(50),
@DepartureID INT,
@UserID INT = NULL
AS
BEGIN
SET NOCOUNT ON;

DECLARE @DateTimeFormatConfigValue VARCHAR(100)
SET @DateTimeFormatConfigValue = (SELECT TOP 1 ConfigValue FROM PortGeneralConfig WITH (NOLOCK) WHERE PortCode=@PortCode AND ConfigName=@ConfigName)

IF(@DepartureID > 0 AND @DepartureID IS NOT NULL)
  BEGIN

  SELECT
  --COLUMNS LIST BINDING
    DISTINCT an.VCN AS VCN,
    an.AgentID AS AgentID,
    an.PortCode AS PortCode,
    --an.NominationDate AS SubmissionDate,
	(SELECT CASE WHEN vc.ATD IS NOT NULL THEN vc.ATD WHEN vc.ETD IS NOT NULL THEN vc.ETD ELSE an.NominationDate END) AS SubmissionDate,
    an.Tidal AS Tidal,
    an.DaylightRestriction AS DaylightRestriction,
    vc.ToPositionBerthCode AS CurrentBerth,
    (SELECT TOP 1 sb.subcatname FROM ServiceRequest Re WITH (NOLOCK) INNER JOIN SubCategory sb WITH (NOLOCK) 
    ON Re.SideAlongSideCode=sb.SubCatCode WHERE Re.vcn = an.VCN AND Re.RecordStatus='A' AND Re.IsFinal = 'Y' 
    ORDER BY re.ServiceRequestID DESC) AS SideAlongSideName,
    (SELECT TOP 1 Re.SideAlongSideCode FROM ServiceRequest Re WITH (NOLOCK) WHERE Re.vcn = an.VCN AND Re.RecordStatus='A' AND Re.IsFinal = 'Y' 
    ORDER BY re.ServiceRequestID DESC) AS SideAlongSideCode,
    dn.WorkflowInstanceId AS WorkflowInstanceId,
    ag.RegisteredName AS AgentName,
    ag.TelephoneNo1 AS AgentMobileNo,
    ag.FaxNo AS AgentFaxNo,
    ag.TradingName AS AgentRepName,
    ag.TelephoneNo2 AS AgentTelephoneNo,
    (SELECT TOP 1 EmailID FROM Users WITH (NOLOCK) WHERE UserTypeID=an.AgentID) AS AgentEmailID,
    an.VesselID AS VesselID,
    v.VesselName AS VesselName,
    an.VoyageIn AS VoyageIn,
    an.VoyageOut AS VoyageOut,
    sc.SubCatName AS VesselType,
    v.CallSign AS CallSign,
    v.IMONo AS IMONo,
    v.LengthOverallInM AS LengthOverallInM,
    v.BeamInM AS BeamInM,
    (SELECT SubCatName FROM SubCategory WITH (NOLOCK) WHERE SubCatCode=v.VesselNationality) AS VesselNationality,
    an.ArrDraft AS ArrDraft,
    an.DepDraft AS DepDraft,
    (SELECT PortName FROM PortRegistry WITH (NOLOCK) WHERE PortCode=an.NextPortOfCall) AS NextPortOfCall,
    v.GrossRegisteredTonnageInMT AS GrossRegisteredTonnageInMT,
    v.DeadWeightTonnageInMT AS DeadWeightTonnageInMT,
    dn.RecordStatus AS RecordStatus,
    vc.ATB AS ATB,
    @DateTimeFormatConfigValue as DateTimeFormatConfigValue,
    dn.WillSheBeUnderTow AS WillSheBeUnderTow,
    dn.TowingDetails AS TowingDetails,
    dn.IsVesselDoubleBank AS IsVesselDoubleBank,
    dn.NoMainEngine AS NoMainEngine,
    dbo.udf_GetWorkflowStatusforGrid(W.ToTaskCode) AS WFStatus,
    dn.EstimatedDatetimeOfSR AS EstimatedDatetimeOfSR,
    dn.IsFinal As IsFinal,
    dn.CreatedBy As CreatedBy,
    dn.CreatedDate As CreatedDate,
    dn.ModifiedBy As ModifiedBy,
    dn.ModifiedDate As ModifiedDate,
    dn.DepartureID As DepartureID
	
	--FROM TABLES LIST
	FROM ArrivalNotification an WITH (NOLOCK)
	INNER JOIN Vessel v WITH (NOLOCK) ON an.VesselID=v.VesselID
	INNER JOIN VesselCall vc WITH (NOLOCK) ON an.vcn=vc.vcn
	INNER JOIN Agent ag WITH (NOLOCK) ON an.AgentID=ag.AgentID
	INNER JOIN SubCategory sc WITH (NOLOCK) ON v.VesselType=sc.SubCatCode
	lEFT JOIN DepartureNotice dn WITH (NOLOCK) ON an.VCN=dn.vcn
	lEFT JOIN WorkflowInstance wp WITH (NOLOCK) ON dn.WorkflowInstanceId = wp.WorkflowInstanceId
	lEFT JOIN WorkflowProcess W WITH (NOLOCK) ON w.WorkflowProcessId = Wp.WorkflowProcessId
	lEFT JOIN SubCategory sb WITH (NOLOCK) ON W.ToTaskCode = sb.SubCatCode
	WHERE dn.DepartureID=@DepartureID
	ORDER BY VCN DESC

END

ELSE
  BEGIN

  SELECT
  --COLUMNS LIST BINDING
    DISTINCT an.VCN As VCN,
    an.AgentID As AgentID,
    an.PortCode As PortCode,
    --an.NominationDate AS SubmissionDate,
	(SELECT CASE WHEN vc.ATD IS NOT NULL THEN vc.ATD WHEN vc.ETD IS NOT NULL THEN vc.ETD ELSE an.NominationDate END) AS SubmissionDate,
    an.Tidal AS Tidal,
    an.DaylightRestriction AS DaylightRestriction,
    vc.ToPositionBerthCode AS CurrentBerth,
    (SELECT TOP 1 sb.subcatname FROM ServiceRequest Re INNER JOIN SubCategory sb 
    ON Re.SideAlongSideCode=sb.SubCatCode WHERE Re.vcn = an.VCN AND Re.RecordStatus='A' AND Re.IsFinal = 'Y' 
    ORDER BY re.ServiceRequestID DESC) AS SideAlongSideName,
    (SELECT TOP 1 re.SideAlongSideCode FROM ServiceRequest Re WITH (NOLOCK) 
    WHERE Re.vcn = an.VCN AND Re.RecordStatus='A' AND Re.IsFinal = 'Y' ORDER BY re.ServiceRequestID DESC) AS SideAlongSideCode,
    dn.WorkflowInstanceId As WorkflowInstanceId,
    ag.RegisteredName AS AgentName,
    ag.TelephoneNo1 AS AgentMobileNo,
    ag.FaxNo AS AgentFaxNo,
    ag.TradingName AS AgentRepName,
    ag.TelephoneNo2 AS AgentTelephoneNo,
    (SELECT TOP 1 EmailID FROM Users WITH (NOLOCK) WHERE UserTypeID=an.AgentID) AS AgentEmailID,
    an.VesselID As VesselID,
    v.VesselName As VesselName,
    an.VoyageIn As VoyageIn,
    an.VoyageOut As VoyageOut,
    sc.SubCatName AS VesselType,
    v.CallSign AS CallSign,
    v.IMONo AS IMONo,
    v.LengthOverallInM AS LengthOverallInM,
    v.BeamInM AS BeamInM,
    (SELECT SubCatName FROM SubCategory WITH (NOLOCK) WHERE SubCatCode=v.VesselNationality) AS VesselNationality,
    an.ArrDraft As ArrDraft,
    an.DepDraft As DepDraft,
    (SELECT PortName FROM PortRegistry WITH (NOLOCK) WHERE PortCode=an.NextPortOfCall) AS NextPortOfCall,
    v.GrossRegisteredTonnageInMT AS GrossRegisteredTonnageInMT,
    v.DeadWeightTonnageInMT AS DeadWeightTonnageInMT,
	dn.RecordStatus As RecordStatus,
    vc.ATB AS ATB,
    @DateTimeFormatConfigValue AS DateTimeFormatConfigValue,
    dn.WillSheBeUnderTow AS WillSheBeUnderTow,
    dn.TowingDetails AS TowingDetails,
    dn.IsVesselDoubleBank AS IsVesselDoubleBank,
    dbo.udf_GetWorkflowStatusforGrid(W.ToTaskCode) AS WFStatus,
    dn.NoMainEngine AS NoMainEngine,
    dn.EstimatedDatetimeOfSR AS EstimatedDatetimeOfSR,
    dn.IsFinal As IsFinal,
    dn.CreatedBy As CreatedBy,
    dn.CreatedDate As CreatedDate,
    dn.ModifiedBy As ModifiedBy ,
    dn.ModifiedDate As ModifiedDate,
    dn.DepartureID As DepartureID

	INTO #selectedRows

	--FROM TABLES LIST
	FROM ArrivalNotification an WITH (NOLOCK)
	INNER JOIN Vessel v WITH (NOLOCK) ON an.VesselID=v.VesselID
	INNER JOIN VesselCall vc WITH (NOLOCK) ON an.vcn=vc.vcn
	INNER JOIN Agent ag WITH (NOLOCK) ON an.AgentID=ag.AgentID
	INNER JOIN SubCategory sc WITH (NOLOCK) ON v.VesselType=sc.SubCatCode
	lEFT JOIN DepartureNotice dn WITH (NOLOCK) ON an.VCN=dn.vcn
	lEFT JOIN WorkflowInstance wp WITH (NOLOCK) ON dn.WorkflowInstanceId = wp.WorkflowInstanceId
	lEFT JOIN WorkflowProcess W WITH (NOLOCK) ON w.WorkflowProcessId = Wp.WorkflowProcessId
	lEFT JOIN SubCategory sb WITH (NOLOCK) ON W.ToTaskCode = sb.SubCatCode
	WHERE an.PortCode=@PortCode AND ((LEN(ATB) > 0 OR vc.ATB IS NOT NULL) AND (LEN(vc.ATUB) = 0 OR vc.ATUB IS NULL)) 
	ORDER BY VCN DESC

IF (@AgentID > 0)
BEGIN
   SELECT * FROM #selectedRows WHERE AgentID=@AgentID
   END
ELSE
BEGIN
   SELECT * FROM #selectedRows;
END

DROP TABLE #selectedRows

END

END

GO
