CREATE PROCEDURE [dbo].[usp_GetPendingMovementsForAllocation]
-- Add the parameters for the stored procedure here
@PortCode VARCHAR(4)
AS
BEGIN
SET NOCOUNT ON;

SELECT vcm.ServiceRequestID ,vcm.VCN, v.VesselName, VesselType, sr.MovementType ServiceRequest,
        Slot,SlotDate,SlotStatus, vc.ETB, vc.ETUB, sr.ServiceRequestID,
        ISNULL(LengthOverallInM,0) LengthOverAll, ISNULL(GrossRegisteredTonnageInMT,0) GrossRegisteredTonnage,-- SUB3.SubCatName CargoType, Quantity,
        SUB1.SubCatName MovementType
		,dbo.udf_GetArrivalReasonForVisit(vcm.VCN) AS ReasonForVisit --,SUB2.SubCatName ReasonForVisit
		,an.AnyDangerousGoodsonBoard
    FROM VesselCallMovement vcm 
        INNER JOIN  ServiceRequest sr on sr.ServiceRequestID = vcm.ServiceRequestID
        INNER JOIN ArrivalNotification an on an.VCN = sr.VCN
        INNER JOIN Vesselcall vc on vc.VCN = an.VCN
        --INNER JOIN  ArrivalCommodity acom on acom.VCN  = an.VCN
        INNER JOIN Vessel v on v.VesselID = an.VesselID
        INNER JOIN SubCategory SUB1 on SUB1.SubCatCode  = sr.MovementType
        --INNER JOIN SubCategory SUB2 on SUB2.SubCatCode  = an.ReasonForVisit
        --INNER JOIN SubCategory SUB3 on SUB2.SubCatCode  = acom.Cargotype
    WHERE VCM.SlotStatus='CNFR' 
     AND  VCM.SerViceRequestID in 
    -- ( SELECT ServiceReferenceID FROM ResourceAllocation WHERE ServiceReferenceID  NOT IN(select  ServiceRequestID From VesselCallMovement) )
    ( SELECT ServiceRequestID FROM VesselCallMovement WHERE ServiceRequestID  NOT IN(select  ServiceReferenceID From ResourceAllocation where ServiceReferenceType = 'VTSR') )
     AND an.PortCode= @PortCode AND slotdate between Getdate() and DATEADD(hour,6,Getdate())
	 --AND CONVERT(DATE, slotdate) = CONVERT(DATE, Getdate())
END
