/****** Object:  StoredProcedure [dbo].[usp_getReportBuilderData]    Script Date: 4/13/2015 6:50:05 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROCEDURE [dbo].[usp_getReportBuilderData] (
   @p_ReportObjectName    NVARCHAR (MAX),
   @p_ReportObjectType    CHAR (2),
   @p_display_columns     NVARCHAR (MAX),
   @p_obj_Parameters      NVARCHAR (MAX),
   @p_srch_filter         NVARCHAR (MAX),
   @p_orderby             NVARCHAR (MAX)
   ,@convertJSON           CHAR(1) = 'Y'
   )
AS
-- =============================================
-- Author	: Ramakrishna P
-- Create date	: 12-Sep-14
-- Description	: To Get data from Parsed UDF's/SPs/Tables/SQL Queries based on Parameters
-- Parameters 	: 1. Object Name, Object Type (Optional), Required columns, Object Parameters, Search Filters, Order By fields and data return Type JSON / Table Data as flag 'Y' or 'N' (Optional)
-- Usage 1	: exec usp_getReportBuilderData  'udf_GetDashboardDetails', '', 'BerthOccupancy', '2', '',''
-- Usage 2	: exec usp_getReportBuilderData  'select * from Port', '', '', '', '',''
-- =============================================
   BEGIN
      DECLARE @sql            NVARCHAR (MAX)
      DECLARE @orderbyclause  NVARCHAR (MAX)
      DECLARE @whereclause    NVARCHAR (MAX)
      DECLARE @selectedfields NVARCHAR (MAX)
      DECLARE @parameters     NVARCHAR (MAX)
      DECLARE @ObjectType     CHAR (2)
      DECLARE @errmsg         NVARCHAR (MAX)
      
      SET NOCOUNT ON
      SET @ObjectType = @p_ReportObjectType

      IF EXISTS
            (SELECT object_id
               FROM sys.objects
              WHERE object_id = OBJECT_ID (@p_ReportObjectName))
         BEGIN
            BEGIN TRY
               --BEGIN TRANSACTION
               SELECT @ObjectType =
                         CASE
                            WHEN COALESCE (@ObjectType, '') = '' THEN O.type
                            ELSE @ObjectType
                         END
                 FROM sys.objects O
                WHERE object_id = OBJECT_ID (@p_ReportObjectName)
               SELECT @orderbyclause =
                         CASE
                            WHEN COALESCE (@p_orderby, '') = '' THEN ''
                            ELSE ' Order by ' + @p_orderby
                         END
               SELECT @whereclause =
                         CASE
                            WHEN COALESCE (@p_srch_filter, '') = '' THEN ''
                            ELSE ' Where ' + replace(@p_srch_filter, '#COND#%','%%')
                         END
               SELECT @selectedfields =
                         CASE
                            WHEN COALESCE (@p_display_columns, '') = ''
                            THEN
                               '*'
                            ELSE
                               @p_display_columns
                         END
               SELECT @parameters =
                         CASE
                            WHEN COALESCE (@p_obj_Parameters, '') = ''
                            THEN
                               ''
                            ELSE
                               @p_obj_Parameters
                         END
		select @selectedfields = 'DISTINCT ' + @selectedfields

               if (@convertJSON = 'Y')
                 SELECT @sql =
                           CASE
                              WHEN @ObjectType IN ('IF', 'TF')
                              THEN
                                   N'select [dbo].[ToJSON](( select '
                                 + @selectedfields
                                 + ' from '
                                 + @p_ReportObjectName
                                 + '('
                                 + @parameters
                                 + ') '
                                 + @whereclause
                                 + @orderbyclause
                                 + ' FOR XML path, root)) as result'
                              ELSE
                                 CASE
                                    WHEN @ObjectType IN ('P')
                                    THEN
                                       N'EXEC ' + @p_ReportObjectName
                                    ELSE                                 --T/V/Q
                                         N'select [dbo].[ToJSON]((select '
                                       + @selectedfields
                                       + ' from '
                                       + @p_ReportObjectName
                                       + @whereclause
                                       + @orderbyclause
                                       + ' FOR XML path, root)) as result'
                                 END
                           END
               else
                   SELECT @sql =
                             CASE
                                WHEN @ObjectType IN ('IF', 'TF')
                                THEN
                                     N'select '
                                   + @selectedfields
                                   + ' from '
                                   + @p_ReportObjectName
                                   + '('
                                   + @parameters
                                   + ') '
                                   + @whereclause
                                   + @orderbyclause
                                ELSE
                                   CASE
                                      WHEN @ObjectType IN ('P')
                                      THEN
                                         N'EXEC ' + @p_ReportObjectName
                                      ELSE                                 --T/V/Q
                                           N'select '
                                         + @selectedfields
                                         + ' from '
                                         + @p_ReportObjectName
                                         + @whereclause
                                         + @orderbyclause
                                   END
                             END
               
               
               SELECT @errmsg =
                           'Object Type : ' + @ObjectType + char (13) + char (10)
                         + 'Query : ' + @sql + char (13) + char (10)
                         + 'Where Clause : ' + @whereclause + char (13) + char (10)
                         + 'Parameters : ' + @parameters + char (13) + char (10)
                         + 'Order By : ' + @orderbyclause + char (13) + char (10)

               INSERT INTO [Log] (Date,
                                  Thread,
                                  Level,
                                  Logger,
                                  Message,
                                  Exception)
               VALUES (getdate (),
                       9999,
                       N'DEBUG',
                       N'Content',
                       @errmsg,
                       N'')

               EXEC sp_executesql @sql
            --COMMIT TRANSACTION
            END TRY
            BEGIN CATCH
               SELECT @errmsg = ' ErrorMessage = ' + ERROR_MESSAGE () + char (13) + char (10)
                         + 'Object Type : ' + @ObjectType + char (13) + char (10)
                         + 'Query : ' + @sql + char (13) + char (10)
                         + 'Where Clause : ' + @whereclause + char (13) + char (10)
                         + 'Parameters : ' + @parameters + char (13) + char (10)
                         + 'Order By : ' + @orderbyclause + char (13) + char (10)

               INSERT INTO [Log] (Date,
                                  Thread,
                                  Level,
                                  Logger,
                                  Message,
                                  Exception)
               VALUES (getdate (),
                       9999,
                       N'ERROR',
                       N'Failed to execute usp_getReportBuilderData',
                       @errmsg,
                       N'')
            --             print @@ERROR
            --            IF @@TRANCOUNT > 0
            --               ROLLBACK TRANSACTION
            END CATCH
         END
      
      ELSE 
      BEGIN
        if (upper(SUBSTRING(@p_ReportObjectName, 1, 6)) = 'SELECT')
          begin
            if (@convertJSON = 'Y')
              begin
                set @Sql = 'select [dbo].[ToJSON]((' + @p_ReportObjectName + ' FOR XML path, root)) as result'
                EXEC sp_executesql @sql
              end
            else
              EXEC sp_executesql @p_ReportObjectName
          end
        else
          PRINT CHAR(39) + @p_ReportObjectName + CHAR(39) + ' is invalid object'
      END
   END
GO
