CREATE PROCEDURE [dbo].[usp_GetResourceAllocationConfigDet]
       -- Add the parameters for the stored procedure here
       @PortCode    VARCHAR(4),
       @ServiceTypeCode VARCHAR(4)

AS
BEGIN
       SET NOCOUNT ON;

       select st.ServiceTypeCode, TotalTugs, ToMeter,FromMeter, NoOfGangs , PilotCapacity , CraftType
       From ResourceAllocationConfigRule  rsccng 
              inner join ResourceAllocationMovementTypeRule rsccngr on rsccngr.ResourceAllocationConfigRuleID = rsccng.ResourceAllocationConfigRuleID
              inner join ServiceType st on st.ServiceTypeID = rsccngr.ServiceTypeID
              inner join ServiceTypeDesignation std on st.ServiceTypeID = std.ServiceTypeID
              Left Join ResourceGangConfig rscgn on rscgn.ResourceAllocationConfigRuleID = rsccng.ResourceAllocationConfigRuleID
       where rsccngr.PortCode = @PortCode  and std.PortCode=@PortCode
       and 
       rsccng.ResourceAllocationConfigRuleID in 
       (
              select top 1 cr.ResourceAllocationConfigRuleID from ResourceAllocationConfigRule cr where EffectedFrom <= getdate() and portcode = @PortCode
              order by EffectedFrom desc
       )
       and st.ServiceTypeCode = @ServiceTypeCode

END
GO
