CREATE PROCEDURE [dbo].[usp_GetResourceAttendanceData]
@datename date, @shiftid int, @designation nvarchar(4), @currentDate VARCHAR(5)
WITH 
EXECUTE AS CALLER
AS
begin

If(@currentDate = 'true')
BEGIN

declare @ParmResourceAttendanceID int
declare @ParmEmployeeID int

SET @ParmResourceAttendanceID =  (select  count (ResourceAttendanceID ) from ResourceAttendance 
  where dbo.udf_FormatDateTime(attendanceDate,'yyyy-mm-dd') =   dbo.udf_FormatDateTime(@datename,'yyyy-mm-dd') 
  and ShiftID = @shiftid and Position = @designation)

if  @ParmResourceAttendanceID > 0
   BEGIN
         SET  @ParmResourceAttendanceID = (select ResourceAttendanceID from ResourceAttendance 
           where dbo.udf_FormatDateTime(attendanceDate,'yyyy-mm-dd') =   dbo.udf_FormatDateTime(@datename,'yyyy-mm-dd') 
           and ShiftID = @shiftid and Position = @designation)

		   SET  @ParmEmployeeID = (select  ResourceAttendanceID from ResourceAttendance 
  where dbo.udf_FormatDateTime(attendanceDate,'yyyy-mm-dd') =   dbo.udf_FormatDateTime(@datename,'yyyy-mm-dd') 
  and ShiftID = @shiftid and Position = @designation)

   select  e.employeeid , 
          concat(e.Initials,' ', e.FirstName,' ',e.LastName ) EmpName,
          e.PersonalMobileNo,
		  --e.Gender
		  sc.SubCatName Gender
		  ,e.BirthDate,e.JoiningDate,e.Designation, b.AttendanceStatus,  a.ResourceAttendanceID
          from ResourceAttendance a 
          inner join ResourceAttendanceDtl b ON b.ResourceAttendanceID = a.ResourceAttendanceID
          inner join Employee e on e.EmployeeID = b.EmployeeID
		  inner join SubCategory sc on sc.SubCatCode = e.Gender
          WHERE  a.ResourceAttendanceID =  @ParmResourceAttendanceID
  UNION
   select  e.employeeid ,  
              concat(e.Initials,' ', e.FirstName,' ',e.LastName ) EmpName,
            e.PersonalMobileNo,
            --e.Gender
			sc.SubCatName Gender
			,e.BirthDate,e.JoiningDate,e.Designation,'Y' AttendanceStatus,
           @ParmResourceAttendanceID ResourceAttendanceID
            from
              RosterDtl c
              inner join ResourceEmployeeGroup d on d.ResourceGroupID = c.ResourceGroupID
              inner join Employee e on d.EmployeeID = e.EmployeeID
			  inner join SubCategory sc on sc.SubCatCode = e.Gender

              where c.ShiftID  = @shiftid
              and  e.Designation = @designation
              and dbo.udf_FormatDateTime(c.RosterDate,'yyyy-mm-dd') = dbo.udf_FormatDateTime(@datename,'yyyy-mm-dd') and e.EmployeeID not in(select  EmployeeID from ResourceAttendanceDtl 
  where ResourceAttendanceID = @ParmEmployeeID)
          
    END
    else  
            /*select  e.employeeid ,  concat(e.Initials,' ', e.FirstName,' ',e.LastName ) EmpName,
            e.PersonalMobileNo,e.Gender,e.BirthDate,e.JoiningDate,e.Designation,'Y' AttendanceStatus, 0  ResourceAttendanceID
            from
            (select  case  datename (dw, @datename)
              when 'Monday' then b.mon
              when 'Tuesday' then b.tue
              when 'Wednesday' then b.wed
              when 'Thursday' then b.Thu
              when 'Friday' then b.Fri
              when 'Saturday' then b.Sat
              else b.sun
              end weekdayshiftid, b.ResourceGroupID
              from Roster a
              inner join RosterGroup b on b.RosterID = a.RosterID
              where rtrim(ltrim(upper(a.Designation))) =  rtrim(ltrim(upper(@designation))) 
              and a.year =year(@datename) and a.week = DatePart(week, @datename) ) c
              inner join ResourceEmployeeGroup d on d.ResourceGroupID = c.ResourceGroupID
              inner join Employee e on d.EmployeeID = e.EmployeeID
              where c.weekdayshiftid = @shiftid

			  */

			  select  e.employeeid ,  
              concat(e.Initials,' ', e.FirstName,' ',e.LastName ) EmpName,
            e.PersonalMobileNo,
            --e.Gender
			sc.SubCatName Gender
			,e.BirthDate,e.JoiningDate,e.Designation,'Y' AttendanceStatus,
            0  ResourceAttendanceID
            from
              RosterDtl c
              inner join ResourceEmployeeGroup d on d.ResourceGroupID = c.ResourceGroupID
              inner join Employee e on d.EmployeeID = e.EmployeeID
			  inner join SubCategory sc on sc.SubCatCode = e.Gender

              where c.ShiftID  = @shiftid
              and  e.Designation = @designation
              and dbo.udf_FormatDateTime(c.RosterDate,'yyyy-mm-dd') = dbo.udf_FormatDateTime(@datename,'yyyy-mm-dd')

END
ELSE
SET @ParmResourceAttendanceID =  (select  count (ResourceAttendanceID ) from ResourceAttendance 
  where dbo.udf_FormatDateTime(attendanceDate,'yyyy-mm-dd') =   dbo.udf_FormatDateTime(@datename,'yyyy-mm-dd') 
  and ShiftID = @shiftid and Position = @designation)

if  @ParmResourceAttendanceID > 0
   BEGIN
         SET  @ParmResourceAttendanceID = (select ResourceAttendanceID from ResourceAttendance 
           where dbo.udf_FormatDateTime(attendanceDate,'yyyy-mm-dd') =   dbo.udf_FormatDateTime(@datename,'yyyy-mm-dd') 
           and ShiftID = @shiftid and Position = @designation)
        
          select  e.employeeid , 
          concat(e.Initials,' ', e.FirstName,' ',e.LastName ) EmpName,
          e.PersonalMobileNo,
		  --e.Gender
		  sc.SubCatName Gender
		  ,e.BirthDate,e.JoiningDate,e.Designation, b.AttendanceStatus,  a.ResourceAttendanceID
          from ResourceAttendance a 
          inner join ResourceAttendanceDtl b ON b.ResourceAttendanceID = a.ResourceAttendanceID
          inner join Employee e on e.EmployeeID = b.EmployeeID
		  inner join SubCategory sc on sc.SubCatCode = e.Gender
          WHERE  a.ResourceAttendanceID =  @ParmResourceAttendanceID
          
    END
    else
			  select  e.employeeid ,  
              concat(e.Initials,' ', e.FirstName,' ',e.LastName ) EmpName,
            e.PersonalMobileNo,
            --e.Gender
			sc.SubCatName Gender
			,e.BirthDate,e.JoiningDate,e.Designation,'Y' AttendanceStatus,
            0  ResourceAttendanceID
            from
              RosterDtl c
              inner join ResourceEmployeeGroup d on d.ResourceGroupID = c.ResourceGroupID
              inner join Employee e on d.EmployeeID = e.EmployeeID
			  inner join SubCategory sc on sc.SubCatCode = e.Gender
              where c.ShiftID  = @shiftid
              and  e.Designation = @designation
              and dbo.udf_FormatDateTime(c.RosterDate,'yyyy-mm-dd') = dbo.udf_FormatDateTime(@datename,'yyyy-mm-dd')
end

GO
/****** Object:  StoredProcedure [dbo].[usp_GetRevenueVCNSearch]    Script Date: 4/13/2015 6:50:05 PM ******/
