create PROCEDURE [dbo].[usp_GetRevenueVCNSearch]
   @p_SearchText NVARCHAR(200),
   @p_PortCode NVARCHAR(4)
AS
 BEGIN
select 
  an.VCN vcn,
  VE.VesselName VesselName,
  VE.GrossRegisteredTonnageInMT GRT,
  VE.CallSign CallSign,
  an.VoyageIn VoyageIn,
  an.VoyageOut VoyageOut,
  dbo.udf_GetArrivalReasonForVisit(an.VCN) ReasonForVisit,
  VTY.SubCatName AS VesselType,
  VE.IMONo IMONo,
  lp.PortName LastPortOfCall,
  NP.PortName NextPortOfCall,
  VC.ATA,
  VC.ATD
 -- (select top(1) AT.ATA  from VesselCall AT
--  where AT.VCN = an.VCN order by VesselCallID desc) ATA,
 -- (select top(1) AT.ATD  from VesselCall AT
--  where AT.VCN = an.VCN order by VesselCallID desc) ATD

from ArrivalNotification an 
inner join VesselCall VC on VC.VCN = an.VCN
inner join Vessel VE on VE.VesselID = an.VesselID
INNER JOIN dbo.SubCategory VTY ON VTY.SubCatCode = VE.VesselType
INNER JOIN PortRegistry LP ON LP.PortCode = an.LastPortOfCall 
INNER JOIN PortRegistry NP ON NP.PortCode = an.NextPortOfCall
WHERE VC.ATA IS NOT  NULL 
AND an.PortCode = @p_PortCode
AND UPPER(an.VCN)  Like '%'+UPPER(@p_SearchText)+'%' 
ORDER BY VE.VesselName
END

