CREATE PROCEDURE [dbo].[usp_GetRosterInformation]
@monthno int, @yearno int, @designation nvarchar(4),  @portcode nvarchar(4)
AS
BEGIN
DECLARE @DynamicPivotQuery1 AS NVARCHAR(MAX)
DECLARE @DynamicPivotQuery2 AS NVARCHAR(MAX)
DECLARE @ColumnName1 AS NVARCHAR(MAX)
DECLARE @ColumnName2 AS NVARCHAR(MAX)
DECLARE @StartDate NVARCHAR(10) 
SET @StartDate = cast (@yearno as varchar(4)) + '-' + cast(@monthno as varchar(2)) + '-01'
DECLARE @EndDate NVARCHAR(10) 
SET @EndDate = dbo.udf_FormatDateTime(eomonth(@StartDate),'yyyy-mm-dd')
DECLARE @StartDateMinus NVARCHAR(10) 
SET @StartDateMinus =  dbo.udf_FormatDateTime(convert (datetime, @StartDate) - 8, 'yyyy-mm-dd')
DECLARE @EndDatePlus NVARCHAR(10) 
SET @EndDatePlus =  dbo.udf_FormatDateTime(convert (datetime, @EndDate) + 8, 'yyyy-mm-dd')

--Get distinct values of the PIVOT Column 
SELECT @ColumnName1= ISNULL(@ColumnName1 + ',','') + QUOTENAME(DayName)
FROM (select 'Monday' DayName union all select 'Tuesday' DayName union all select 'Wednesday' DayName union all select 'Thursday' DayName
      union all select 'Friday' DayName union all select 'Saturday' DayName union all select 'Sunday' DayName) AS TaskCode

--IF EXISTS (SELECT name FROM sys.objects WHERE object_id = OBJECT_ID ('_Roster1') AND type IN ('U'))
--   DROP Table _Roster1

--IF EXISTS (SELECT name FROM sys.objects WHERE object_id = OBJECT_ID ('_Roster2') AND type IN ('U'))
--   DROP Table _Roster2

select @DynamicPivotQuery1 = 'insert into Roster1
                              select distinct dta.ResourceGroupID, ResourceGroupName, Position, WeekNo, CurDate, DayName, isnull(MainShiftID, 0) ShiftID from 
                              (select RG.ResourceGroupID, RG.ResourceGroupName, RG.Position, a.WeekNo, a.CurDate, a.DayName from ResourceGroup RG
                              cross join (
                              select WeekNo, WeekDate as CurDate, Datename(dw,WEEKDATE) as DayName from udf_GetWeekDays (''' + @StartDateMinus + ''', ''' + @EndDatePlus + ''') 
                              where WEEKNO >=(select min(WEEKNO) from udf_GetWeekDays (''' + @StartDate + ''', ''' + @EndDate + '''))
                              and WEEKNO <=(select max(WEEKNO) from udf_GetWeekDays (''' + @StartDate + ''', ''' + @EndDate + '''))) a where RG.Position = ''' + @designation + ''' and RG.PortCode = ''' + @portcode + ''') dta
                              left join RosterDtl RG on dta.ResourceGroupID = RG.ResourceGroupID  and dbo.udf_FormatDateTime(rg.RosterDate,''yyyy-mm-dd'')  = dta.CurDate'
exec (@DynamicPivotQuery1)

select @DynamicPivotQuery2 = 'insert into Roster2
                              SELECT WeekNo, ResourceGroupID, ResourceGroupName, ' + @ColumnName1 + ' FROM 
                              Roster1 PIVOT(Max(ShiftID)  FOR DayName IN (' + @ColumnName1 + ')) AS PVTTable order by WeekNo'
exec (@DynamicPivotQuery2)

exec sys.sp_executesql N'Select WeekNo, ResourceGroupID, ResourceGroupName, 
                            cast (max(isnull(Sunday,0)) as NVARCHAR(MAX))   Sunday, 
                            cast (max(isnull(Monday,0)) as NVARCHAR(MAX)) Monday, 
                            cast (max(isnull(Tuesday,0)) as NVARCHAR(MAX)) Tuesday,
                            cast (max(isnull(Wednesday,0)) as NVARCHAR(MAX)) Wednesday, 
                            cast (max(isnull(Thursday,0)) as NVARCHAR(MAX)) Thursday, 
                            cast (max(isnull(Friday,0)) as NVARCHAR(MAX)) Friday, 
                            cast (max(isnull(Saturday,0)) as NVARCHAR(MAX)) Saturday
                         from Roster2 group by WeekNo, ResourceGroupID, ResourceGroupName order by 1, 2' --@DynamicPivotQuery

--truncate table Roster1
--truncate table Roster2

delete from Roster1
delete from Roster2

--drop table _Roster1
--drop table _Roster2
End
GO
