CREATE PROCEDURE [dbo].[usp_GetScheduledTasksDetails]
@portcode nvarchar(2), @puserid int
WITH 
EXECUTE AS CALLER
AS
begin

select   a.ResourceAllocationID,
    a.ServiceReferenceType   , c.SubCatName ServiceReferenceTypeName ,
    CASE a.ServiceReferenceType
       WHEN 'SUPP' THEN 
         (select VCN from dbo.SuppServiceRequest  where SuppServiceRequestID = a.ServiceReferenceID)  
       ELSE 
         (select VCN from dbo.ServiceRequest where ServiceRequestID =  a.ServiceReferenceID)
    END VCN,
         CASE a.ServiceReferenceType
       WHEN 'SUPP' THEN 
         (select y.SubCatName from dbo.SuppServiceRequest x
          inner join SubCategory y on y.SubCatCode = x.Servicetype 
          where SuppServiceRequestID = a.ServiceReferenceID)  
       ELSE 
         (select y.SubCatName from dbo.ServiceRequest x
          inner join SubCategory y on y.SubCatCode = x.MovementType
          where ServiceRequestID =  a.ServiceReferenceID)
    END MovementTypes,
    a.ServiceReferenceID  ,
    a.OperationType  , b.ServiceTypeName OperationTypeName ,
    a.ResourceID
   ,a.ResourceType  ,
       CASE a.TaskStatus
       WHEN 'STRD' THEN 
         0
       ELSE 
           cast((datediff(mi, getdate(),dateadd(hour, cast(substring(a.AllocSlot, 1, (patindex('%-%', a.AllocSlot))-1) as numeric),dateadd(dd, datediff(dd,0, getDate()),0))) / 60.0) as numeric(5,2)) 
    END momentTimeDue,   
   CONVERT(VARCHAR, a.StartTime, 120) as StartTime ,CONVERT(VARCHAR, a.EndTime, 120) as EndTime
   ,a.TaskStatus  ,  e.SubCatName TaskStatusName ,a.RecordStatus
from dbo.ResourceAllocation a 
inner join ServiceType b on b.ServiceTypeCode = a.OperationType 
inner join dbo.SubCategory c ON c.SubCatCode = a.ServiceReferenceType 
--inner join dbo.SubCategory d ON d.SubCatCode = a.ResourceType 
inner join dbo.SubCategory e ON e.SubCatCode = a.TaskStatus 
where (TaskStatus = 'CFRI' or TaskStatus = 'ACCP'or TaskStatus = 'STRD')
and a.ResourceID = @puserid

end

GO
