Create PROCEDURE [dbo].[usp_GetSlotDetailsForCraftCalendar]
    -- Add the parameters for the stored procedure here
    @ServiceReferenceType varchar(4),
    @AllocationDate Date,
    @ServiceTypeCode VARCHAR(4),
    @PortCode VARCHAR(4)
AS
BEGIN
    -- SET NOCOUNT ON added to prevent extra result sets from
    -- interfering with SELECT statements.
    SET NOCOUNT ON;
    -- Insert statements for procedure here
IF @ServiceReferenceType = 'VTSR'
BEGIN 
SELECT 
ralc.ResourceID,
ralc.OperationType,
ralc.AllocSlot,ralc.AllocationDate,
vcm.VCN,vcm.MovementType , ralc.CraftID , cft.CraftName, cft.CraftCommissionStatus
