INNER JOIN VesselCallMovement vcm ON ralc.ServiceReferenceID = vcm.ServiceRequestID
INNER JOIN Craft cft on ralc.CraftID = cft.CraftID
INNER JOIN Users u ON u.UserID = ralc.ResourceID
INNER JOIN Employee e ON e.EmployeeID = u.UserTypeID
INNER JOIN UserPort up ON u.UserID = up.UserID
