AND up.PortCode = @PortCode 
AND e.PortCode = @PortCode
AND up.WFStatus = 'WFSA'
AND ralc.ServiceReferenceType = @ServiceReferenceType 
AND Convert(date,ralc.AllocationDate) = @AllocationDate 
and ralc.ResourceID IS NOt NULL
AND e.Designation IN
(SELECT st.DesignationCode from ServiceType s
JOIN ServiceTypeDesignation st on s.ServiceTypeID = st.ServiceTypeID
WHERE s.ServiceTypeCode = @ServiceTypeCode AND st.PortCode = @PortCode
)

END
ELSE
BEGIN 
SELECT 
ralc.ResourceID,
ralc.OperationType,
ralc.AllocSlot,ralc.AllocationDate,
vcm.VCN,vcm.MovementType , ralc.CraftID , cft.CraftName, cft.CraftCommissionStatus
FROM ResourceAllocation ralc 
INNER JOIN VesselCallMovement vcm ON ralc.ServiceReferenceID = vcm.ServiceRequestID
INNER JOIN Craft cft on ralc.CraftID = cft.CraftID
INNER JOIN Users u ON u.UserID = ralc.ResourceID
INNER JOIN Employee e ON e.EmployeeID = u.UserTypeID
INNER JOIN UserPort up ON u.UserID = up.UserID
Where u.UserType = 'EMP' 
AND up.PortCode = @PortCode 
AND e.PortCode = @PortCode
AND up.WFStatus = 'WFSA'
AND ralc.ServiceReferenceType = @ServiceReferenceType 
AND Convert(date,ralc.AllocationDate) = @AllocationDate 
and ralc.ResourceID IS NOt NULL
AND e.Designation IN
(SELECT st.DesignationCode from ServiceType s
JOIN ServiceTypeDesignation st on s.ServiceTypeID = st.ServiceTypeID
WHERE s.ServiceTypeCode = @ServiceTypeCode AND st.PortCode = @PortCode
)

END
