create PROCEDURE [dbo].[usp_GetStopListAccounts]
@Serchstring VARCHAR(200),
@portcode  VARCHAR(2)
AS 
BEGIN

DECLARE @strng VARCHAR(250) 
SET @strng = '%'+ RTRIM(@Serchstring) + '%';

    select Ag.AgentID,concat(ag.RegisteredName, ' - ', AC.AccountNo) RegisteredName, 
    Ag.RegistrationNumber ,AC.AccountNo AccountNo ,AC.AgentAccountID FROM Agent Ag
    inner join AgentPort ap on ap.AgentID = Ag.AgentID  and ap.WFStatus = 'WFSA' 
    inner join AgentAccount AC on Ag.AgentID = AC.AgentID and ap.PortCode = AC.PortCode 
    left join RevenueStopList sl on sl.AgentID = Ag.AgentID and AC.AgentAccountID= sl.AgentAccountID
    and AC.PortCode = sl.PortCode
    and AC.PortCode = @portcode
    where  sl.AgentAccountID is null and  ag.RegisteredName LIKE @strng   or AC.AgentAccountID LIKE @strng
END;
