CREATE PROCEDURE [dbo].[usp_GetSuppDryDockExtVCNDetails]
	 @PortCode varchar(4),
	 @WorkflowTaskCode varchar(4),
	 @ddScheduleStatus varchar(4),
	 @ddexScheduleStatus varchar(4)
AS
BEGIN
	SELECT distinct  dd.SuppDryDockID, dd.VCN, dd.FromDate, dd.ToDate, dd.BarkeelCode, dd.CargoTons, dd.Ballast, dd.Bunkers, dd.ExtensionDateTime, dd.Remarks, dd.TermsandConditions, 
dd.RecordStatus, dd.WorkflowInstanceID, dd.CreatedBy, dd.CreatedDate, dd.ModifiedBy, dd.ModifiedDate, dd.DockPortCode, dd.DockQuayCode, dd.DockBerthCode, dd.ScheduleFromDate,
 dd.ScheduleToDate, dd.ScheduleStatus, dd.Chamber, dd.EnteredDockDateTime, dd.OnBlocksDateTime, dd.DryDockDateTime,
  dd.FinishedDockDateTime, dd.OffBlocksDateTime, dd.LeftDockDateTime
  ,vl.VesselName,vl.IMONo,vl.GrossRegisteredTonnageInMT,an.ArrDraft,vl.BeamInM,vl.LengthOverallInM
  FROM Vessel AS vs

INNER JOIN ArrivalNotification AS an ON vs.VesselID = an.VesselID
INNER JOIN VesselCall AS vc ON an.VCN = vc.VCN
INNER JOIN Vessel vl ON vl.VesselID = an.VesselID
INNER JOIN WorkflowInstance AS wfi ON an.WorkflowInstanceId = wfi.WorkflowInstanceId
INNER JOIN SuppDryDock AS dd ON an.VCN = dd.VCN
LEFT OUTER JOIN SuppDryDockExtension AS ddex ON dd.SuppDryDockID = ddex.SuppDryDockID
Where an.PortCode = @PortCode AND wfi.WorkflowTaskCode = @WorkflowTaskCode AND dd.ScheduleFromDate IS NOT NULL AND dd.ScheduleToDate IS NOT NULL  AND dd.ScheduleStatus = @ddScheduleStatus

AND dd.SuppDryDockID NOT IN (select SuppDryDockID From SuppDryDockExtension Where ScheduleStatus = @ddexScheduleStatus)
AND (
    (CASE 
        WHEN ddex.ScheduleStatus IS NOT NULL THEN 
            (CASE 
                WHEN ddex.ScheduleStatus <> @ddexScheduleStatus THEN 1
                ELSE NULL
             END)
        ELSE 1
     END)) = 1
END
