CREATE PROCEDURE [dbo].[usp_GetSupplementaryResourceAllocationByDate] 
@PortCode VARCHAR(4),
@ResourceDate DATE,
@ServiceType VARCHAR(4),
@VCN VARCHAR(12) = NULL
AS
BEGIN
SET NOCOUNT ON;
-- Insert statements for procedure here
    SELECT r.ResourceAllocationID, r.ServiceReferenceType, r.OperationType ServiceTypeCode, r.ServiceReferenceID, ISNULL(r.ResourceID,0) ResourceID,
		r.AllocSlot, r.AllocationDate, r.TaskStatus, r.StartTime, r.EndTime, r.AcknowledgeDate, r.RecordStatus, r.CreatedBy, r.CreatedDate,
		u.FirstName, u.LastName, u.FirstName + ' ' + u.LastName Name, st.ServiceTypeName, a.VCN, v.VesselName, s.BerthCode,
		b.BerthName, ISNULL(s.Quantity,0) Quantity
		,a.AnyDangerousGoodsonBoard
    FROM SuppServiceRequest s
        JOIN port p on p.PortCode=@portcode
		JOIN quay q on q.quaycode=s.QuayCode AND q.PortCode = @portcode
        JOIN Berth b on b.BerthCode = s.BerthCode AND b.QuayCode = q.QuayCode and b.PortCode = @portcode
        JOIN ArrivalNotification a on s.VCN = a.VCN
        JOIN Vessel v on a.VesselID = v.VesselID
        JOIN ResourceAllocation r on s.SuppServiceRequestID = r.ServiceReferenceID
        JOIN SubCategory su on r.TaskStatus = su.SubCatCode
        LEFT join Users u on r.ResourceID = u.UserID
        JOIN ServiceType st on r.OperationType = st.ServiceTypeCode
    
	WHERE  r.OperationType = @ServiceType AND r.ServiceReferenceType ='SUPP' AND s.PortCode = @PortCode 
	
    AND r.RecordStatus='A' AND CONVERT (DATE, r.AllocationDate) BETWEEN CONVERT (DATE, @ResourceDate) AND DATEADD(day,1,CONVERT (DATE, @ResourceDate)) AND ( (a.VCN=@VCN ) OR (@VCN IS NULL))
END


