CREATE PROCEDURE [dbo].[usp_GetSystemNotifications]
 @userid INT, @portcode NVARCHAR (2)
 WITH
 EXECUTE AS CALLER
AS
 BEGIN
 SELECT dbo.ConvertHtmlToText (NotificationText) AS NotificationText
 FROM [dbo].[SystemNotification]
 WHERE UserID = @userid AND PortCode = @portcode and NotificationText <> ''
 END
GO
