CREATE PROCEDURE [dbo].[usp_GetUsers]
@userid int,@portcode nvarchar(2)
WITH 
EXECUTE AS CALLER
AS
BEGIN  
select distinct u.UserName,u.UserID,CONCAT(u.UserName,'-',u.FirstName+' '+u.LastName) AS FirstName from Users u, UserPort up
where u.UserID = up.UserID and up.PortCode = @portcode and up.WFStatus = 'WFSA' and u.UserID not in (select a.userid2 from [Conversation] a where a.UserID1 = @userid)
and u.UserID not in (select a.userid1 from [Conversation] a where a.UserID2 = @userid)
and u.UserID != @userid 
END
GO
/****** Object:  StoredProcedure [dbo].[usp_GetUsersAttendanceForResouceCalendar]    Script Date: 4/13/2015 6:50:05 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
create PROCEDURE [dbo].[usp_GetUsersAttendanceForResouceCalendar]
	-- Add the parameters for the stored procedure here
	@PortCode VARCHAR(4), 
	@ServiceReferenceType VARCHAR(4), 
	@AttendanceDate DATE, 
	@ShiftID INT,
	@ServiceTypeCode VARCHAR(4)
AS
BEGIN
	-- SET NOCOUNT ON added to prevent extra result sets from
	-- interfering with SELECT statements.
	SET NOCOUNT ON;

    -- Insert statements for procedure here
	SELECT  
		   u.UserID
		   ,ShiftID
		   ,u.FirstName + ' ' + u.LastName As UserFullName
		   ,b.AttendanceStatus
		   ,a.AttendanceDate
		   ,e.Designation

          FROM ResourceAttendance a 

          INNER JOIN ResourceAttendanceDtl b ON b.ResourceAttendanceID = a.ResourceAttendanceID

          INNER JOIN Employee e ON e.EmployeeID = b.EmployeeID

		  INNER JOIN Users u ON u.UserTypeID = e.EmployeeID

		  INNER JOIN UserPort up ON u.UserID = up.UserID 

      WHERE  u.UserType = 'EMP' 

      AND up.PortCode = @PortCode 

      AND e.PortCode = @PortCode  

      AND up.WFStatus = 'WFSA' 

      AND  a.ResourceAttendanceID IN 

		  (SELECT ResourceAttendanceID from ResourceAttendance 

           WHERE dbo.udf_FormatDateTime(attendanceDate,'yyyy-mm-dd') =   dbo.udf_FormatDateTime(@AttendanceDate,'yyyy-mm-dd') 

		   )
	   AND e.Designation IN
			(SELECT st.DesignationCode from ServiceType s
				join ServiceTypeDesignation st on s.ServiceTypeID = st.ServiceTypeID
			 WHERE s.ServiceTypeCode = @ServiceTypeCode and st.PortCode = @PortCode
			)

       AND a.ShiftID = @ShiftID

		   ORDER BY UserID
END
GO
