CREATE PROCEDURE [dbo].[usp_GetUsersForResourceAllocation]
	@PortCode VARCHAR(4),
	@MovementType VARCHAR(4),
	@ShiftID int
AS
BEGIN
	SET NOCOUNT ON;
	DECLARE @Designation VARCHAR(4)

	--(select  @Designation=  std.DesignationCode from ServiceType s,ServiceTypeDesignation std
	--where s.ServiceTypeID = std.ServiceTypeID and s.ServiceTypeCode=@MovementType and std.PortCode=@PortCode)


		SELECT DISTINCT u.UserID ID, CONCAT(u.FirstName,'  ',u.LastName) Name, ISNULL(e.GrossWeightTonnage,0) GrossWeightTonnage, ISNULL(e.DeadWeightTonnage,0) 

DeadWeightTonnage
		FROM 
		(
			SELECT ra.ResourceAttendanceId, rad.EmployeeID, rad.AttendanceStatus, ra.ShiftId, ra.Position 
			FROM ResourceAttendance ra, ResourceAttendanceDtl rad
			WHERE ra.ResourceAttendanceID = rad.ResourceAttendanceID
			AND CONVERT(DATE, ra.attendanceDate)  = CONVERT (DATE, GETDATE())
				--and ra.attendanceDate  = CONVERT (DATE, 
				--(
				--	select top 1 EffectedFrom from ResourceAllocationConfigRule cr where 
				--	EffectedFrom <= GETDATE()  and portcode = @PortCode 
				--	order by ResourceAllocationConfigRuleID desc
				--))
				--and ra.Position = @Designation and ra.ShiftId = @ShiftID
			AND ra.Position in (SELECT std.DesignationCode from ServiceType s,ServiceTypeDesignation std
			WHERE s.ServiceTypeID = std.ServiceTypeID AND s.ServiceTypeCode=@MovementType AND std.PortCode=@PortCode) AND ra.ShiftId = @ShiftID
			AND rad.AttendanceStatus = 'Y'
		) a,
		(
			SELECT rd.ResourceGroupId, reg.EmployeeId, rd.shiftId
			FROM RosterDtl rd, ResourceGroup rg, ResourceEmployeeGroup reg
			WHERE rd.ResourceGroupId = rg.resourcegroupid
			AND rg.ResourceGroupId = reg.ResourceGroupId
			AND rd.ShiftId = @ShiftID 
			AND CONVERT(DATE, rd.RosterDate)  = CONVERT (DATE, GETDATE())
				--and rd.RosterDate = CONVERT (DATE, 
				--(
				--	select top 1 EffectedFrom from ResourceAllocationConfigRule cr
				--	where EffectedFrom <= GETDATE()  and portcode = @PortCode 
				--	order by ResourceAllocationConfigRuleID desc
				--))
		) b,
			--users u 
			--inner join UserPort  up on up.UserID = u.UserID
			--where a.EmployeeId = b.EMployeeID
		users u , Employee e , UserPort  up 
		WHERE up.UserID = u.UserID AND a.EmployeeId = b.EMployeeID AND e.EmployeeID = a.EmployeeId		
		AND u.UserTypeID = b.EmployeeId 
		AND u.RecordStatus = 'A' AND u.DormantStatus = 'N'
		AND u.UserType = 'EMP' AND up.PortCode = @PortCode AND up.WFStatus = 'WFSA'
END
GO
/****** Object:  StoredProcedure [dbo].[usp_GetUsersForRoleAndPortCodeByUserType]    Script Date: 4/13/2015 6:50:05 PM ******/
