CREATE PROCEDURE [dbo].[usp_GetUsersForRoleAndPortCodeByUserType]
   @p_PortCode      VARCHAR (4),
   @p_userType      NVARCHAR (4) = NULL,                        -- EMP/AGNT/TO
   @p_RoleCode      NVARCHAR (50) = '',          -- Rolecodes from Role Master
   @p_UserTypeID    INT = 0 -- AgentId from Agent / TerminalOperatorID from TerminalOperator/ EmployeeID from Employee table
AS
   BEGIN
      ---SET  NOCOUNT ON;

      --Usage : exec [usp_GetUsersForRoleAndPortCodeByUserType] 'DB','AGNT','AGNT',0 -- Will get All Agents information Whose is having Agent Role
      --Usage : exec [usp_GetUsersForRoleAndPortCodeByUserType] 'DB','AGNT','',33 -- Will get Agent information whose AgentID is 33
      --Usage : exec [usp_GetUsersForRoleAndPortCodeByUserType] 'DB','EMP','BP',null -- Will get all employees whose Role is Berth Planner
      --Usage : exec [usp_GetUsersForRoleAndPortCodeByUserType] 'DB','EMP',null,null -- Will get all Employee users list

      IF ( (@p_userType = NULL OR @p_userType = '') AND @p_UserTypeID > 0)
         BEGIN
            SELECT @p_userType = UserType,
                   @p_UserTypeID = UserTypeID
            FROM Users
            WHERE UserId = @p_UserTypeID
         END

      IF (@p_userType = 'AGNT')
         BEGIN
            SELECT IA.ReferenceNo AS ReferenceNo,
                   IA.AgentID,
                   coalesce (AP.PortCode, UP.PortCode) AS PortCode,
                   coalesce (AIU.FirstName, AC.FirstName) AS FirstName,
                   coalesce (AIU.LastName, AC.SurName) AS LastName,
                   [dbo].[udf_ContactNumberMask] (
                      coalesce (AIU.ContactNo, AC.CellularNo))
                      AS ContactNo,
                   coalesce (AIU.EmailID, AC.EmailID) AS EmailID,
                   'AGNT' AS UserType,
                   coalesce (AIU.UserName, IA.ReferenceNo) AS UserName,
                   coalesce (AIU.UserID, IA.CreatedBy) AS UserID, -- If login Credentials not yet generated
                   coalesce (AIU.UserTypeID, 0) AS UserTypeID,
                   coalesce (AIU.PWD, IA.RecordStatus) AS PWD,
                   coalesce (AIU.WorkflowInstanceId, AP.WorkflowInstanceId)
                      AS WorkflowInstanceId,
                   coalesce (AIU.AnonymousUserYn, 'Y') AS AnonymousUserYn,
                   coalesce (AIU.IsFirstTimeLogin, 'N') IsFirstTimeLogin,
                   NULL AS PwdExpirtyDate,
                   0 AS IncorrectLogins,
                   NULL AS LoginTime,
                   'N' AS DormantStatus,
                   coalesce (AIU.CreatedBy, IA.CreatedBy) AS CreatedBy,
                   coalesce (AIU.CreatedDate, IA.CreatedDate) AS CreatedDate,
                   coalesce (AIU.ModifiedBy, IA.ModifiedBy) AS ModifiedBy,
                   coalesce (AIU.ModifiedDate, IA.ModifiedDate)
                      AS ModifiedDate,
                   coalesce (AIU.RecordStatus, IA.RecordStatus)
                      AS RecordStatus
              FROM Agent IA
                   INNER JOIN AgentPort AP
                      ON     IA.AgentID = AP.AgentID
                         AND AP.PortCode = @p_PortCode
                   INNER JOIN AuthorizedContactPerson AC
                      ON IA.AuthorizedContactPersonID =
                            AC.AuthorizedContactPersonID
                   LEFT JOIN Users AIU
                      ON     AIU.UserTypeID = IA.AgentID
                         AND AIU.UserType = @p_userType
                         AND AIU.RecordStatus = 'A'
                   LEFT JOIN UserPort UP
                      ON UP.UserID = AIU.UserID AND UP.PortCode = AP.PortCode -- and AP.AgentPortID = UP.UserID
             WHERE     IA.RecordStatus = 'A'
                   AND CASE
                          WHEN (coalesce (@p_UserTypeID, 0) > 0) THEN IA.AgentID
                          ELSE 0
                       END = coalesce (@p_UserTypeID, 0)
         END

      IF (@p_userType = 'TO')
         BEGIN
            SELECT TR.RegistrationNumber AS ReferenceNo,
                   TR.TerminalOperatorID,
                   coalesce (TRP.PortCode, UP.PortCode) AS PortCode,
                   coalesce (TR.RegisteredName, TIU.FirstName) AS FirstName,
                   coalesce (TIU.LastName, '') AS LastName,
                   [dbo].[udf_ContactNumberMask] (
                      coalesce (TR.TelephoneNo1, TIU.ContactNo))
                      AS ContactNo,
                   coalesce (TIU.EmailID, '') AS EmailID, --Terminal Operatore email id not captured
                   'TO' AS UserType,
                   coalesce (TIU.UserName, TR.RegistrationNumber) AS UserName,
                   coalesce (TIU.UserID, TR.CreatedBy) AS UserID, -- If login Credentials not yet generated
                   coalesce (TIU.UserTypeID, 0) AS UserTypeID, -- If login Credentials not yet generated
                   coalesce (TIU.PWD, '') AS PWD,
                   coalesce (UP.WorkflowInstanceId, 0) AS WorkflowInstanceId,
                   coalesce (TIU.AnonymousUserYn, 'Y') AS AnonymousUserYn,
                   coalesce (TIU.IsFirstTimeLogin, 'N') IsFirstTimeLogin,
                   NULL AS PwdExpirtyDate,
                   0 AS IncorrectLogins,
                   NULL AS LoginTime,
                   'N' AS DormantStatus,
                   coalesce (TIU.CreatedBy, TR.CreatedBy) AS CreatedBy,
                   coalesce (TIU.CreatedDate, TR.CreatedDate) AS CreatedDate,
                   coalesce (TIU.ModifiedBy, TR.ModifiedBy) AS ModifiedBy,
                   coalesce (TIU.ModifiedDate, TR.ModifiedDate)
                      AS ModifiedDate,
                   coalesce (TIU.RecordStatus, TR.RecordStatus)
                      AS RecordStatus
              FROM TerminalOperator TR
                   INNER JOIN TerminalOperatorPort TRP
                      ON     TR.TerminalOperatorID = TRP.TerminalOperatorID
                         AND TRP.RecordStatus = 'A'
                         AND TRP.PortCode = @p_PortCode
                   LEFT JOIN Users TIU
                      ON     TIU.UserTypeID = TR.TerminalOperatorID
                         AND TIU.UserType = 'TO'
                         AND TIU.RecordStatus = 'A'
                   LEFT JOIN UserPort UP
                      ON     UP.UserID = TIU.UserID
                         AND UP.PortCode = TRP.PortCode
             WHERE     TR.RecordStatus = 'A'
                   AND (UP.PortCode = @p_PortCode)
                   AND CASE
                          WHEN (coalesce (@p_UserTypeID, 0) > 0) THEN TR.TerminalOperatorID
                          ELSE 0
                       END = coalesce (@p_UserTypeID, 0)
         END

      IF (@p_userType = 'EMP')
         BEGIN
            SELECT IE.EmployeeID AS ReferenceNo,
                   IE.EmployeeID,
                   coalesce (IUP.PortCode, IE.PortCode) AS PortCode,
                   coalesce (EIU.FirstName, IE.FirstName) AS FirstName,
                   coalesce (EIU.LastName, IE.LastName) AS LastName,
                   [dbo].[udf_ContactNumberMask] (
                      coalesce (EIU.ContactNo, IE.OfficialMobileNo))
                      AS ContactNo,
                   coalesce (EIU.EmailID, IE.EmailID) AS EmailID,
                   'EMP' AS UserType,
                   coalesce (EIU.UserName, IE.SAPNumber) AS UserName,
                   coalesce (EIU.UserID, IE.CreatedBy) AS UserID, -- If login Credentials not yet generated
                   coalesce (EIU.UserTypeID, 0) AS UserTypeID,
                   coalesce (EIU.PWD, IE.RecordStatus) AS PWD,
                   coalesce (IUP.WorkflowInstanceId, 0) AS WorkflowInstanceId,
                   coalesce (EIU.AnonymousUserYn, 'N') AS AnonymousUserYn,
                   coalesce (EIU.IsFirstTimeLogin, 'N') IsFirstTimeLogin,
                   EIU.PwdExpirtyDate AS PwdExpirtyDate,
                   0 AS IncorrectLogins,
                   NULL AS LoginTime,
                   'N' AS DormantStatus,
                   coalesce (EIU.CreatedBy, IE.CreatedBy) AS CreatedBy,
                   coalesce (EIU.CreatedDate, IE.CreatedDate) AS CreatedDate,
                   coalesce (EIU.ModifiedBy, IE.ModifiedBy) AS ModifiedBy,
                   coalesce (EIU.ModifiedDate, IE.ModifiedDate)
                      AS ModifiedDate,
                   coalesce (EIU.RecordStatus, IE.RecordStatus)
                      AS RecordStatus
              FROM Employee IE
                   LEFT JOIN Users EIU
                      ON     EIU.UserTypeID = IE.EmployeeID
                         AND EIU.RecordStatus = 'A'
                         AND EIU.UserType = 'EMP'
                   LEFT JOIN UserPort IUP
                      ON     EIU.UserID = IUP.UserID
                         AND IUP.PortCode = @p_PortCode
                   LEFT JOIN UserRole UR ON UR.UserID = EIU.UserID
                   LEFT JOIN [Role] R ON R.RoleID = UR.RoleID
             WHERE     IE.RecordStatus = 'A'
                   AND (IE.PortCode = @p_PortCode)
                   AND CASE
                          WHEN (coalesce (@p_UserTypeID, 0) > 0) THEN IE.EmployeeID
                          ELSE 0
                       END = coalesce (@p_UserTypeID, 0)
                   AND CASE
                          WHEN (coalesce (@p_RoleCode, '') = '') THEN '1'
                          ELSE R.RoleCode
                       END =
                          CASE
                             WHEN @p_RoleCode = '' THEN '1'
                             ELSE @p_RoleCode
                          END
         END

      IF (@p_userType = 'LR')
         BEGIN
            SELECT LR.LicenseRequestID AS ReferenceNo,
                   LR.LicenseRequestID,
                   LRP.PortCode AS PortCode,
                   LR.RegisteredName AS FirstName,
                   LR.TradingName AS LastName,
                   [dbo].[udf_ContactNumberMask] (AC.CellularNo) AS ContactNo,
                   AC.EmailID AS EmailID,
                   'LR' AS UserType,
                   LR.ReferenceNo AS UserName,
                   LR.CreatedBy AS UserID, -- If login Credentials not yet generated
                   LR.LicenseRequestID AS UserTypeID,
                   '' AS PWD,
                   LRP.WorkflowInstanceId AS WorkflowInstanceId,
                   'Y' AS AnonymousUserYn,
                   'N' IsFirstTimeLogin,
                   NULL AS PwdExpirtyDate,
                   0 AS IncorrectLogins,
                   NULL AS LoginTime,
                   'N' AS DormantStatus,
                   LR.CreatedBy AS CreatedBy,
                   LR.CreatedDate AS CreatedDate,
                   LR.ModifiedBy AS ModifiedBy,
                   LR.ModifiedDate AS ModifiedDate,
                   LR.RecordStatus AS RecordStatus
              FROM LicenseRequest LR
                   INNER JOIN LicenseRequestPort LRP
                      ON LR.LicenseRequestID = LRP.LicenseRequestID
                   INNER JOIN AuthorizedContactPerson AC
                      ON LR.AuthorizedContactPersonID =
                            AC.AuthorizedContactPersonID
             WHERE     LR.RecordStatus = 'A'
                   AND (LRP.PortCode = @p_PortCode)
                   AND CASE
                          WHEN (coalesce (@p_UserTypeID, 0) > 0) THEN LR.LicenseRequestID
                          ELSE 0
                       END = coalesce (@p_UserTypeID, 0)
         END

      IF (@p_userType = 'PE')
         BEGIN
            SELECT PE.PilotID AS ReferenceNo,
                   PE.PilotID,
                   PE.PortCode AS PortCode,
                   PE.FirstName AS FirstName,
                   PE.LastName AS LastName,
                   [dbo].[udf_ContactNumberMask] (PE.CellNo) AS ContactNo,
                   PE.EmailID AS EmailID,
                   'PE' AS UserType,
                   PE.IDNo AS UserName,
                   PE.CreatedBy AS UserID, -- If login Credentials not yet generated
                   PE.PilotID AS UserTypeID,
                   '' AS PWD,
                   PE.WorkflowInstanceId AS WorkflowInstanceId,
                   'Y' AS AnonymousUserYn,
                   'N' IsFirstTimeLogin,
                   NULL AS PwdExpirtyDate,
                   0 AS IncorrectLogins,
                   NULL AS LoginTime,
                   'N' AS DormantStatus,
                   PE.CreatedBy AS CreatedBy,
                   PE.CreatedDate AS CreatedDate,
                   PE.ModifiedBy AS ModifiedBy,
                   PE.ModifiedDate AS ModifiedDate,
                   PE.RecordStatus AS RecordStatus
              FROM Pilot PE
             WHERE     PE.RecordStatus = 'A'
                   AND (PE.PortCode = @p_PortCode)
                   AND CASE
                          WHEN (coalesce (@p_UserTypeID, 0) > 0) THEN PE.PilotID
                          ELSE 0
                       END = coalesce (@p_UserTypeID, 0)
         END

      IF (@p_userType = 'EXTU')
         BEGIN
            SELECT PE.UserID AS ReferenceNo,
                   PE.UserID,
                   UP.PortCode AS PortCode,
                   PE.FirstName AS FirstName,
                   PE.LastName AS LastName,
                   [dbo].[udf_ContactNumberMask] (PE.ContactNo) AS ContactNo,
                   PE.EmailID AS EmailID,
                   'EXTU' AS UserType,
                   PE.UserName AS UserName,
                   PE.CreatedBy AS UserID, -- If login Credentials not yet generated
                   PE.UserTypeID AS UserTypeID,
                   PE.PWD AS PWD,
                   PE.WorkflowInstanceId AS WorkflowInstanceId,
                   PE.AnonymousUserYn,
                   PE.IsFirstTimeLogin,
                   PE.PwdExpirtyDate,
                   0 AS IncorrectLogins,
                   NULL AS LoginTime,
                   'N' AS DormantStatus,
                   PE.CreatedBy AS CreatedBy,
                   PE.CreatedDate AS CreatedDate,
                   PE.ModifiedBy AS ModifiedBy,
                   PE.ModifiedDate AS ModifiedDate,
                   PE.RecordStatus AS RecordStatus
              FROM Users PE INNER JOIN UserPort UP ON PE.UserID = UP.UserID
             WHERE     PE.RecordStatus = 'A'
                   AND (UP.PortCode = @p_PortCode)
                   AND CASE
                          WHEN (coalesce (@p_UserTypeID, 0) > 0) THEN PE.UserID
                          ELSE 0
                       END = coalesce (@p_UserTypeID, 0)
         END

      IF (@p_userType = 'PEP')
         BEGIN
            SELECT PEP.ReferenceNo AS ReferenceNo,
                   PEP.PermitRequestID,
                   PEP.PortCode AS PortCode,
                   PEP.ApplicantFullName AS FirstName,
                   PEP.ApplicantSurName AS LastName,
                   [dbo].[udf_ContactNumberMask] (PEP.MobileNo) AS ContactNo,
                   PEP.Email AS EmailID,
                   'PEP' AS UserType,
                   PEP.ReferenceNo AS UserName,
                   PEP.CreatedBy AS UserID,
                   PEP.PermitRequestID AS UserTypeID,
                   '' AS PWD,
                   PEP.WorkflowInstanceId AS WorkflowInstanceId,
                   'Y' AS AnonymousUserYn,
                   'N' IsFirstTimeLogin,
                   NULL AS PwdExpirtyDate,
                   0 AS IncorrectLogins,
                   NULL AS LoginTime,
                   'N' AS DormantStatus,
                   PEP.CreatedBy AS CreatedBy,
                   PEP.CreatedDate AS CreatedDate,
                   PEP.ModifiedBy AS ModifiedBy,
                   PEP.ModifiedDate AS ModifiedDate,
                   PEP.RecordStatus AS RecordStatus
              FROM PermitRequest PEP
             WHERE     PEP.RecordStatus = 'A'
                   AND (PEP.PortCode = @p_PortCode)
                   AND CASE
                          WHEN (coalesce (@p_UserTypeID, 0) > 0)
                          THEN
                             PEP.PermitRequestID
                          ELSE
                             0
                       END = coalesce (@p_UserTypeID, 0)
         END
   END
GO
