CREATE PROCEDURE [dbo].[usp_GetVCNDetails]
   @p_PortCode VARCHAR (4)
AS
   BEGIN
      SET  NOCOUNT ON;

select an.VCN,
       vs.VesselID,
       vs.VesselName,
       an.VoyageIn,
       an.VoyageOut,
       an.ReasonForVisit,
       vs.VesselType,
       vs.CallSign,
       an.ETA,
       an.ETD,
       vs.IMONo,
       vs.LengthOverallInM,
       vs.BeamInM,
       an.ArrDraft,
       vs.VesselNationality,
       vs.GrossRegisteredTonnageInMT,
       vs.DeadWeightTonnageInMT,
       an.LastPortOfCall,
       an.NextPortOfCall,
       an.Tidal,
       an.DaylightRestriction,
       case when an.AnyDangerousGoodsonBoard = 'I' then 'Not Binded' else 'Yes' END as AnyDangerousGoodsonBoard,
       case when an.DangerousGoodsClass is null then 'Not Binded' else an.DangerousGoodsClass END as DangerousGoodsClass,
       case when an.UNNo is null then 'Not Binded' else an.UNNo END as UNNo
from dbo.ArrivalNotification an inner join dbo.Vessel vs on vs.VesselID = an.VesselID
join dbo.VesselCall vc on vc.VCN = an.VCN and vc.ATUB is null
where an.PortCode = @p_PortCode AND an.IsANFinal = 'Y' and an.IsPHANFinal = 'Y' AND (an.IsIMDGANFinal = 'Y' OR an.IsIMDGANFinal = 'NA') AND  (an.IsISPSANFinal = 'Y' OR an.IsISPSANFinal = 'NA')
END
GO
/****** Object:  StoredProcedure [dbo].[usp_GetVCNDetailsForServiceRequest]    Script Date: 4/13/2015 6:50:05 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROCEDURE [dbo].[usp_GetVCNDetailsForServiceRequest]
 @p_PortCode VARCHAR (4),
 @p_AgentUserID int,
 @p_ToUserID int,
 @p_searchValue varchar(12)
 AS   BEGIN SET  NOCOUNT ON;
select  an.VCN,
        vs.VesselID, 
		vc.RecentAgentID,
        vs.VesselName,
        an.VoyageIn,
		an.VoyageOut, 
        an.IsPHANFinal,
        an.IsISPSANFinal,
        an.IsIMDGANFinal,
        dbo.udf_GetArrivalReasonForVisit(an.VCN)  AS ReasonForVisit, 
        svt.SubCatName AS  VesselType, 
        vs.CallSign,
        vc.ETA, 
        vc.ETD,
        vs.IMONo,     
	    case when (vs.LengthOverallInM is null) then 0 else vs.LengthOverallInM END as LengthOverallInM,
	    case when (vs.BeamInM is null) then 0 else vs.BeamInM END as BeamInM,
        an.ArrDraft,   
	    sc.SubCatName AS VesselNationality,
        vs.GrossRegisteredTonnageInMT,
        vs.DeadWeightTonnageInMT,
        por1.PortName AS LastPortOfCall,
	    por2.PortName AS NextPortOfCall,
	    case when (an.Tidal = 'I') then 'No' else 'Yes' END as Tidal,
	    case when (an.DaylightRestriction = 'I') then 'No' else 'Yes' END as DaylightRestriction,
	    case when (an.PilotExemption = 'I') then 'No' else 'Yes' END as PilotExemption,
	    agnt.RegisteredName,
	    agnt.TelephoneNo1,
	    agnt.FaxNo,
	    cont.FirstName,
	    cont.SurName,
	    cont.CellularNo,
	    cont.EmailID,
        case when (an.AnyDangerousGoodsonBoard = 'I') then 'Not Binded' else 'Yes' END as AnyDangerousGoodsonBoard,
        case when (an.DangerousGoodsClass is null) then 'Not Binded' else an.DangerousGoodsClass END as DangerousGoodsClass,
        case when (an.UNNo is null) then 'Not Binded' else an.UNNo END as UNNo,
	    case when (vc.ToPositionBerthCode is null) then 'NA' else vc.ToPositionBerthCode END AS CurrentBerth,
	    ETUB = vc.ETUB,
        ETB = vc.ETB

from dbo.ArrivalNotification an inner 
join dbo.Vessel vs on vs.VesselID = an.VesselID
join SubCategory svt on svt.SubCatCode = vs.VesselType
join dbo.VesselCall vc on vc.VCN = an.VCN and (vc.ATUB is null) and (vc.ATD is null) and (UPPER(vc.VCN) like '%'+UPPER(@p_searchValue)+'%')
join dbo.Agent agnt on an.AgentID = agnt.AgentID
join dbo.AuthorizedContactPerson cont on agnt.AuthorizedContactPersonID = cont.AuthorizedContactPersonID
join dbo.SubCategory sc on vs.VesselNationality = sc.SubCatCode
join dbo.SubCategory subc on an.ReasonForVisit = subc.SubCatCode
join dbo.PortRegistry por1 on an.LastPortOfCall = por1.PortCode
join dbo.PortRegistry por2 on an.NextPortOfCall = por2.PortCode
where an.PortCode = @p_PortCode and an.IsANFinal = 'Y' and an.RecordStatus = 'A' 
and
(@p_AgentUserID = 0 and an.TerminalOperatorID = @p_ToUserID) or (@p_AgentUserID <> 0 and vc.RecentAgentID = @p_AgentUserID)
--(CASE
--                          WHEN (coalesce (@p_ToUserID, 0) > 0) THEN an.TerminalOperatorID
--                          ELSE 0
