CREATE PROCEDURE [dbo].[usp_GetVesselSearch]
   @p_SearchText NVARCHAR(200),
   @p_PortCode NVARCHAR(4)
AS
   BEGIN
      SELECT TOP 200 V.VesselName + ' -' +  V.IMONo as VesselName, V.VesselID,V.IMONo, V.VesselType , VT.SubCatName AS VesselTypeName,
V.LengthOverallInM , V.BeamInM , V.CallSign, VN.SubCatName AS VesselNationality
, V.GrossRegisteredTonnageInMT, V.DeadWeightTonnageInMT, D.DockingPlanNo 
, D.IsFinal AS DockIsFinal, D.RecordStatus AS DockStatus
,CONVERT(NVARCHAR(10), D.DockingPlanID) as DockingPlanID
,CONVERT(VARCHAR(10), D.CreatedDate, 120)  as SubmissionDate
FROM Vessel V 
LEFT JOIN DockingPlan D ON D.VesselID = V.VesselID AND D.IsFinal = 'Y' and D.PortCode = @p_PortCode
INNER JOIN SubCategory VT ON VT.SubCatCode = V.VesselType
INNER JOIN SubCategory VN ON VN.SubCatCode = V.VesselNationality
WHERE v.RecordStatus = 'A' and v.IsFinal = 'Y'  and UPPER(VesselName)  Like '%'+UPPER(@p_SearchText)+'%' or  UPPER(IMONo) Like '%'+UPPER(@p_SearchText)+'%' or UPPER(CallSign) Like '%'+UPPER(@p_SearchText)+'%'
ORDER BY VesselName
END

