/****** Object:  StoredProcedure [dbo].[usp_GetWorkFlowTask]    Script Date: 4/13/2015 6:50:05 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROCEDURE [dbo].[usp_GetWorkFlowTask]
@portcode NVARCHAR(2)
AS
BEGIN
SET NOCOUNT ON;

 SELECT DISTINCT
	   WFT.EntityID,
       E.Entityname,
       WFT.WorkflowTaskCode,
       WFT.ValidityPeriod,
       WFT.Step,
       WFT.NextStep,
       WFT.HasNotification,
       WFT.APIUrl,
	   WFT.HasRemarks,
       STUFF (
          (SELECT ',' + CAST (wftr.RoleID AS VARCHAR)
             FROM WorkflowTaskRole wftr
            WHERE     WFTr.EntityID = wft.EntityID
                  AND WFTr.PortCode = wft.PortCode
                  AND WFTr.Step = wft.Step
           FOR XML PATH ( '' )),
          1,
          1,
          '')
          AS CommaSeperatedRoleIDs
  FROM WorkflowTask WFT
  LEFT JOIN Entity E ON E.EntityID=WFT.EntityID
WHERE WFT.PortCode = @portcode AND E.HasWorkflow='Y'
ORDER BY Entityname,WFT.Step

END
