CREATE PROCEDURE [dbo].[usp_InactiveRolePrivileges]
@entityid int,
 @roleid  int
AS 
BEGIN

begin transaction 

Update RolePrivilege set RecordStatus='I' 
  where roleid in 
    (select distinct rp.roleid from RolePrivilege rp join Entity e on rp.EntityID = e.EntityID
      where e.Moduleid = 
        (select Moduleid from dbo.Entity where EntityID =@entityid) and rp.RoleID =@roleid) 
  and entityid in 
    (select distinct rp.entityid from RolePrivilege rp join Entity e on rp.EntityID = e.EntityID 
      where e.Moduleid = 
        (select Moduleid from dbo.Entity where EntityID =@entityid)   and rp.RoleID =@roleid) 
  and subcatcode in 
    (select distinct rp.subcatcode from RolePrivilege rp join Entity e on rp.EntityID = e.EntityID 
      where e.Moduleid = 
        (select Moduleid from dbo.Entity where EntityID =@entityid) and rp.RoleID =@roleid);


begin COMMIT transaction;
 END
END;
