CREATE PROCEDURE [dbo].[usp_MobileResourceAlloTaskExecution]
      (
            @P_ResourceAllocationID int -- 32
      )
      AS
      BEGIN
  
  DECLARE @SrvReferenceTyp NVARCHAR(20) 
    DECLARE @SrvOperationalType NVARCHAR(10) 
  DECLARE @SrvVCN NVARCHAR(30) 
  DECLARE @Momenttype NVARCHAR(10) 
  DECLARE @SrvVCNName NVARCHAR(100) 
  DECLARE @SrvVesselLength numeric(10, 2) 
 
  SET @SrvReferenceTyp = (select ServiceReferenceType from ResourceAllocation where ResourceAllocationID = @P_ResourceAllocationID);
  
  SET @SrvOperationalType = (select OperationType from ResourceAllocation where ResourceAllocationID = @P_ResourceAllocationID);
       
  SET @SrvVCN = (select CASE ServiceReferenceType
                        WHEN 'SUPP' THEN 
                              (select VCN from dbo.SuppServiceRequest  where SuppServiceRequestID = a.ServiceReferenceID)  
                        ELSE 
                              (select VCN from dbo.ServiceRequest where ServiceRequestID =  a.ServiceReferenceID)
                        END VCN
                from ResourceAllocation a
                where ResourceAllocationID = @P_ResourceAllocationID);
  
  
   SET @Momenttype = (select CASE ServiceReferenceType
                        WHEN 'SUPP' THEN 
                              (select Servicetype from dbo.SuppServiceRequest  where SuppServiceRequestID = a.ServiceReferenceID)  
                        ELSE 
                              (select MovementType from dbo.ServiceRequest where ServiceRequestID =  a.ServiceReferenceID)
                        END VCN
                from ResourceAllocation a
                where ResourceAllocationID = @P_ResourceAllocationID);

   SET @SrvVCNName = (select b.VesselName from ArrivalNotification  a inner join Vessel b on b.VesselID = a.VesselID where a.VCN = @SrvVCN);
  SET @SrvVesselLength = (select b.LengthOverallInM from ArrivalNotification  a inner join Vessel b on b.VesselID = a.VesselID where a.VCN = @SrvVCN);

  IF (@SrvOperationalType = 'PILT' OR  @SrvOperationalType = 'PIHE')
     begin
        select @Momenttype MomentType, @SrvOperationalType OperationType, @SrvVCN VCN, @SrvVCNName VCNName,@SrvVesselLength VesselLength,
               PilotageServiceRecordingID,ResourceAllocationID,StartTime,PilotOnBoard,
               PilotOff,EndTime,WaitingStartTime, WaitingEndTime,AdditionalTugs,
               OffSteam, MarineRevenueCleared, Remarks, Deficiencies,
               PilotageServiceRecordingID ValPKID
               from PilotageServiceRecording
               where ResourceAllocationID = @P_ResourceAllocationID;
     end

   ELSE IF (@SrvOperationalType = 'BRTH' OR @SrvOperationalType = 'SHFT' OR @SrvOperationalType = 'WARP' OR @SrvOperationalType = 'SAIL')
     begin
        select @Momenttype MomentType, @SrvOperationalType OperationType, @SrvVCN VCN, @SrvVCNName VCNName,@SrvVesselLength VesselLength,
                 ResourceAllocationID 
                ,StartTime 
                ,EndTime 
               
                ,FromBerthPortCode 
                ,FromBerthQuayCode 
                ,FromBerthCode 
                ,FromBerthPortCode+'.'+FromBerthQuayCode+'.'+FromBerthCode  FromBerthKey
                
                ,ToBerthPortCode
                ,ToBerthQuayCode
                ,ToBerthCode 
                 ,ToBerthPortCode+'.'+ToBerthQuayCode+'.'+ToBerthCode  ToBerthKey
                
                ,BerthingSide
                
                ,FromBollardPortCode 
                ,FromBollardQuayCode 
                ,FromBollardBerthCode
                ,FromBollardCode
                ,FromBollardPortCode+'.'+FromBollardQuayCode+'.'+FromBollardBerthCode +'.'+FromBollardCode  FromBolardKey
             
                ,ToBollardPortCode
                ,ToBollardQuayCode
                ,ToBollardBerthCode
                ,ToBollardCode 
                ,ToBollardPortCode+'.'+ToBollardQuayCode+'.'+ToBollardBerthCode +'.'+ToBollardCode  ToBolardKey
                             
                ,MooringBollardBowPortcode 
                ,MooringBollardBowQuayCode 
                ,MooringBollardBowBerthCode
                ,MooringBollardBowBollardCode 
                ,MooringBollardBowPortcode+'.'+MooringBollardBowQuayCode+'.'+MooringBollardBowBerthCode +'.'+MooringBollardBowBollardCode  MooringBolardBowKey
                
                ,MooringBollardStemPortcode 
                ,MooringBollardStemQuayCode 
                ,MooringBollardStemBerthCode
                ,MooringBollardStemBollardCode 
                ,MooringBollardStemPortcode+'.'+MooringBollardStemQuayCode+'.'+MooringBollardStemBerthCode +'.'+MooringBollardStemBollardCode  MooringBolardStemKey
                
                ,FirstLineIn 
                ,LastLineIn 
                ,FirstLineOut 
                ,LastLineOut
                ,ForwardDraft 
                ,AftDraft 
                ,Remarks 
                ,Deficiencies 
                ,BerthingTaskExecutionID ValPKID
               from ShiftingBerthingTaskExecution
               where ResourceAllocationID = @P_ResourceAllocationID;
    end
   else 
       select @Momenttype MomentType, @SrvOperationalType OperationType, @SrvVCN VCN, @SrvVCNName VCNName,@SrvVesselLength VesselLength,
              OtherServiceRecordingID, ResourceAllocationID, StartTime, EndTime,
              LineUp, LineDown, PilotOn, OpeningMeterReading, ClosingMeterReading, 
              TotalDispensed, FirstSwing, LastSwing, TimeAlongSide,
              OtherServiceRecordingID ValPKID, Remarks, Deficiencies,  MeterSerialNo
              from OtherServiceRecording 
              where ResourceAllocationID = @P_ResourceAllocationID;
           
      END

GO
