CREATE PROCEDURE [dbo].[usp_MobileTaskAcknowledgement]
@ResourseAloID int, @Remarks nvarchar(300), @TaskStatus nvarchar(4), @OperationType nvarchar(4), @Usrid int
WITH 
EXECUTE AS CALLER
AS
BEGIN
update dbo.ResourceAllocation 
SET AcknowledgeDate =  GETDATE() ,
Remarks =  @Remarks ,TaskStatus =  @TaskStatus 
WHERE ResourceAllocationID = @ResourseAloID 

if (@OperationType = 'PILT' or @OperationType = 'PIHE')
   insert into PilotageServiceRecording (ResourceAllocationID, RecordStatus  ,CreatedBy, CreatedDate  ,ModifiedBy  ,ModifiedDate) 
   select RA.ResourceAllocationID, 'A',@Usrid,GETDATE(), @Usrid,GETDATE() FROM ResourceAllocation RA
   inner join VesselCallMovement vm on  RA.ServiceReferenceID = vm.servicerequestid
   and RA.ResourceAllocationID =@ResourseAloID
else if (@OperationType = 'BRTH')
   insert into ShiftingBerthingTaskExecution (ResourceAllocationId, FromBerthPortCode, FromBerthQuayCode, FromBerthCode, 
   ToBerthPortCode, ToBerthQuayCode, ToBerthCode, FromBollardPortCode,FromBollardQuayCode, FromBollardBerthCode,FromBollardCode,
   ToBollardPortCode,ToBollardQuayCode,ToBollardBerthCode,ToBollardCode, CreatedBy, CreatedDate, ModifiedBy, ModifiedDate,RecordStatus)
   select RA.ResourceAllocationID, VM.FromPositionPortCode,VM.FromPositionQuayCode,VM.FromPositionBerthCode,
   VM.ToPositionPortCode, VM.ToPositionQuayCode,VM.ToPositionBerthCode, VM.FromPositionPortCode,VM.FromPositionQuayCode,
   VM.FromPositionBerthCode,VM.FromPositionBollardCode, VM.ToPositionPortCode, VM.ToPositionQuayCode,VM.ToPositionBerthCode, VM.ToPositionBollardCode,
   @Usrid,GETDATE(),@Usrid,GETDATE(),'A'
   FROM ResourceAllocation RA inner join VesselCallMovement vm on  RA.ServiceReferenceID = vm.servicerequestid
   and RA.ResourceAllocationID =@ResourseAloID
else if (@OperationType = 'WTST' or @OperationType = 'FCST')
   insert into OtherServiceRecording (ResourceAllocationID, RecordStatus  ,CreatedBy  ,CreatedDate  ,ModifiedBy  ,ModifiedDate) 
   select RA.ResourceAllocationID, 'A',@Usrid,GETDATE(),@Usrid,GETDATE() FROM ResourceAllocation RA
   inner join SuppServiceRequest ss on RA.ServiceReferenceID = ss.SuppServiceRequestID
   and RA.ResourceAllocationID =@ResourseAloID
else
   insert into OtherServiceRecording (ResourceAllocationID, RecordStatus  ,CreatedBy  ,CreatedDate  ,ModifiedBy  ,ModifiedDate) 
   select RA.ResourceAllocationID, 'A',@Usrid,GETDATE(),@Usrid,GETDATE() FROM ResourceAllocation RA
   inner join VesselCallMovement vm on  RA.ServiceReferenceID = vm.servicerequestid
   and RA.ResourceAllocationID =@ResourseAloID
END;
GO
