CREATE PROCEDURE [dbo].[usp_Resourcegroup_Employees]
	-- Add the parameters for the stored procedure here
	@ResourceGroupCode nvarchar(4),
  @Designation nvarchar(4),
	@Mode nvarchar(4),
  @PortCode nvarchar(4)
AS
BEGIN
	
	SET NOCOUNT ON;

    IF (@Mode='VIEW')
	BEGIN
    SELECT re.* FROM ResourceGroup g
      inner join ResourceEmployeeGroup  e on e.ResourceGroupID = g.ResourceGroupID
			Inner join Employee re ON re.EmployeeID = e.EmployeeID
			WHERE  re.Designation=@Designation  and g.ResourceGroupCode = @ResourceGroupCode
    /*
		SELECT e.* FROM Employee e 
		INNER JOIN ResourceEmployeeGroup re ON re.EmployeeID = e.EmployeeID
		WHERE e.RecordStatus='A'and e.Designation= @Designation and re.RecordStatus='A'
    */

    END 
	ELSE IF (@Mode='EDIT')
		BEGIN
			
      SELECT re.* FROM ResourceGroup g
      inner join ResourceEmployeeGroup  e on e.ResourceGroupID = g.ResourceGroupID
			Inner join Employee re ON re.EmployeeID = e.EmployeeID
			WHERE  re.Designation=@Designation  and g.ResourceGroupCode = @ResourceGroupCode
		 UNION 
						SELECT e.* FROM Employee e WHERE RecordStatus='A' and EmployeeID NOT IN(
			    SELECT DISTINCT EmployeeID From ResourceEmployeeGroup WHERE RecordStatus='A') AND Designation =@Designation 

	   
     END
	ELSE
		BEGIN 
				SELECT e.* FROM Employee e WHERE RecordStatus='A' and EmployeeID NOT IN(
			    SELECT DISTINCT EmployeeID From ResourceEmployeeGroup WHERE RecordStatus='A') AND Designation =@Designation 
		 END

END

GO
