/****** Object:  StoredProcedure [dbo].[usp_RosterAlocation]    Script Date: 4/13/2015 6:50:05 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROCEDURE [dbo].[usp_RosterAlocation](
@monthid int,
@Yearid int,
@Weekid int,
@MonShiftid NVARCHAR (MAX),
@TueShiftid NVARCHAR (MAX),
@WedShiftid NVARCHAR (MAX),
@ThuShiftid NVARCHAR (MAX),
@FriShiftid NVARCHAR (MAX),
@SatShiftid NVARCHAR (MAX),
@SunShiftid NVARCHAR (MAX),
@Groupid int,
@Userid int
)
AS

declare @v_Yearid  nvarchar(8)
declare @v_Continuous  nvarchar(1)
declare @v_Shift1  int
declare @v_Shift2  int

begin
--set @v_Yearid = DatePart(week, getdate())
set @v_Yearid =cast (@Yearid as varchar(8))
 
 
DECLARE @Datefld NVARCHAR(20) 
DECLARE @DatefldCnvrt date
      
-- For Monday             
select @Datefld =  dbo.udf_get_weekdate(@Weekid, @v_Yearid, 'Monday') 
delete dbo.RosterDtl where ResourceGroupID = @Groupid and RosterDate = @Datefld
  IF @MonShiftid = ''  
  begin 
      insert into dbo.RosterDtl ( ResourceGroupID, ShiftID,MainShiftID, RosterDate ,RecordStatus ,CreatedBy ,CreatedDate ,ModifiedBy ,ModifiedDate) 
      values (@Groupid, null, null,@Datefld, 'A', @Userid, getdate(),@Userid,getdate()) 
  end    
  ELSE
  begin 
  set @v_Continuous = (select IscontinuousShift from Shift where ShiftID = @MonShiftid);
  if @v_Continuous = 'Y'
      begin  
            set @v_Shift1 = (select Firstshiftid from Shift where ShiftID = @MonShiftid);
            set @v_Shift2 = (select secondshiftid from Shift where ShiftID = @MonShiftid);
           
