CREATE PROCEDURE [dbo].[usp_rpt_anchoragereport]
@VCN Varchar(50),
@Port Varchar(50),
@FromDate DATETIME,
@ToDate DATETIME
WITH 
EXECUTE AS CALLER
AS
BEGIN
SET NOCOUNT ON
SELECT 
VCA.AnchorDropTime,
VCA.AnchorAweighTime,
VC.BreakWaterIn,
sc4.SubCatName as Reason,
VL.VesselName,
VC.ATA,
sc3.SubCatName as cargotype,
sc2.SubCatName as vesseltype,
--sc1.SubCatName as breakwaters,
AN.VCN,
dbo.udf_GetArrivalReasonForVisit(AN.VCN)  AS ReasonForVisit,
AN.PortCode,
PM.PortName,
(datediff(Hour, VCA.AnchorDropTime,VCA.AnchorAweighTime)) as times
FROM ArrivalNotification AN INNER JOIN
VesselCallAnchorage VCA ON VCA.VCN = AN.VCN INNER JOIN
Vessel VL ON VL.VesselID=AN.VesselID INNER JOIN
VesselCall VC ON VC.VCN = AN.VCN INNER JOIN
ArrivalCommodity AC ON AC.VCN = AN.VCN INNER JOIN
SubCategory AS SC2 ON VL.VesselType = SC2.SubCatCode INNER JOIN
SubCategory AS SC3 ON ac.CargoType = SC3.SubCatCode INNER JOIN
 SubCategory sc4 on VCA.Reason = sc4.SubCatCode INNER JOIN
PORT PM ON AN.PortCode = PM.PortCode
WHERE
(AN.VCN = @VCN OR @VCN IS NULL) AND
(PM.PortCode = @Port OR @Port IS NULL)AND
cast (VCA.AnchorDropTime AS DATE) BETWEEN @FromDate AND @ToDate
END

GO
