CREATE PROCEDURE [dbo].[usp_rpt_arrivalnotification]
@AGENT varchar(50) = NULL,
@Terminal varchar(50)= NULL,
@Status varchar(50)= NULL,
@Name varchar(50)= NULL,
@FromDate DATETIME,
@ToDate DATETIME,
@IMDG VARCHAR(255),
@Classification varchar(50)= NULL

WITH 
EXECUTE AS CALLER
AS
BEGIN
SET NOCOUNT ON
SELECT
AN.VCN,
AN.VoyageIn,
AN.VoyageOut,
AN.ETA,
AN.ETD,
dbo.udf_GetArrivalReasonForVisit(AN.VCN)  AS ReasonForVisit,
AN.IsTerminalOperator,
AN.AppliedDate,
AN.PilotExemption,
VM.VesselName,
vt.SubCatName as VesselType,
AN.NominationDate,
AN.PortCode,
PM.PortName,
AN.RecordStatus,
UM.UserName,
WI.WorkflowInstanceId,
WIS.SubCatName AS WorkFlowStatus,
A.AgentID,
A.RegisteredName,
case when (an.AnyDangerousGoodsonBoard = 'I') then 'N' else 'Y' end as IMDG,
TPR.TerminalOperatorID,
TPR.TradingName ,
SC2.SubCatName AS CargoType,
AC.Quantity,
AN.CancelRemarks,
AN.IsIMDGANFinal,
SC3.SubCatName AS ClassCode,
SS.Remarks
FROM ArrivalNotification AN
INNER JOIN Vessel VM ON VM.VesselID = AN.VesselID
INNER JOIN SubCategory VT ON VT.SubCatCode = VM.VesselType
INNER JOIN Port PM ON AN.PortCode = PM.PortCode
INNER JOIN Users UM on UM.UserID = AN.CreatedBy
INNER JOIN WorkflowInstance wi ON WI.WorkflowInstanceId = AN.WorkflowInstanceId
inner join (
			select f.WorkflowInstanceId,F.Remarks
			from (
			select  max(WorkflowProcessId) as WorkflowProcessId
			from WorkflowProcess  group by WorkflowInstanceId
			) as x inner join WorkflowProcess as f on f.WorkflowProcessId = x.WorkflowProcessId 
		) ss on ss.WorkflowInstanceId = wi.WorkflowInstanceId
    
INNER JOIN SubCategory WIS ON WIS.SubCatCode=WI.WorkflowTaskCode
INNER JOIN Agent A on a.AgentID = AN.AgentID
LEFT JOIN TerminalOperator TPR on TPR.TerminalOperatorID = an.TerminalOperatorID
INNER JOIN ArrivalCommodity AC ON AC.VCN = AN.VCN
INNER JOIN SubCategory SC2 ON AC.CargoType = SC2.SubCatCode
LEFT JOIN IMDGInformation IM ON IM.VCN = AN.VCN
LEFT JOIN SubCategory SC3 ON IM.ClassCode = SC3.SubCatCode
WHERE
( A.RegisteredName =@AGENT OR @AGENT IS NULL) AND
( tpr.TradingName=@Terminal OR @Terminal IS NULL)AND
( WIS.SubCatName = @Status OR @Status IS NULL)AND
(PM.PortCode = @Name OR @Name IS NULL)and
cast (AN.ETA AS DATE) BETWEEN @FromDate AND @ToDate AND
(an.IsIMDGANFinal IN (@IMDG) OR @IMDG IS NULL) AND
(sc3.SubCatName = @Classification or @Classification IS NULL)

END

GO
