CREATE PROCEDURE [dbo].[usp_rpt_BerthOccupRep]
@Name VARCHAR(50),
@FromDate DATETIME,
@ToDate DATETIME
WITH 
EXECUTE AS CALLER
AS
BEGIN
 SET NOCOUNT ON
SELECT 
(datediff(Hour, vcm.ATB, vcm.ATUB)) AS Totaltime, 
(datediff(Minute, vcm.ATB, vcm.ATUB)) AS Mint, 
(datediff(Hour, @FromDate, @ToDate)) AS HRS, 
vcm.VCN, 
vcm.ATB,
vcm.ATUB, 
vcm.ToPositionBerthCode, 
vcm.FromPositionBerthCode, 
vsl.VesselName, 
vsl.CallSign,
sc.SubCatName AS vesseltype, 
sc1.SubCatName AS movementtype,
SC3.SubCatName AS CargoType

FROM VesselCallMovement AS vcm 
INNER JOIN ServiceRequest AS sr ON vcm.ServiceRequestID = sr.ServiceRequestID 
INNER JOIN ArrivalNotification AS an ON vcm.VCN = an.VCN
INNER JOIN Port AS pt ON an.PortCode = pt.PortCode 
INNER JOIN Vessel AS vsl ON an.VesselID = vsl.VesselID 
INNER JOIN SubCategory AS sc ON vsl.VesselType = sc.SubCatCode
INNER JOIN SubCategory AS sc1 ON vcm.MovementType = sc1.SubCatCode 
INNER JOIN ArrivalCommodity AC ON AC.VCN = an.VCN
INNER JOIN SubCategory AS sc3 ON AC.CargoType = sc3.SubCatCode
WHERE
(pt.PortCode = @Name OR @Name IS NULL)AND
CAST(vcm.ATB AS DATE) BETWEEN @FromDate AND @ToDate
END

GO
