CREATE PROCEDURE [dbo].[usp_rpt_BerthUtilizatDashGraphRep]
@FromDate DATETIME,
@ToDate DATETIME,
@Port Varchar(50)
WITH 
EXECUTE AS CALLER
AS
BEGIN
SET NOCOUNT ON
SELECT 
(datediff(minute, cmf.LastMoveDateTime, cmf.FirstMoveDateTime))/(24*60) AS days,
an.VCN,
bt.BerthName, 
sc2.SubCatName AS berthtype,
vsl.VesselName,
cmf.LastMoveDateTime,
cmf.FirstMoveDateTime
from CargoManifest cmf 
inner join ArrivalNotification an on cmf.VCN = an.VCN
inner join port pt on an.PortCode = pt.PortCode 
inner join Vessel vsl on an.VesselID = vsl.VesselID 
inner join SubCategory sc on vsl.VesselType = sc.SubCatCode 
inner join VesselCall vc on vc.VCN = an.VCN 
INNER JOIN Quay AS qa ON qa.PortCode = pt.PortCode 
INNER JOIN Berth AS bt ON bt.PortCode = qa.PortCode AND bt.QuayCode = qa.QuayCode 
INNER JOIN SubCategory AS sc2 ON bt.BerthType = sc2.SubCatCode
WHERE (pt.PortName = @Port OR @Port IS NULL)
AND bt.BerthCode in (select BerthCode from Berth where pt.PortName = @Port)
AND cmf.LastMoveDateTime >= @FromDate and cmf.FirstMoveDateTime <= @ToDate
END
GO
