CREATE PROCEDURE [dbo].[usp_rpt_BerthUtilizationRep]
@FromDate DATETIME,
@ToDate DATETIME,
@Port Varchar(50)
WITH 
EXECUTE AS CALLER
AS
BEGIN
SET NOCOUNT ON

SELECT 
cmf.VCN,
cmf.FirstMoveDateTime,
cmf.LastMoveDateTime,
vc.ATB,
vc.ATUB,
pt.PortName,
vsl.VesselName,
sc.SubCatName as vesseltype,
sc1.SubCatName as cargotype,
cmf.CargoManifestID,
cmd.CargoManifestDtlID,
datediff(minute, cmf.FirstMoveDateTime, cmf.LastMoveDateTime) as differnce,
datediff(Hour, cmf.FirstMoveDateTime, cmf.LastMoveDateTime) as hrs,
datediff(Hour, @FromDate, @ToDate) as percnt
from CargoManifest cmf 
inner join ArrivalNotification an on cmf.VCN = an.VCN
inner join port pt on an.PortCode = pt.PortCode 
inner join Vessel vsl on an.VesselID = vsl.VesselID 
inner join SubCategory sc on vsl.VesselType = sc.SubCatCode 
inner join VesselCall vc on vc.VCN = an.VCN 
inner join CargoManifestDtl cmd on cmd.CargoManifestID = cmf.CargoManifestID
inner join SubCategory sc1 on cmd.CargoTypeCode = sc1.SubCatCode
WHERE (pt.PortCode = @Port OR @Port IS NULL)
AND CAST(cmf.FirstMoveDateTime AS DATE) BETWEEN @FromDate AND @ToDate
END

