SC1.SubCatName AS BerthingSide,
psr.PilotOnBoard,
psr.PilotOff,
CONCAT(pit.FirstName,' ' ,pit.LastName, ' ',pit.Surname) as Pilot,
oth.StartTime,
oth.EndTime,
cf.CraftName,
sc2.SubCatName as CraftNationality,
ac.Quantity
FROM VesselCall VC 
INNER JOIN ArrivalNotification AN ON AN.VCN = VC.VCN 
INNER JOIN Vessel VSL ON VSL.VesselID = AN.VesselID 
INNER JOIN SubCategory SC ON VSL.VesselType = SC.SubCatCode
inner join port pm on AN.PortCode = pm.PortCode
inner join Berth brt on AN.AlternateBerthCode = brt.BerthCode
INNER JOIN AGENT AGT ON VC.RecentAgentID = AGT.AgentID 
inner join ServiceRequest sq on sq.VCN = AN.VCN
inner join ResourceAllocation ra on ra.ServiceReferenceID = sq.ServiceRequestID
inner join ShiftingBerthingTaskExecution shf on shf.ResourceAllocationID = ra.ResourceAllocationID
INNER JOIN SubCategory SC1 ON shf.BerthingSide = SC1.SubCatCode
LEFT JOIN Berth BT ON shf.FromBerthCode = BT.BerthCode
LEFT join PilotageServiceRecording psr on psr.ResourceAllocationID = ra.ResourceAllocationID
LEFT join Pilot pit on AN.ExemptionPilotID = pit.PilotID
LEFT join OtherServiceRecording  oth on oth.ResourceAllocationID = ra.ResourceAllocationID
LEFT join Craft cf on ra.CraftID = cf.CraftID
Left join PortRegistry pr on AN.LastPortOfCall = pr.PortCode 
Left join PortRegistry pr1 on AN.NextPortOfCall = pr1.PortCode
LEFT join SubCategory sc2 on cf.CraftNationality = sc2.SubCatCode
left join ArrivalCommodity ac on ac.VCN = AN.VCN
WHERE
(PM.PortCode =@Port OR @Port IS NULL)AND
cast (VC.ETA AS DATE) BETWEEN @FromDate AND @ToDate AND
(VSL.VesselType = @VesselType OR @VesselType IS NULL)
END

