CREATE PROCEDURE [dbo].[usp_rpt_DashbrdBerthOccupny]
@FromDate DATETIME,
@ToDate DATETIME,
@Port Varchar(50)
WITH 
EXECUTE AS CALLER
AS
BEGIN
SET NOCOUNT ON
SELECT     (datediff(minute, vcm.ATB, vcm.ATUB))/(24*60) AS days, 
vcm.VCN, 
vcm.ATB,
vcm.ATUB, 
vcm.ToPositionBerthCode, 
vcm.FromPositionBerthCode, 
vsl.VesselName, 
vsl.CallSign, 
sc.SubCatName AS vesseltype, 
sc1.SubCatName AS movementtype,
bt.BerthName, 
sc2.SubCatName AS berthtype
FROM  VesselCallMovement AS vcm 
INNER JOIN ServiceRequest AS sr ON vcm.ServiceRequestID = sr.ServiceRequestID 
INNER JOIN ArrivalNotification AS an ON vcm.VCN = an.VCN
INNER JOIN Port AS pt ON an.PortCode = pt.PortCode 
INNER JOIN Vessel AS vsl ON an.VesselID = vsl.VesselID 
INNER JOIN SubCategory AS sc ON vsl.VesselType = sc.SubCatCode
INNER JOIN SubCategory AS sc1 ON vcm.MovementType = sc1.SubCatCode 
INNER JOIN Quay AS qa ON qa.PortCode = pt.PortCode 
INNER JOIN Berth AS bt ON bt.PortCode = qa.PortCode AND bt.QuayCode = qa.QuayCode 
INNER JOIN SubCategory AS sc2 ON bt.BerthType = sc2.SubCatCode
WHERE (pt.PortCode = @Port OR @Port IS NULL)
AND bt.BerthCode in (select BerthCode from Berth where pt.PortName = @Port)
AND vcm.atb >= @FromDate and vcm.atub <= @ToDate
AND vcm.ToPositionBerthCode is not null
group by vcm.VCN, 
vcm.ATB,
vcm.ATUB, 
vcm.ToPositionBerthCode, 
vcm.FromPositionBerthCode, 
vsl.VesselName, 
vsl.CallSign, 
sc.SubCatName, 
sc1.SubCatName,
bt.BerthName, 
sc2.SubCatName
END

GO
