CREATE PROCEDURE [dbo].[usp_rpt_DashbrdISPS]
@FromDate DATETIME,
@ToDate DATETIME,
@Port Varchar(50)
WITH 
EXECUTE AS CALLER
AS
BEGIN
SET NOCOUNT ON

SELECT CASE WHEN AN.IsISPSANFinal = 'Y' THEN 'Cleared' ELSE 
CASE WHEN AN.IsISPSANFinal = 'N' THEN 'Not Cleared' ELSE 
CASE WHEN AN.IsISPSANFinal = 'NA' THEN 'Exempted' ELSE ''
 end end end as ISPSStatus,
 AN.VCN, 
VSL.VesselName, 
AN.PortCode,
PRT.PortName,
sc1.SubCatName as vsltyp,
dbo.udf_GetCargoTypes(AN.VCN)  cargotyp,
dbo.udf_GetArrivalReasonForVisit(AN.VCN)  AS  Reason,
an.ModifiedDate
FROM ArrivalNotification  AN 
INNER JOIN Vessel VSL ON VSL.VesselID = AN.VesselID
INNER JOIN Port PRT ON PRT.PortCode = AN.PortCode
INNER JOIN SubCategory sc1 on VSL.VesselType = sc1.SubCatCode

WHERE (PRT.PortCode = @Port OR @Port IS NULL) AND
cast (AN.ModifiedDate AS DATE) BETWEEN @FromDate AND @ToDate and
an.IsISPSANFinal <> 'NF' and  an.Isdraft !='Y'
END

