CREATE PROCEDURE [dbo].[usp_rpt_DashResourceUtilizGraph]
@FromDate DATE,
@ToDate DATE,
@Port VARCHAR
WITH 
EXECUTE AS CALLER
AS
BEGIN
SET NOCOUNT ON
select st.ServiceTypeName,
RA.OperationType,
RA.AllocationDate,
RA.StartTime,RA.EndTime,
datediff(dd, RA.StartTime, RA.EndTime) as ServedDays,
datediff(dd, @FromDate, @ToDate) as TotalDays,
(datediff(dd, RA.StartTime, RA.EndTime)/datediff(dd, @FromDate, @ToDate))*100 AS TOT,
ra.ResourceType,
CASE ra.ServiceReferenceType
WHEN 'SUPP' THEN 
(select PortCode from dbo.SuppServiceRequest where SuppServiceRequestID = ra.ServiceReferenceID and PortCode = @Port ) 
ELSE 
(select an.PortCode from dbo.ServiceRequest sr
inner join ArrivalNotification An on An.VCN = sr.VCN 
where sr.ServiceRequestID = ra.ServiceReferenceID
and an.PortCode = @Port)
END Ports
from ResourceAllocation RA 
inner join ServiceType st ON RA.OperationType = st.ServiceTypeCode
where cast (AllocationDate AS DATE) BETWEEN @FromDate AND @ToDate
end

