CREATE PROCEDURE [dbo].[usp_rpt_ETAreport]
@FromDate DATETIME,
@ToDate DATETIME,
@Port VARCHAR(50),
@VCN VARCHAR(50),
@VesselType VARCHAR(50),
@VesselName VARCHAR(200)
WITH 
EXECUTE AS CALLER
AS
BEGIN
SET NOCOUNT ON
SELECT  DISTINCT
VEA.VCN,
AN.ETA,
AN.ETD,
dbo.udf_GetArrivalReasonForVisit(VEA.VCN)  AS  ReasonForVisit,
VSL.VesselName,
SUBCAT1.SubCatName AS VSLTYP,
--AN.LastPortOfCall,
AN.Clearance,
AN.NextPortOfCall,
AG.RegisteredName,
VSL.LengthOverallInM,
VSL.GrossRegisteredTonnageInMT,
--VETA.ETA AS VSLETA,
--VETA.ETD AS VSLETD,
VSL.CallSign,
VSL.NetRegisteredTonnageInMT,
pm.PortName,
an.PortCode,
VSL.VesselID,
an.IsPHANFinal,
AC.Quantity,
PR.PortName as LastPortOfCall,
vc.FromPositionBerthCode

FROM   ArrivalNotification AN 
INNER JOIN Agent AG ON AN.AgentID = AG.AgentID 
INNER JOIN Vessel VSL ON AN.VesselID = VSL.VesselID 
--INNER JOIN VesselETAChange VETA ON VETA.VCN = AN.VCN 
INNER JOIN SubCategory AS subcat1 ON VSL.VesselType = subcat1.SubCatCode  
INNER JOIN SubCategory sc2 on AN.ReasonForVisit = sc2.SubCatCode
INNER JOIN ArrivalCommodity AC ON AC.VCN = AN.VCN
INNER JOIN port pm on AN.PortCode = pm.PortCode
INNER JOIN PortRegistry PR ON AN.LastPortOfCall = PR.PortCode
INNER JOIN VesselCall VC ON VC.VCN = AN.VCN
INNER JOIN BERTH BT ON AC.PortCode = BT.PortCode AND AC.QuayCode = BT.QuayCode AND AC.BerthCode = BT.BerthCode
INNER JOIN VesselETAChange VEA ON VEA.VCN = AN.VCN
WHERE
cast (AN.ETA AS DATE) BETWEEN @FromDate AND @ToDate AND
(PM.PortCode = @Port OR @Port IS NULL)AND
(VEA.VCN = @VCN OR @VCN IS NULL)AND
(vsl.VesselType = @VesselType OR @VesselType IS NULL)AND
vsl.VesselName  LIKE '%' + @VesselName + '%' OR @VesselName IS NULL
END

