CREATE PROCEDURE [dbo].[usp_rpt_GetArrivalAgents]
@Name varchar(50)= NULL
AS
BEGIN
SET NOCOUNT ON;
Declare @Count int
 Select @Count=count( DISTINCT AG.AgentID)  from AgentPort ap inner join
agent ag on ap.AgentID = ag.AgentID inner join
port pt on ap.PortCode = pt.PortCode
WHERE ((pt.PortCode = @Name) or (@Name IS NULL))
If @Count>1
begin
select NULL as ID,'All' as RegisteredName
union all
select DISTINCT AG.AgentID AS ID, ag.RegisteredName as RegisteredName from AgentPort ap inner join
agent ag on ap.AgentID = ag.AgentID inner join
port pt on ap.PortCode = pt.PortCode
WHERE (pt.PortCode = @Name or @Name IS NULL)
end
 else
 select DISTINCT AG.AgentID AS ID,ag.RegisteredName as RegisteredName from AgentPort ap inner join
agent ag on ap.AgentID = ag.AgentID inner join
port pt on ap.PortCode = pt.PortCode
WHERE (pt.PortCode = @Name or @Name IS NULL)      
END

