CREATE PROCEDURE [dbo].[usp_rpt_GetArrivalTerminal]
@Name varchar(50)= NULL,
@AGENT varchar(50)= NULL
AS
BEGIN
 SET NOCOUNT ON;
Declare @Count int
select @Count= Count (DISTINCT topp.TerminalOperatorID) from TerminalOperatorPort tp 
inner join TerminalOperator topp ON tp.TerminalOperatorID = topp.TerminalOperatorID
inner join port pt on tp.PortCode = pt.PortCode
inner join AgentPort ap on ap.PortCode = pt.PortCode
inner join agent ag on ag.AgentID = ap.AgentID
 WHERE (pt.PortCode = @Name or @Name  IS NULL ) AND (AG.AgentID = @AGENT or @AGENT  IS NULL)

   If @Count>1
     BEGIN

SELECT Null AS ID,'All' as TradingName
 UNION ALL
 select DISTINCT topp.TerminalOperatorID as ID,topp.TradingName as TradingName from TerminalOperatorPort tp 
inner join TerminalOperator topp ON tp.TerminalOperatorID = topp.TerminalOperatorID
inner join port pt on tp.PortCode = pt.PortCode
inner join AgentPort ap on ap.PortCode = pt.PortCode
inner join agent ag on ag.AgentID = ap.AgentID
   WHERE (pt.PortCode = @Name or @Name IS NULL) AND (AG.AgentID = @AGENT or @AGENT IS NULL )
    END
    ELSE
    BEGIN
 select DISTINCT topp.TerminalOperatorID AS ID,topp.TradingName as TradingName from TerminalOperatorPort tp 
inner join TerminalOperator topp ON tp.TerminalOperatorID = topp.TerminalOperatorID
inner join port pt on tp.PortCode = pt.PortCode
inner join AgentPort ap on ap.PortCode = pt.PortCode
inner join agent ag on ag.AgentID = ap.AgentID
   WHERE (pt.PortCode = @Name OR  @Name IS NULL) AND (AG.AgentID = @AGENT or @AGENT IS NULL)
  END
  END

