CREATE PROCEDURE [dbo].[usp_rpt_GetVCN]
@Port varchar(50)= NULL
AS
BEGIN
SET NOCOUNT ON;
Declare @Count int
 Select @Count=count( DISTINCT VC.VCN)  FROM  VesselCall vc 
inner join ArrivalNotification AN ON vc.VCN = AN.VCN
INNER JOIN Port PT ON AN.PortCode = PT.PortCode
WHERE ((PT.PortCode = @Port) or (@Port IS NULL))
If @Count>1
begin
select NULL as id,'All' as VCN
union all
select DISTINCT AN.VCN as id,VC.VCN AS VCN FROM  VesselCall vc 
inner join ArrivalNotification AN ON vc.VCN = AN.VCN
INNER JOIN Port PT ON AN.PortCode = PT.PortCode
WHERE (PT.PortCode = @Port or @Port IS NULL)
end
 else
select DISTINCT AN.VCN as id, VC.VCN AS VCN FROM  VesselCall vc 
inner join ArrivalNotification AN ON vc.VCN = AN.VCN
INNER JOIN Port PT ON AN.PortCode = PT.PortCode
WHERE (PT.PortCode = @Port or @Port IS NULL)      
END

GO
