CREATE PROCEDURE [dbo].[usp_rpt_IMDGReport]
@Port VARCHAR(50),
@VCN  VARCHAR(50),
@FromDate DATETIME,
@ToDate DATETIME,
@Classification varchar(50)= NULL
WITH 
EXECUTE AS CALLER
AS
BEGIN
SET NOCOUNT ON
SELECT  
AN.VCN,
VM.VesselName,
VM.CallSign, 
AN.ISPSReferenceNo,
pr.PortName as LastPortOfCall,
pr1.PortName as NextPortOfCall,
AN.ETA, AN.ETD,
AN.ReasonForVisit, 
VT.SubCatName AS VesselType,
AN.PortCode, 
PM.PortName, 
AN.RecordStatus, 
UM.UserName,
A.AgentID,
A.RegisteredName, 
 CASE WHEN (an.AnyDangerousGoodsonBoard = 'I') THEN 'N' ELSE 'Y' END AS IMDG, 
 TPR.TradingName, 
 VM.IMONo,
VM.VesselID, 
SC1.SubCatName AS REASONVisit, 
AN.UNNo,
SC2.SubCatName AS CARGO, 
BT.BerthName,
an.DischargeDate,
SC3.SubCatName AS ClassCode
FROM ArrivalNotification AS AN INNER JOIN
Vessel AS VM ON VM.VesselID = AN.VesselID INNER JOIN
SubCategory AS VT ON VT.SubCatCode = VM.VesselType INNER JOIN
Port AS PM ON AN.PortCode = PM.PortCode INNER JOIN
Users AS UM ON UM.UserID = AN.CreatedBy INNER JOIN
Agent AS A ON A.AgentID = AN.AgentID LEFT OUTER JOIN
TerminalOperator AS TPR ON TPR.TerminalOperatorID = AN.TerminalOperatorID INNER JOIN
VesselCall AS vc ON vc.VCN = AN.VCN INNER JOIN
SubCategory AS SC1 ON AN.ReasonForVisit = SC1.SubCatCode INNER JOIN
ArrivalCommodity AS AC ON AC.VCN = AN.VCN INNER JOIN
SubCategory AS SC2 ON AC.CargoType = SC2.SubCatCode INNER JOIN
Berth AS BT ON AC.PortCode = BT.PortCode AND AC.QuayCode = BT.QuayCode AND AC.BerthCode = BT.BerthCode
LEFT JOIN IMDGInformation IM ON IM.VCN = AN.VCN
LEFT JOIN SubCategory SC3 ON IM.ClassCode = SC3.SubCatCode
Left join PortRegistry pr on AN.LastPortOfCall = pr.PortCode 
Left join PortRegistry pr1 on AN.NextPortOfCall = pr1.PortCode
WHERE      
(PM.PortCode = @Port OR @Port IS NULL) AND
(AN.VCN = @VCN OR @VCN IS NULL) AND
cast (AN.ETA AS DATE) BETWEEN @FromDate AND @ToDate AND
(IM.ClassCode = @Classification or @Classification IS NULL)
AND an.IsIMDGANFinal ='Y'
 END

GO
