CREATE PROCEDURE [dbo].[usp_rpt_ISPSReport]
@Port  VARCHAR(50),
@VCN  VARCHAR(50),
@FromDate DATETIME,
@ToDate DATETIME
WITH 
EXECUTE AS CALLER
AS
BEGIN
SET NOCOUNT ON
SELECT 
AN.VCN, 
VM.VesselName,
VM.CallSign, 
AN.ISPSReferenceNo, 
pr.PortName as LastPortOfCall,
pr1.PortName as NextPortOfCall,
CASE WHEN (an.AppliedForISPS = 'I') THEN 'N' ELSE 'Y' END AS ISPS, 
AN.ETA, 
AN.ETD, 
sc.SubCatName as ReasonForVisit, 
AN.IsTerminalOperator, 
AN.AppliedDate, 
AN.PilotExemption, 
VT.SubCatName AS VesselType, 
AN.NominationDate, 
AN.PortCode, 
PM.PortName, 
AN.RecordStatus,
UM.UserName,
A.AgentID, 
A.RegisteredName,
CASE WHEN (an.AnyDangerousGoodsonBoard = 'I') THEN 'N' ELSE 'Y' END AS IMDG,
TPR.TerminalOperatorID, 
TPR.TradingName,
VM.IMONo,
VM.VesselID,
sc1.SubCatName as VesselNationality,
CASE WHEN (pr.IsSA = 'Y') THEN pr.PortName ELSE nULL END AS PtName
FROM ArrivalNotification AS AN INNER JOIN
Vessel AS VM ON VM.VesselID = AN.VesselID INNER JOIN
SubCategory AS VT ON VT.SubCatCode = VM.VesselType INNER JOIN
SubCategory AS sc ON AN.ReasonForVisit = sc.SubCatCode INNER JOIN
Port AS PM ON AN.PortCode = PM.PortCode INNER JOIN
Users AS UM ON UM.UserID = AN.CreatedBy INNER JOIN
Agent AS A ON A.AgentID = AN.AgentID LEFT OUTER JOIN
TerminalOperator AS TPR ON TPR.TerminalOperatorID = AN.TerminalOperatorID INNER JOIN
VesselCall AS vc ON vc.VCN = AN.VCN inner join
SubCategory sc1 on VM.VesselNationality = sc1.SubCatCode
Left join PortRegistry pr on AN.LastPortOfCall = pr.PortCode 
Left join PortRegistry pr1 on AN.NextPortOfCall = pr1.PortCode
WHERE 
(PM.PortCode = @Port OR @Port IS NULL) AND 
(AN.VCN = @VCN OR @VCN IS NULL) and
 cast (AN.ETA AS DATE) BETWEEN @FromDate AND @ToDate 
END

