CREATE PROCEDURE [dbo].[usp_rpt_Matrixweatherreport]
@Port varchar(50)= NULL
WITH 
EXECUTE AS CALLER
AS
BEGIN
 SET NOCOUNT ON
 
Select 
WI.PortCode,
PT. PortName, 
portarea, 
InfoDate, 
CONVERT(VARCHAR(8),InfoTime) AS InfoTime,
'AverageSpeed'  as 'WeathParam' ,
CONVERT(VARCHAR(5), AverageSpeed) as 'WeathValue'
from dbo.WeatherInformation WI,
WeatherInfoType WT,
Port PT
where WT.WeatherInfoTypeID = WI.InfoType
and WI.InfoType in (2,4,9) and (PT.PortCode = @Port OR @Port IS NULL)

UNION 

Select 
WI.PortCode,
PT. PortName,
portarea, InfoDate,
CONVERT(VARCHAR(8),InfoTime) AS InfoTime, 
'Gust', 
CONVERT(VARCHAR(5), Gust) as Gust
from dbo.WeatherInformation WI,
WeatherInfoType WT,
Port PT
where WT.WeatherInfoTypeID = WI.InfoType
and WI.InfoType in (2,4,9) and (PT.PortCode =@Port OR @Port IS NULL)

UNION 

Select 
WI.PortCode,
PT. PortName,
portarea, InfoDate,
CONVERT(VARCHAR(8),InfoTime) AS InfoTime, 
'WindDirection', 
dbo.udf_GetWindDirection(Convert(numeric(18,2),Direction)) as WindDirection
from dbo.WeatherInformation WI,
WeatherInfoType WT,
Port PT
where WT.WeatherInfoTypeID = WI.InfoType
and WI.InfoType in (2,4,9) and (PT.PortCode = @Port OR @Port IS NULL)
and len(ltrim(rtrim(direction))) >0

UNION 

Select 
WI.PortCode,
PT. PortName,
Null PortArea, 
InfoDate, 
CONVERT(VARCHAR(8),InfoTime) AS InfoTime,
'Tide',
CONVERT(VARCHAR(5), Tide) AS Tide
from dbo.WeatherInformation WI, Port PT where WI.InfoType =6 and (PT.PortCode = @Port OR @Port IS NULL)

