where (PT.PortCode = @Port OR @Port IS NULL)

UNION 

Select
WB.PortCode,
PT. PortName,
PB.BoundryLocation, 
WB.InfoDate, 
CONVERT(VARCHAR(8),WB.InfoTime) AS InfoTime,
'Hmax',
CONVERT(VARCHAR(5), Hmax) AS  Hmax
from WeathBuoyInformation WB,
PortBoundry PB, 
Port PT
where PB.PortCode = WB.PortCode and PB.BoundryID = WB.BoundryID 
and  PT.PortCode= @Port
UNION 

Select 
WB.PortCode,
PT. PortName,
'',
WB.InfoDate,
CONVERT(VARCHAR(8),WB.InfoTime) AS InfoTime, 
'TP',
CONVERT(VARCHAR(7), Hmax) AS Hmax
from WeathBuoyInformation WB,Port PT
where (PT.PortCode = @Port OR @Port IS NULL)

UNION 

Select 
WB.PortCode,
PT. PortName,
PB.BoundryLocation,
WB.InfoDate,
CONVERT(VARCHAR(8),WB.InfoTime) AS InfoTime, 
'TP',
CONVERT(VARCHAR(7), TP) AS TP
