sc.SubCatName as AnchReason
FROM VesselCallAnchorage VCA
INNER JOIN ArrivalNotification AN ON VCA.VCN = AN.VCN
INNER JOIN PORT PT ON AN.PortCode = PT.PortCode
inner join SubCategory sc on VCA.Reason = sc.SubCatCode
WHERE (pt.PortCode = @Port OR @Port IS NULL)
and cast (VCA.AnchorDropTime AS DATE) BETWEEN @FromDate AND @ToDate 
END

