CREATE PROCEDURE [dbo].[usp_rpt_PortHealthClerance]
@Port Varchar(50),
@PRVCN Varchar(50),
@FromDate DATETIME,
@ToDate DATETIME
WITH 
EXECUTE AS CALLER
AS
BEGIN
SET NOCOUNT ON
SELECT
CASE WHEN AN.IsPHANFinal = 'Y' THEN 'Cleared' ELSE 
CASE WHEN AN.IsPHANFinal = 'N' THEN 'Not Cleared' ELSE 
CASE WHEN AN.IsPHANFinal = 'NA' THEN 'Exempted' ELSE ''
END END END AS PSTATUS,
AN.VCN,
vm.VesselName,
pr.PortName as  LastPortOfCall,
pr1.PortName as NextPortOfCall,
AN.ETA,
AN.ETD,
vt.SubCatName as VesselType,
AN.PortCode,
PM.PortName,
AN.RecordStatus,
UM.UserName,
A.AgentID,
A.RegisteredName,
VM.VesselID,
SC1.SubCatName AS REASONVisit,
SC2.SubCatName AS CARGO,
BT.BerthName,
an.Clearance,
WI.ModifiedDate AS VERIFIEDDATE
FROM ArrivalNotification AN
INNER JOIN Vessel VM ON VM.VesselID = AN.VesselID
INNER JOIN SubCategory VT ON VT.SubCatCode = VM.VesselType
INNER JOIN Port PM ON AN.PortCode = PM.PortCode
INNER JOIN Users UM on UM.UserID = AN.CreatedBy
INNER JOIN Agent A on a.AgentID = AN.AgentID
LEFT JOIN TerminalOperator TPR on TPR.TerminalOperatorID = an.TerminalOperatorID inner join
vesselcall vc on vc.VCN = AN.VCN INNER JOIN 
SubCategory SC1 ON AN.ReasonForVisit = SC1.SubCatCode INNER JOIN
ArrivalCommodity AC ON AC.VCN = AN.VCN INNER JOIN
SubCategory SC2 ON AC.CargoType = SC2.SubCatCode INNER JOIN
BERTH BT ON AC.PortCode = BT.PortCode AND AC.QuayCode = BT.QuayCode AND AC.BerthCode = BT.BerthCode
INNER JOIN WorkflowInstance WI ON AN.WorkflowInstanceId = WI.WorkflowInstanceId
Left join PortRegistry pr on AN.LastPortOfCall = pr.PortCode 
Left join PortRegistry pr1 on AN.NextPortOfCall = pr1.PortCode
WHERE
(AN.VCN = @PRVCN OR @PRVCN IS NULL)AND
(PM.PortCode = @Port OR @Port IS NULL)and
cast (AN.ETA AS DATE) BETWEEN @FromDate AND @ToDate 

END

