CREATE PROCEDURE [dbo].[usp_SetWorkFlowTasksAndRoles]
@EntityID INT,
@WorkflowTaskCode VARCHAR(8),
@HasNotification CHAR(1),
@ValidityPeriod INT,	
@CommaSeperatedRoleIDs NVARCHAR(MAX),
@Step INT,
@NextStep INT,
@APIUrl NVARCHAR(400),
@PortCode VARCHAR(10),
@CreatedBy INT,
@ModifiedBy INT,
@RecordStatus NCHAR(2),
@HasRemarks CHAR(1)

AS
BEGIN

SET NOCOUNT ON;


DECLARE @WorkflowTaskCOUNT INT, @WorkflowTaskRoleCOUNT INT, @CreatedDate DATETIME = GETDATE(), @ModifiedDate DATETIME=GETDATE()

--Check all primary key values
SET @WorkflowTaskCOUNT=(SELECT COUNT(1) FROM WorkflowTask with (nolock) WHERE EntityID=@EntityID AND PortCode=@PortCode AND WorkflowTaskCode=@WorkflowTaskCode AND Step=@Step)
--Check count exists
IF(@WorkflowTaskCOUNT<=0)
BEGIN
INSERT INTO WorkflowTask(EntityID, WorkflowTaskCode, Step, NextStep, ValidityPeriod, HasNotification,HasRemarks, APIUrl, RecordStatus, CreatedBy, CreatedDate, ModifiedBy, ModifiedDate, PortCode)
SELECT @EntityID,@WorkflowTaskCode,@Step,@NextStep,@ValidityPeriod,@HasNotification,@HasRemarks,@APIUrl,@RecordStatus, @CreatedBy, @CreatedDate, @ModifiedBy, @ModifiedDate,@PortCode
END

IF(@CommaSeperatedRoleIDs IS NOT NULL)
BEGIN

--Check all primary key values
SET @WorkflowTaskRoleCOUNT=(SELECT COUNT(1) FROM WorkflowTaskRole WITH (NOLOCK) WHERE EntityID=@EntityID AND PortCode=@PortCode AND Step=@Step AND RoleID IN (SELECT CONVERT(INT,Value) FROM dbo.udf_SplitString(@CommaSeperatedRoleIDs, ',')))
--Check count exists
IF(@WorkflowTaskRoleCOUNT<=0)
BEGIN
INSERT INTO WorkflowTaskRole(EntityID, RoleID, Step, RecordStatus, CreatedBy, CreatedDate, ModifiedBy, ModifiedDate, PortCode)
SELECT @EntityID,CONVERT(INT,Value),@Step,@RecordStatus,@CreatedBy,@CreatedDate,@ModifiedBy,@ModifiedDate,@PortCode FROM dbo.udf_SplitString(@CommaSeperatedRoleIDs, ',')
END

END

SELECT 1

END
GO
