CREATE PROCEDURE [dbo].[usp_StatementofFacts]
@VCN varchar(12)
WITH EXEC AS CALLER
AS
BEGIN

select AN.VCN,V.VesselName, AN.VoyageIn, AN.VoyageOut, VC.ETB as DateFrom,VC.ETUB as DateTo, 
FRB.BerthName as BerthFrom, TOB.BerthName as BerthTo, ARPT.PilotOnBoard as InwardPilotOnBoard, ARPT.PilotOff as InwardPilotAway, ARTSK.FirstLineIn as InwardFirstLine, ARTSK.LastLineIn as InwardAllFast
,SAPT.PilotOnBoard as OutwardPilotOnBoard, SAPT.PilotOff as OutwardPilotAway, SAPT.EndTime as OutwardAllCast
,ARTSK.ForwardDraft as DraftArrivalFwd,ARTSK.AftDraft as DraftArrivalAft, SATSK.ForwardDraft as DraftSailingFwd,SATSK.AftDraft as DraftSailingAft
from ArrivalNotification AN
INNER JOIN VesselCall VC ON VC.VCN = AN.VCN
INNER JOIN Vessel V ON V.VesselID = AN.VesselID
LEFT JOIN Berth FRB ON FRB.PortCode = VC.FromPositionPortCode AND FRB.QuayCode = VC.FromPositionQuayCode AND FRB.BerthCode =VC.FromPositionBerthCode
LEFT JOIN Berth TOB ON TOB.PortCode = VC.ToPositionPortCode AND TOB.QuayCode = VC.ToPositionQuayCode AND TOB.BerthCode =VC.ToPositionBerthCode
LEFT JOIN ServiceRequest ARM ON ARM.VCN = AN.VCN AND ARM.MovementType ='ARMV'
LEFT JOIN VesselCallMovement ARCL ON ARCL.ServiceRequestID = ARM.ServiceRequestID
LEFT JOIN ResourceAllocation ARCLR ON ARCLR.ServiceReferenceID = ARM.ServiceRequestID AND ARCLR.OperationType = 'PILT'
LEFT JOIN PilotageServiceRecording ARPT ON ARPT.ResourceAllocationID = ARCLR.ResourceAllocationID
LEFT JOIN ResourceAllocation ARBRT ON ARBRT.ServiceReferenceID = ARM.ServiceRequestID AND ARBRT.OperationType = 'BRTH'
LEFT JOIN ShiftingBerthingTaskExecution ARTSK ON ARTSK.ResourceAllocationID = ARBRT.ResourceAllocationID
LEFT JOIN ServiceRequest SAM ON SAM.VCN = AN.VCN AND ARM.MovementType ='SGMV'
LEFT JOIN VesselCallMovement SACL ON SACL.ServiceRequestID = SAM.ServiceRequestID
LEFT JOIN ResourceAllocation SACLR ON SACLR.ServiceReferenceID = SAM.ServiceRequestID AND SACLR.OperationType = 'PILT'
LEFT JOIN PilotageServiceRecording SAPT ON SAPT.ResourceAllocationID = SACLR.ResourceAllocationID
LEFT JOIN ResourceAllocation SABRT ON SABRT.ServiceReferenceID = SAM.ServiceRequestID AND SABRT.OperationType = 'BRTH'
LEFT JOIN ShiftingBerthingTaskExecution SATSK ON SATSK.ResourceAllocationID = SABRT.ResourceAllocationID
WHERE AN.VCN = @VCN

END;
GO
