CREATE PROCEDURE [dbo].[usp_StatementofFacts_Tugs]
@VCN VARCHAR(12)
AS 
BEGIN

select VC.VCN,  ARM.MovementType,  ARC.CraftName, ARCS.SubCatName CRAFTTYPE
,ARC.ForwardDraftM, ARC.AftDraftM
from  VesselCall VC 
 INNER JOIN ServiceRequest ARM ON ARM.VCN = vc.VCN AND ARM.MovementType ='ARMV'
INNER JOIN VesselCallMovement ARCL ON ARCL.ServiceRequestID = ARM.ServiceRequestID
INNER JOIN ResourceAllocation ARCLR ON ARCLR.ServiceReferenceID  = ARM.ServiceRequestID AND ARCLR.OperationType = 'TGWR'
inner join Craft ARC on arc.CraftID = ARCLR.CraftID
inner join SubCategory ARCS ON ARCS.SubCatCode = ARC.CraftType
where VC.VCN = @VCN
UNION 

select VC.VCN,  ARM.MovementType, ARC.CraftName, ARCS.SubCatName CRAFTTYPE
,ARC.ForwardDraftM, ARC.AftDraftM
from  VesselCall VC 
 INNER JOIN ServiceRequest ARM ON ARM.VCN = vc.VCN AND ARM.MovementType ='SGMV'
INNER JOIN VesselCallMovement ARCL ON ARCL.ServiceRequestID = ARM.ServiceRequestID
INNER JOIN ResourceAllocation ARCLR ON ARCLR.ServiceReferenceID  = ARM.ServiceRequestID AND ARCLR.OperationType = 'TGWR'
inner join Craft ARC on arc.CraftID = ARCLR.CraftID
inner join SubCategory ARCS ON ARCS.SubCatCode = ARC.CraftType
where VC.VCN = @VCN

END;
