CREATE PROCEDURE [dbo].[usp_Voyage_ServiceRequest_Dtls]
@VCN varchar(20)
AS
BEGIN
SET NOCOUNT ON;
SELECT 
CONVERT(varchar(20),a.ServiceRequestID) as VCN, 
b.SubCatName MovementName,
a.CreatedDate RequestDatetime,
dbo.udf_GetWorkflowStatusforGrid (w.WorkflowTaskCode) AS SRStatus
FROM ServiceRequest a WITH (NOLOCK)
INNER JOIN dbo.vesselcall v WITH (NOLOCK) on v.VCN=a.VCN
INNER JOIN dbo.SubCategory b WITH (NOLOCK) ON a.MovementType = b.SubCatCode
LEFT JOIN dbo.WorkflowInstance w WITH (NOLOCK) ON a.WorkflowInstanceID = w.WorkflowInstanceId
LEFT JOIN dbo.VesselCallMovement vcm WITH (NOLOCK) ON vcm.ServiceRequestID = a.ServiceRequestID
WHERE A.VCN = @VCN
END


