/****** Object:  StoredProcedure [dbo].[usp_VoyageMonitoringDtls]    Script Date: 4/13/2015 6:50:05 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROCEDURE [dbo].[usp_VoyageMonitoringDtls]
WITH
EXECUTE AS CALLER
AS
BEGIN
SELECT DISTINCT
vs.VesselID AS VesselID, 
an.VCN AS VCN, 
vs.VesselName AS VesselName, 
an.VoyageIn AS VoyageIn, 
an.VoyageOut AS VoyageOut,
(Select dbo.udf_GetArrivalReasonForVisit (an.VCN)) AS ReasonForVisit,
sub2.SubCatName AS VesselType, 
vs.CallSign AS CallSign, 
an.ETA AS ETA, 
an.ETD AS ETD,
vs.IMONo AS IMONo, 
vs.LengthOverallInM AS LengthOverallInM, 
vs.BeamInM AS BeamInM,
sub1.SubCatName AS VesselNationality, 
vs.GrossRegisteredTonnageInMT AS GrossRegisteredTonnageInMT, 
vs.DeadWeightTonnageInMT AS DeadWeightTonnageInMT,
(SELECT portname FROM PortRegistry WITH (NOLOCK) WHERE portcode = an.LastPortOfCall) AS LastPortOfCall, 
(SELECT portname FROM PortRegistry WITH (NOLOCK) WHERE portcode = an.NextPortOfCall) AS NextPortOfCall, 
CASE WHEN an.Tidal='Y' THEN 'Yes' ELSE 'No' END AS Tidal, 
CASE WHEN an.DaylightRestriction='Y' THEN 'Yes' ELSE 'No' END AS DaylightRestriction,
an.NominationDate AS NominationDate,
CASE WHEN an.ExceedPortLimitations='Y' THEN 'Yes' ELSE 'No' END AS PortRestriction, 
an.CargoDescription AS CargoType, 
vc.ATA AS ATA, 
vc.ATD AS ATD,
t.RegisteredName AS Terminal, 
an.ArrDraft AS ArrDraft,
an.DepDraft AS DepDraft, 
an.PortCode AS portcode
FROM vessel vs
INNER JOIN dbo.ArrivalNotification an ON an.VesselID = vs.VesselID
INNER JOIN dbo.VesselCall vc on vc.VCN = an.VCN
LEFT JOIN dbo.terminaloperator t on an.TerminalOperatorID = t.TerminalOperatorID
LEFT JOIN dbo.SubCategory sub1 ON vs.VesselNationality = sub1.SubCatCode
LEFT JOIN dbo.SubCategory sub2 ON vs.VesselType = sub2.SubCatCode
ORDER BY an.VCN

END;

