/****** Object:  StoredProcedure [dbo].[usp_WorkFlowTaskAction]    Script Date: 4/13/2015 6:50:05 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROCEDURE [dbo].[usp_WorkFlowTaskAction]
   @ReferenceID NVARCHAR (12), @WorkflowInstanceId INT, @UserID INT
AS
   IF (@WorkflowInstanceId = 0)
      BEGIN
         SELECT e.EntityCode,
                e.Entityname AS RequestName,
                b.APIUrl,
                b.WorkflowTaskCode,
                WI.WorkflowInstanceId,
                WI.ReferenceID,
                wft.NextStep,
                sc.SubCatName AS TaskName,
                dbo.udf_GetWorkflowStatusforGrid (sc.SubCatCode)
                   AS TaskDescription,
                ([dbo].[udf_GetWorkflowPreviousRemarks] (
                    WI.WorkflowInstanceId))
                   AS PreviousRemarks,
                '' AS Remarks,
                b.HasRemarks
           FROM WorkflowInstance WI
           JOIN WorkflowProcess WP ON WI.WorkflowInstanceId = WP.WorkflowInstanceId
           AND WP.WorkflowProcessId = WI.WorkflowProcessId
           JOIN Entity e ON WI.EntityID = e.EntityID
           JOIN WorkflowTask wft ON WI.WorkflowTaskCode = wft.WorkflowTaskCode
           AND wft.EntityID = wi.EntityID
           AND wft.PortCode = WI.PortCode
           JOIN WorkflowTask b ON b.EntityID = e.EntityID
           AND b.Step = wft.NextStep
           AND b.PortCode = WI.PortCode
           JOIN SubCategory sc ON b.WorkflowTaskCode = sc.SubCatCode
           WHERE     wft.NextStep NOT IN (9999)
           AND wft.NextStep IN (SELECT Step FROM WorkflowTaskRole wfr
                                WHERE     RoleID IN (SELECT roleid FROM UserRole WHERE UserID = @UserID)
           AND wfr.EntityID = e.EntityID
           AND wfr.PortCode = WI.PortCode)
           AND WI.ReferenceID = @ReferenceID
      END
   ELSE
      SELECT e.EntityCode, e.Entityname AS RequestName, b.APIUrl,
             b.WorkflowTaskCode,
             WI.WorkflowInstanceId,
             WI.ReferenceID,
             wft.NextStep,
             sc.SubCatName AS TaskName,
             dbo.udf_GetWorkflowStatusforGrid (sc.SubCatCode)
                AS TaskDescription,
             ([dbo].[udf_GetWorkflowPreviousRemarks] (WI.WorkflowInstanceId))
                AS PreviousRemarks,
             '' AS Remarks,
             b.HasRemarks
        FROM WorkflowInstance WI
             JOIN WorkflowProcess WP
             ON     WI.WorkflowInstanceId = WP.WorkflowInstanceId
             AND WP.WorkflowProcessId = WI.WorkflowProcessId
             JOIN Entity e ON WI.EntityID = e.EntityID
             JOIN WorkflowTask wft ON WI.WorkflowTaskCode = wft.WorkflowTaskCode
             AND wft.EntityID = wi.EntityID
             AND wft.PortCode = WI.PortCode
             JOIN WorkflowTask b ON b.EntityID = e.EntityID
             AND b.Step = wft.NextStep
             AND b.PortCode = WI.PortCode
             JOIN SubCategory sc ON b.WorkflowTaskCode = sc.SubCatCode
         WHERE     wft.NextStep NOT IN (9999)
             AND wft.NextStep IN (SELECT Step
                                    FROM WorkflowTaskRole wfr
                                   WHERE     RoleID IN (SELECT roleid
                                                          FROM UserRole
                                                         WHERE UserID = @UserID)
                                         AND wfr.EntityID = e.EntityID
                                         AND wfr.PortCode = WI.PortCode)
             AND WI.ReferenceID = @ReferenceID
             AND WI.WorkflowInstanceId = @WorkflowInstanceId
GO

